Config.ExternalExamples={
aaTaveladi:["ಇನಗಣತ್ರಯಂಬುನಿಂದ್ರದ್ವಯಂಬುನು\nಹಂಸಪಂಚಕಂಬು ನಾಟಿ ವೆಲದಿ\nಇನಗಣತ್ರಯಂಬುನಿಂದ್ರದ್ವಯಂಬುನು\nಹಂಸಪಂಚಕಂಬು ನಾಟಿ ವೆಲದಿ","ಜನುಲ ಕೆಲ್ಲ ಶುಭಮು ಸಾಂಖ್ಯ ಯೋಗಮು; ದಾನಿ\nವಲನ ಧರ್ಮನಿಷ್ಟವಲನ ನಯಿನ\nನಂತ್ಯಕಾಲಮಂದು ಹರಿಚಿಂತ ಸೇಯುಟ\nಪುಟ್ಟುವುಲಕು ಫಲಮು ಭೂವರೇಂದ್ರ!","ಪವನಮುಲು ಜಯಿಂಚಿ ಪರಿಹೃತಸಂಗು?ಡೈ\nಯಿಂದ್ರಿಯಮುಲ ಗರ್ವಮೆಲ್ಲ ಮಾಪಿ\nಹರಿ ವಿಶಾಲರೂಪಮಂದು? ಜಿತ್ತಮು? ಜೇರ್ಚಿ\nನಿಲುಪವಲಯು ಬುದ್ಧಿ ನೆಱಪಿ ಬುಧು?ಡು.","ಪರಮ ಭಾಗವತುಲು ಪಾಟಿಂಚು ಪಥ ಮಿದಿ\nಯೀ ಪಥಮುನ ಯೋಗಿ ಯೇ?ಗೆನೇನಿ\nಮಗುಡಿ ರಾ?ಡು ವಾ?ಡು ಮಱಿ ಸಂಶಯಮು ಲೇದು\nಕಲ್ಪಶತಮು ಲೈನ? ಗೌರವೇಂದ್ರ!","ಸುತುಲ ಹಿತುಲ ವಿಡಿಚಿ, ಚುಟ್ಟಾಲ ವಿಡಿಚಿ, ಯಿ\nಲ್ಲಾಲಿ ವಿಡಿಚಿ, ಬಹು ಬಲಾಳಿ ವಿಡಿಚಿ\nರಾಜು ಹೃದಯ ಮಿಡಿಯೆ ರಾಜೀವನಯನುಪೈ\nಧನಮು ವಿಡಿಚಿ, ಜಡ್ಡು?ದನಮು ವಿಡಿಚಿ.","ನೀಲಕಂಧರುನಕು ನೀಕು ನಾಕು ಸನತ್ಕು\nಮಾರ ಮುಖ್ಯ ಸುತಸಮಾಜಮುನಕು\nಧರ್ಮ ಸತ್ತ್ವ ಬುದ್ಧಿ ತತ್ತ್ವಮುಲಕು ನೀಶ್ವ\nರಾತ್ಮ ವಿನುಮು ಪರಮಮೈನ ನೆಲವು."],
taeTageeti:["ದೇವದೇವುನಿ ಚಿಂತಿಂಚು ದಿನಮು ದಿನಮು;\nಚಕ್ರಹಸ್ತುನಿ? ಬ್ರಕಟಿಂಚು ಚದುವು ಚದುವು;\nಕುಂಭಿನೀಧವು? ಜೆಪ್ಪೆಡಿ ಗುರು?ಡು ಗುರು?ಡು;\nತಂಡ್ರಿ! ಹರಿ? ಜೇರು ಮನಿಯೆಡಿ ತಂಡ್ರಿ ತಂಡ್ರಿ.","ಅರಸಿ ನಿರ್ಗುಣಬ್ರಹ್ಮಂಬು ನಾಶ್ರಯಿಂಚಿ\nವಿಧಿನಿಷೇಧ ನಿವೃತ್ತಿ ಸದ್ವಿಮಲಮತುಲು\nಸೇಯುಚುಂದುರು ಹರಿಗುಣಚಿಂತನಮುಲು\nಮಾನಸಂಬುಲ ನೇಪ್ರೊದ್ದು ಮಾನವೇಂದ್ರ! ","ಮಂದ ಗೊಂದಲ ಮಂದ ನಮಂದವೃಷ್ಟಿ?,\nಗ್ರಂದುಕೊನು? ಡಂಚು ನಿಂದ್ರುಂಡು ಮಂದಲಿಂಪ?\nಜಂಡಪವನ ಸಮುದ್ಧೂತ ಚಟುಲ ವಿಲಯ\nಸಮಯ ಸಂವರ್ತ ಕಾಭೀಲ ಜಲಧರಮುಲು.","ಭದ್ರಮಗು?ಗಾಕ! ನೀಕು ನೋ! ಪದ್ಮಗರ್ಭ!\nವರಮು ನಿಪು ಡಿತ್ತು ನೆಱಿ?ಗಿಂಪು ವಾಂಛಿತಂಬು;\nದೇವದೇವು?ಡ ನಗು ನಸ್ಮದೀಯ ಪಾದ\nದರ್ಶನಂ ಬವಧಿ ವಿಪತ್ತಿದಶಲ ಕನಘ!","ಚೇತುಲಾರಂಗ ಶಿವುನಿ? ಬೂಜಿಂಪ?ಡೇನಿ\nನೋರು ನೊವ್ವಂಗ ಹರಿಕೀರ್ತಿ ನುಡುವ?ಡೇನಿ\nದಯಯು ಸತ್ಯಂಬು ಲೋನುಗಾ? ದಲ?ಪ?ಡೇನಿ? \nಗಲುಗ ನೇಟಿಕಿ? ದಲ್ಲುಲ ಕಡುಪು? ಜೇಟು.","ಕ್ಷಿತಿನಿ  ಗೋಶಂಬು ಲರಸಿ ವೀಕ್ಷಿಂಪವಲಯು?\nಬಿದಪ ನಾಲಿಂಪ?ಜನುನು ಗೋವಿದುಲ? ಬ್ರಶ್ನ\nಸೇಯ?ದಗು? ಗಡುಮದಿನಿ ಯೋಚಿಂಪುಟೊಪ್ಪು\nನೆಚಟ ನೆಱು?ಗನಿಚೋ ನೇರಮೆಂಚ?ಗೂಡ\nದನುಚು ನೇ ಭಾವಿ ಲೋಕುಲ ನಭಿನುತಿಂತು"],
shaTpadamu:["ಶ್ರೀ ರಾಮ! ಜಯರಾಮ!\nಧೀರಾತ್ಮ! ನೀ ಪ್ರೇಮ	\nಧಾರಾಳಮುಗ ಗೊನ್ನ ಧನ್ಯ ಸೀತ!\nಕಾರುಣ್ಯಮುನು ಜೂಪಿ\nನೀರೂಪ ಮುನು ಜೂಪಿ\nಕೋರಿನ ಮುಕ್ತಿನಿ ಕೊಲುಪುಮಯ್ಯ!","ಮೆಱಿಯಂಗ ನಿದ್ದಱಿ\nದ್ದಱು ಸುರೇಂದ್ರುಲು ಮೂ?ಡು\nತೆಱೆ?ಗುಲನ್‌ ಶಶಿ?ಗೂಡ ನರ್ಥಂಬುಲನ್‌\nನೆಱಿ? ಗ್ರಾಲ?ಗಾ ವಳ್ಳು\nದೊಱ?ಗ ಷಟ್ಪದರೀತಿ\nವಱಲು? ಜಕ್ರಿಪದಾಬ್ಜ ವರ್ಣನಂಬು."],
sarvalaghusIsamu:["ನವ ವಿಕಚ ಸರಸಿರುಹ ನಯನಯುಗ! ನಿಜಚರಣ\nಗಗನಚರನದಿ ಜನಿತ! ನಿಗಮವಿನುತ!\nಜಲಧಿಸುತ ಕುಚಕಲಶ ಲಲಿತ ಮೃಗಮದ ರುಚಿರ\nಪರಿಮಳಿತ ನಿಜಹೃದಯ! ಧರಣಿಭರಣ!\nದ್ರುಹಿಣಮುಖ ಸುರನಿಕರ ವಿಹಿತ ನುತಿಕಲಿತಗುಣ!\nಕಟಿಘಟಿತ ರುಚಿರತರ ಕನಕವಸನ!\nಭುಜಗರಿಪು ವರಗಮನ! ರಜತಗಿರಿಪತಿವಿನುತ!\nಸತತಜಪರತ! ನಿಯಮಸರಣಿ ಚರಿತ!","ಮೃಗಮದಮು ತಿಲಕಮುನು ನಗು ಮೊಗಮುಚೆಲುವಮುನು \nನಲ?ತಿಪವಡಮು? ದೆಗಡು ನಧರಪುಟಮು\nವಲುದಜಘನಮುಲು ಬೊಲುಪಲರುಕನಕಪುವಲುವ \n ಕಲಿತಕರಚರಣಮಣಿಕಟಕಮುಲುನು\nವಿರುಲತುರುಮುನು ನಮಿಲಿಪುರಿಸೊಬಗುಮಕರಿಕಮು \n ರಚನ ನೆಸ?ಗಿನ ಚೆವುಲ ರವಣಮುಲುನು\nಕರಕಮಲಯುಗಳ ಧೃತಿ ಮುರಳಿಯುನು ದ್ರಿವಿಧಮಗು \n ನಿಲುಕಡಯು ನಿಟಲತಟಿ ನೆಱಯು ಕುರುಲು"],
sarvalaghusIsamu2:["ನವ ವಿಕಚ ಸರಸಿರುಹ ನಯನಯುಗ! ನಿಜಚರಣಗಗನಚರನದಿ ಜನಿತ! ನಿಗಮವಿನುತ!\nಜಲಧಿಸುತ ಕುಚಕಲಶ ಲಲಿತ ಮೃಗಮದ ರುಚಿರಪರಿಮಳಿತ ನಿಜಹೃದಯ! ಧರಣಿಭರಣ!\nದ್ರುಹಿಣಮುಖ ಸುರನಿಕರ ವಿಹಿತ ನುತಿಕಲಿತಗುಣ!ಕಟಿಘಟಿತ ರುಚಿರತರ ಕನಕವಸನ!\nಭುಜಗರಿಪು ವರಗಮನ! ರಜತಗಿರಿಪತಿವಿನುತ!ಸತತಜಪರತ! ನಿಯಮಸರಣಿ ಚರಿತ!","ಮೃಗಮದಮು ತಿಲಕಮುನು ನಗು ಮೊಗಮುಚೆಲುವಮುನು - ನಲ?ತಿಪವಡಮು? ದೆಗಡು ನಧರಪುಟಮು\nವಲುದಜಘನಮುಲು ಬೊಲುಪಲರುಕನಕಪುವಲುವ - ಕಲಿತಕರಚರಣಮಣಿಕಟಕಮುಲುನು\nವಿರುಲತುರುಮುನು ನಮಿಲಿಪುರಿಸೊಬಗುಮಕರಿಕಮು - ರಚನ ನೆಸ?ಗಿನ ಚೆವುಲ ರವಣಮುಲುನು\nಕರಕಮಲಯುಗಳ ಧೃತಿ ಮುರಳಿಯುನು ದ್ರಿವಿಧಮಗು - ನಿಲುಕಡಯು ನಿಟಲತಟಿ ನೆಱಯು ಕುರುಲು","ಜಲಜ ಹಿತ ಕುಲ ಕಲಶ ಜಲಧಿ ಹಿಮ ಕಿರಣುನಕು - ದಶರಥುನಿ ತನಯುನಕು ನಶಿಕಿ ಹರಿಕಿ;\nಜನಕ ಸುತ ಹೃದಯಮುನ ತನರು ಪ್ರಿಯ ಸದನುನಕು - ಜನ ಹೃದಯ ನಿಲಯುನಕು ಸಹೃದಯುನಕು;\nದಿವಿಜ ಗಣ ವಿನುತುನಕು; ದಿತಿಜ ಗಣ ಶಮನುನಕು - ಜಗದವನ ನಿರತುನಕು ಜನ ಹಿತುನಕು;\nಭವ ಭಯಮುಲನು ದೊಲಚಿ; ಪರಮ ಸುಖಮುಲನೊಸಗು - ಪರಮ ಪುರುಷುನಕು ಪುರಹರ ಸಖುನಕು","ನಿರತಮು ಭಗವತಿ ಕರುಣನು ರಸನಮು ಸರಸಕವಿತಲಕು ಸದನಮವದ?\nತಿರಮುಗ ಕೃಪನಿಡಿ ಗುರುವುಲು ನಡುಪಗ ಕವಿತಲು ಪೊರಲವೆ? ಕಲಮು ಕದುಪ\nರಸಮಯಜಗಮುನ ಮಸಲುಚು ಮುರಿಸೆಡಿ ಶುಕಪಿಕಮುಲವಲೆ ಸುಮಧುರಮುಗ\nತೆಲುಗುನ ಪದಮುಲು ವೆಲುವಡು ಬುಧಜನವಿನುತಿಕಿ ಸರಿಪಡು ವಿಧಮುಗ ಸುಧಿ!"],
seesaM:["ಇಂದ್ರಗಣಮುಲಾರುನಿನಗಣಂಬುಲುರೆಂಡು\nಪಾದಪಾದಮುನಕು ಬರುಗುಚುಂಡು\nಇಂದ್ರಗಣಮುಲಾರುನಿನಗಣಂಬುಲುರೆಂಡು\nಪಾದಪಾದಮುನಕು ಬರುಗುಚುಂಡು","ಕಮಲಾಕ್ಷು ನರ್ಚಿಂಚು ಕರಮುಲು ಕರಮುಲು;\nಶ್ರೀನಾಥು ವರ್ಣಿಂಚು ಜಿಹ್ವ ಜಿಹ್ವ;\nಸುರರಕ್ಷಕುನಿ? ಜೂಚು ಚೂಡ್ಕುಲು ಚೂಡ್ಕುಲು;\nಶೇಷಶಾಯಿಕಿ ಮ್ರೊಕ್ಕು ಶಿರಮು ಶಿರಮು;\nವಿಷ್ಣು ನಾಕರ್ಣಿಂಚು ವೀನುಲು ವೀನುಲು; \nಮಧುವೈರಿ? ದವಿಲಿನ ಮನಮು ಮನಮು;\nಭಗವಂತು ವಲಗೊನು ಪದಮುಲು ಪದಮುಲು;\nಪುರುಷೋತ್ತಮುನಿ ಮೀ?ದಿ ಬುದ್ಧಿ ಬುದ್ಧಿ","ಪಂದಿಕೈ ಪೋರಾಡ ಫಾಲಾಕ್ಷು? ಡೆವ್ವನಿ;\nಬಲಮುನ ನಾ ಕಿಚ್ಚೆ? ಬಾಶುಪತಮು?\nನೆವ್ವನಿ ಲಾವುನ ನಿಮ್ಮೇನ ದೇವೇಂದ್ರು;\nಪೀಠಾರ್ಥಮುನ ನುಂಡ ಬೆಂಪು? ಗಂಟಿ??\nಗಾಲಕೇಯ ನಿವಾತ ಕವಚಾದಿದೈತ್ಯುಲ?;\nಜಂಪಿತಿ ನೆವ್ವನಿ ಸಂಸ್ಮರಿಂಚಿ?\nಗೋಗ್ರಹಣಮು ನಾ?ಡು ಕುರುಕುಲಾಂಭೋನಿಧಿ?;\nಗಡಚಿತಿ ನೆವ್ವನಿ ಕರುಣ? ಜೇಸಿ?","ಕ್ಷಿತಿಪತಿ! ನೀ ಪ್ರಶ್ನ ಸಿದ್ಧಂಬು ಮಂಚಿದಿ;\nಯಾತ್ಮವೇತ್ತಲು ಮೆತ್ತು ರಖಿಲಶುಭದ\nಮಾಕರ್ಣನೀಯಂಬು ಲಯುತಸಂಖ್ಯಲು ಗಲ; \nವಂದು ಮುಖ್ಯಂ ಬಿದಿ ಯಖಿಲ ವರಮು\nಗೃಹಮುಲಲೋಪಲ ಗೃಹಮೇಧುಲಗು ನರು;\nಲಾತ್ಮತತ್ತ್ವಮು ಲೇಶಮೈನ ನೆಱು?ಗ\nರಂಗನಾರತುಲ ನಿದ್ರಾಸಕ್ತಿ? ಜನು ರಾತ್ರಿ;\n ಪೋವು? ಗುಟುಂಬಾರ್ಥಬುದ್ಧಿ ನಹಮು","ಅಂಘ್ರಿಮೂಲಮುನ ಮೂಲಾಧಾರಚಕ್ರಂಬು?;\nಬೀಡಿಂಚಿ ಪ್ರಾಣಂಬು ಬಿಗಿಯ? ಬಟ್ಟಿ,\nನಾಭಿತಲಮು? ಜೇರ್ಚಿ, ನಯಮುತೋ ಮೆಲ್ಲನ;\n ಹೃತ್ಸರೋಜಮು ಮೀ?ದಿ ಕೆಗಯ? ಬಟ್ಟಿ,\nಯಟಮೀ?ದ ನುರಮಂದು ಹತ್ತಿಂಚಿ, ಕ್ರಮ್ಮಱ?;\n ದಾಲು ಮೂಲಮುನಕು? ದಱಿಮಿ ನಿಲಿಪಿ,\nಮಮತತೋ ಭ್ರೂಯುಗಮಧ್ಯಂಬು ಸೇರ್ಚಿ ದೃ;\n ಕ್ಕರ್ಣ ನಾಸಾಸ್ಯ ಮಾರ್ಗಮುಲು ಮೂಸಿ,"],
seesaM2:["ಕಮಲಾಕ್ಷು ನರ್ಚಿಂಚು ಕರಮುಲು ಕರಮುಲು;ಶ್ರೀನಾಥು ವರ್ಣಿಂಚು ಜಿಹ್ವ ಜಿಹ್ವ;\nಸುರರಕ್ಷಕುನಿ? ಜೂಚು ಚೂಡ್ಕುಲು ಚೂಡ್ಕುಲು;ಶೇಷಶಾಯಿಕಿ ಮ್ರೊಕ್ಕು ಶಿರಮು ಶಿರಮು;\nವಿಷ್ಣು ನಾಕರ್ಣಿಂಚು ವೀನುಲು ವೀನುಲು; ಮಧುವೈರಿ? ದವಿಲಿನ ಮನಮು ಮನಮು;\nಭಗವಂತು ವಲಗೊನು ಪದಮುಲು ಪದಮುಲು;ಪುರುಷೋತ್ತಮುನಿ ಮೀ?ದಿ ಬುದ್ಧಿ ಬುದ್ಧಿ","ಪಂದಿಕೈ ಪೋರಾಡ ಫಾಲಾಕ್ಷು? ಡೆವ್ವನಿ; ಬಲಮುನ ನಾ ಕಿಚ್ಚೆ? ಬಾಶುಪತಮು? \nನೆವ್ವನಿ ಲಾವುನ ನಿಮ್ಮೇನ ದೇವೇಂದ್ರು; ಪೀಠಾರ್ಥಮುನ ನುಂಡ ಬೆಂಪು? ಗಂಟಿ?? \nಗಾಲಕೇಯ ನಿವಾತ ಕವಚಾದಿದೈತ್ಯುಲ?; ಜಂಪಿತಿ ನೆವ್ವನಿ ಸಂಸ್ಮರಿಂಚಿ? \nಗೋಗ್ರಹಣಮು ನಾ?ಡು ಕುರುಕುಲಾಂಭೋನಿಧಿ?; ಗಡಚಿತಿ ನೆವ್ವನಿ ಕರುಣ? ಜೇಸಿ? ","ಕ್ಷಿತಿಪತಿ! ನೀ ಪ್ರಶ್ನ ಸಿದ್ಧಂಬು ಮಂಚಿದಿ; ಯಾತ್ಮವೇತ್ತಲು ಮೆತ್ತು ರಖಿಲಶುಭದ\nಮಾಕರ್ಣನೀಯಂಬು ಲಯುತಸಂಖ್ಯಲು ಗಲ; ವಂದು ಮುಖ್ಯಂ ಬಿದಿ ಯಖಿಲ ವರಮು\nಗೃಹಮುಲಲೋಪಲ ಗೃಹಮೇಧುಲಗು ನರು; ಲಾತ್ಮತತ್ತ್ವಮು ಲೇಶಮೈನ ನೆಱು?ಗ\nರಂಗನಾರತುಲ ನಿದ್ರಾಸಕ್ತಿ? ಜನು ರಾತ್ರಿ; ಪೋವು? ಗುಟುಂಬಾರ್ಥಬುದ್ಧಿ ನಹಮು","ಅಂಘ್ರಿಮೂಲಮುನ ಮೂಲಾಧಾರಚಕ್ರಂಬು?; ಬೀಡಿಂಚಿ ಪ್ರಾಣಂಬು ಬಿಗಿಯ? ಬಟ್ಟಿ,\nನಾಭಿತಲಮು? ಜೇರ್ಚಿ, ನಯಮುತೋ ಮೆಲ್ಲನ; ಹೃತ್ಸರೋಜಮು ಮೀ?ದಿ ಕೆಗಯ? ಬಟ್ಟಿ,\nಯಟಮೀ?ದ ನುರಮಂದು ಹತ್ತಿಂಚಿ, ಕ್ರಮ್ಮಱ?; ದಾಲು ಮೂಲಮುನಕು? ದಱಿಮಿ ನಿಲಿಪಿ,\nಮಮತತೋ ಭ್ರೂಯುಗಮಧ್ಯಂಬು ಸೇರ್ಚಿ ದೃ; ಕ್ಕರ್ಣ ನಾಸಾಸ್ಯ ಮಾರ್ಗಮುಲು ಮೂಸಿ,"],
utsaahamu:["ಗಜಮು ದೆರಲಿ ದಾನಿ ಕೊಱಲಿ ಕಂಪ ಮೊಂದಿ ಪಾಱ?ಗಾ\nಭಜನ ನಿಂದ್ರು? ಡಂಕುಶಮುನ? ಬಟ್ಟಿ ಬಿಟ್ಟು ನಿಲ್ಪುಚುನ್\nನಿಜಸುಧಾರಸೈಕಪಾನ ನಿರ್ಣ ಯಾರ್ದ್ರ ಕರಮುನನ್\nಋಜತ ಮೀಱ ನಿಮಿಱೆ ನದಿಯು ರೀತಿ ಮೆಱಸಿ ಕ್ರಮ್ಮಱನ್.","ಚಾರುದೇಷ್ಣು? ಡಾಗ್ರಹಿಂಚಿ ಶತ್ರುಭೀಷಣೋಗ್ರ ದೋ \nಸ್ಸಾರದರ್ಪ ಮೇರ್ಪಡನ್ ನಿಶಾತ ಬಾಣಕೋಟಿಚೇ \nದಾರುಣಪ್ರತಾಪಸಾಲ್ವದಂಡನಾಥಮಂಡಲಿನ್ \nಮಾರಿ ರೇ?ಗಿನಟ್ಲು ಪಿಲ್ಕುಮಾರ್ಚಿ ಪೇರ್ಚಿ ಯಾರ್ಚಿನನ್. ","ಕಾಮರೂಪಧಾರುಲುಂ  ಬ್ರ ಕಾಶಮಾನ  ತೇಜುಲುನ್\nಧೀಮತುಲ್  ಪ್ರಧಾಯುತುಲ್  ಸುಧೀರತಾವಿರಾಜಿಯುಲ್\nಭೀಮವೇಗಭೂರಿಶೌರ್ಯ ವಿಕ್ರಮೇಡ್ಯಯೂಥಪುಲ್\nಭೂಮಿಶತಸಹಸ್ರಶತಮು  ಪುಟ್ಟಿ  ಕ್ರಾಲು  ಚುಂಡ? ಗನ್","ಸಾಹಚರ್ಯ ಮಮರ ಸಪ್ತ ಸವಿತೃವರ್ಗಮುನು ಸಮು\nತ್ಸಾಹ ಮೆಕ್ಕ ನೊಕ್ಕಗುರು?ಡು ಚರಣಮುಲು ಭಜಿಂಪ?ಗಾ\nನೀಹಿತಪ್ರದಾನಲೀಲ ಲೆಸಗುಕಮಠಮೂರ್ತಿ ನು\nತ್ಸಾಹರೀತು ಲುಲ್ಲಸಿಲ್ಲ ಸಂಸ್ತುತಿಂತು ರಚ್ಯುತುನ್.","ಚಲಿಕಿ ವಣಕೆ ಚೇತು ಲಿಚಟ ಚಲಿಕಿ ಕಾಳ್ಳು ವಣಕೆರಾ\nಚಲಿಕಿ ವಣಕೆ ಪೆದವು ಲಿಚಟ ಚಲಿಕಿ ನೋರು ವಣಕೆರಾ\nಚಲಿಕಿ ವಣಕೆ ನಂಗಮು ಲಿಟ ಚಲಿಕಿ ತನುವು ವಣಕೆರಾ\nಚಲಿಯು ಯಿಂಟ ಚಲಿಯು ಬಯಟ ಚಲಿಕಿ ಜಗತಿ ವಣಕೆರಾ"],
kandam:["ಪಲಿಕೆಡಿದಿ ಭಾಗವತ ಮ?ಟ,\nಪಲಿಕಿಂಚೆಡಿವಾಡು ರಾಮಭದ್ರುಂ ಡ?ಟ, ನೇ?\nಬಲಿಕಿನ ಭವಹರ ಮಗುನ?ಟ,\nಪಲಿಕೆದ, ವೇಱೊಂಡು ಗಾಥ ಬಲುಕ?ಗ ನೇಲಾ?","ಲೋಕಂಬುಲು ಲೋಕೇಶುಲು\nಲೋಕಸ್ಥುಲು? ದೆಗಿನ? ದುದಿ ನಲೋಕಂ ಬಗು ಪೆಂ\nಜೀಕಟಿ ಕವ್ವಲ ನೆವ್ವಂ\nಡೇ ಕಾಕೃತಿ ವೆಲು?ಗು ನತನಿ ನೇ ಸೇವಿಂತುನ್.","ಬಲವಂತುಡನಾಕೇಮನಿ\nಪಲುವುರತೋ ನಿಗ್ರಹಿಂಚಿ ಪಲುಕುಟ ಮೇಲಾ\nಬಲವಂತಮೈನ ಸರ್ಪಮು\nಚಲಿ ಚೀಮಲ ಚೇತ ಚಿಕ್ಕಿ ಚಾವದೆ ಸುಮತೀ","ಕಲ? ಡಂದುರು ದೀನುಲ ಯೆಡ?\nಗಲ? ಡಂದುರು ಪರಮಯೋಗಿ ಗಣಮುಲ ಪಾಲಂ\nಗಲ? ಡಂದು ರನ್ನಿದಿಶಲನು\nಗಲ?ಡು ಕಲಂ ಡನೆಡಿ ವಾ?ಡು ಗಲ?ಡೋ ಲೇ?ಡೋ?","ಮಕರ ಮೊಕಟಿ ರವಿ? ಜೊಚ್ಚೆನು;\nಮಕರಮು ಮಱಿಯೊಕಟಿ ಧನದು ಮಾಟುನ ಡಾ?ಗೆನ್;\nಮಕರಾಲಯಮುನ? ದಿರಿಗೆ?ಡು\nಮಕರಂಬುಲು ಕೂರ್ಮರಾಜು ಮಱುವುನ ಕರಿಗೆನ್.","ಇಂದು ಗಲ? ಡಂದು ಲೇ? ಡನಿ\nಸಂದೇಹಮು ವಲದು ಚಕ್ರಿ ಸರ್ವೋಪಗತುಂ\nಡೆಂ ದೆಂದು ವೆದಕಿ ಚೂಚಿನ\nನಂದಂದೇ ಕಲ?ಡು ದಾನವಾಗ್ರಣಿ! ವಿಂಟೇ."],
taruvOja:["ಏ ನೆಲ್ಲ ಪ್ರೊದ್ದು ನಾ ಯೆಡ ಲೋನ? ದಲ?ತು ನೀಯಭಿಪ್ರಾಯಂಬ ಯಿದಿ ದಾರುಣಂಬು\nಗಾನ ವಾಕುನಕು? ಜುಲ್ಕನ ತೇರನೋಪ? ಗಡ?ಗಿ ಪಾಂಡವುಲ ನೇಕತ ಮೆಟ್ಟು ಲನುಪ\nಗಾ ನಗು ಮಱಿ ದೀನಿ ಗಾಂಗೇಯವಿದುರಕಲಶಜಾಶ್ವತ್ಥಾಮ ಗೌತಮುಲ್ ಬುದ್ಧಿ\nಗಾ ನೊಡಂಬಡುದುರೆ ಕಾದಯ್ಯ ಯನಿನ? ಗೌರವಜ್ಯೇಷ್ಠುಂಡು ಘನು? ಡಿಟ್ಟು ಲನಿಯೆ.","ನಲನಾಮಕಂಬುಲು ನಗಣಾಂತಮುಲುಗ ನಾಲುಗಂಘ್ರುಲಯಂದು ನಾಲುಗು?ಗೂರ್ಚಿ\nವಳುಲು ಮೂ?ಡೆಡಲನು ವರುಸತೋ ನಿಲ್ಪ ವಲಯು ಮೂ?ಡವಗಣವರ್ಣಂಬು ಮೊದಲ\nನಿಲುಪಂಗ ನಿವ್ವಿಧಿ ನಿರ್ಮಿಂಚಿ ವಿಶ್ವನೃಪತಿಕಿ ನಿಚ್ಚಿನ ನಿಂಪುಸೊಂಪಾರು?\nದಲಕೊನಿ ತಗ? ಬ್ರಾಲು ದಂಪೆಡಿಚೋಟ? ದರುಣುಲಚೇ ಸೊಂಪುದನರು? ದರ್ವೋಜ","ಈ ವಿಲ್ಲು ಮೋಪೆಟ್ಟಿ ಯೇನು ಬಾಣಮುಲ ನೀ ಯಂತ್ರಮತ್ಸ್ಯಂಬು ನೇಸಿನ ವಾ?ಡ\nಭಾವಜಪ್ರತಿಮು? ಡಿಬ್ಬಾಲಕು? ದಗಿನ ಪತಿ ಯಿದಿ ಮುನಿಶಕ್ತಿ? ಬಡಸಿನ ವಿದ್ಯ\nಗಾವುನ ಮೀ ರಿಪ್ಡುಗಾವಿಂಪು? ಡಿದಿಯ ಘನತರ ಕಾರ್ಮುಕ ಕೌಶಲೋನ್ನತಿಯು\nಲಾವುನು ಗಲವಾರಲಕು ನವಸರಮು ಲಲಿತಯಶಂಬು? ಗಲ್ಯಾಣಂಬು? ಬಡಯ.","ಧರಣೀಶು? ಡುದ್ಯತದಂಡು? ಡೈ ಯುಚಿತ ದಂಡವಿಧಾನಂಬು? ದಪ್ಪಕ ಧರ್ಮ\nಚರಿತುಲ?ಗಾ ಮಹೀಜನುಲ ರಕ್ಷಿಂಚಿ ಸದ್ವೃತ್ತು? ಡಗುನದಿ ಸರ್ವವರ್ಣಮುಲು\nವರುಸನ ತಮತಮ ವರ್ಣಧರ್ಮಮುಲ ವರ್ತಿಲ್ಲುದುರು ಗಡವಕ ದಂಡಭೀತಿ\nನರಿಮಿತ್ರವರ್ಜಿತು? ಡೈ ಸಮಬುದ್ಧಿ ಯಗು ಮಹೀವಲ್ಲಭು ನನುಶಾಸನಮುನ.","ವೆಂಡಿ ವೆನ್ನೆಲ ಕಾಚಿ ವೆಲುಗು ಜಾಬಿಲ್ಲಿ ವೆಂಡಿ ಕೊಂಡನು ನಿಲ್ಚೆ ವಿಶ್ವೇಶುಪೈನ\nಪಂಡು ವೆನ್ನೆಲ ತೋಡ ಪರವಶಂಬಿಡಕ ಪಂಡೆ ಪೂವುಗ ತಾನು ಫಾಲಾಕ್ಷುಸಿಗನು\nಕೊಂಡ ಕೋನಲ ಪೈನ ಕುರಿಪಿಂಚಿ ಸುಧಲು ಗುಂಡೆಲೋ ತಾ ಗ್ರುಚ್ಚ ಗುನಪಾಲುನಾಕು\nಎಂಡಿಪೋವಗ ಗುಂಡೆ ಈನಾಡು ಇಚಟ ಎಂಡಮಾವಿಗ ಮಾರೆನೀಜೀವಿತಮ್ಮು "],
tripadi:["ತ್ರಿಪದಿಕಿ ನೊಕಯಂಘ್ರಿ ನಿಂದ್ರುಲು ನಲುವುರು\nದ್ಯುಪತುಲಿದ್ದಱು ಸೂರ್ಯುಲಿರ್ವು ರೌಲ \nದ್ಯುಪತಿದ್ವಯಾರ್ಕುಲುನೌಲ"],
aMtaraakkara:["ಸಾಗರಪು ತೀರಮುನ ಸಂಚರಿಂಚೇ ವೇಲ?\nಸಾಗರಮು ನೀ ಮನಸು ಸಂಶಯಮ್ಮಿಂ ಕೇಲ?\nಸಾಗರ ತರಂಗಮುಲು ಚಂಚಲಮ್ಮೈ ತೇಲು\nರಾಗ-ಮಯಮೌ ಪಲು ವರಾಲ ಸದ್ಭಾವಾಲು!","ಸ್ವರ್ಣಮಯ ಸಂಧ್ಯ ಯದಿ ಚಂಚಲಮ್ಮೈ ಪಿಲ್ಚು\nವರ್ಣಮುಲ ಚಿತ್ರ ಮದಿ ವೈಭವಮ್ಮೈ ನಿಲ್ಚು\nಕರ್ಣಮುಲು ಗೀತಿಕಲ ಕಾಕಲೀ-ನಾದಂಪು\nಪೂರ್ಣ-ಸುಖ ಮಂದೆ ನಹ ಬುದ್ಬುದಮ್ಮೀ ಯಿಂಪು!","ಕಮಲಮಿತ್ರುಂಡು ಸುರರಾಜಗಣ ಯುಗಂಬು\nಕಮಲಶತ್ರುನಿತೋ? ಜೆಂದಿ ಕಂದಳಿಂಪ\nನಮರು? ಬ್ರಾವಳ್ಳು ನರ್ಥಂಬು ನತಿಶಯಿಲ್ಲ\nನಮಲ ಮಗು ನಂತರಾಕ್ಕರ ಮಬ್ಧಿಸಂಖ್ಯ","ಇನು? ಡೊಕಂಡುನು ನಿಂದ್ರು ಲಿದ್ದಱುನು ನೊಕ್ಕ\nವನಜವೈರಿಯು? ಗೂಡಿ ವೈಭವ ಮೊನರ್ಪ\nಗನಕವಸ್ತ್ರುನಿ ಗೃತ್ತಕೈಟಭುನಿ ಗೊಲ್ತು\nರನುಚು? ಜೆಪ್ಪುದು ರಂತರಾಕ್ಕರ ಬುಧುಲು."],
alpaakkara:["ಮೀರಿಂದು ಶಂಬರು ಮೆಚ್ಚಿಚೂಡ\nನಾರೂಢಿ ನೇನೊಕ್ಕ ಹಯಮು ನೆಕ್ಕ\nಚೂರಿಂಚಿ ಪೋವನ ದುರ್ಗಭೂಮಿ\nಭಾರಂಬುಗಾ ಜೊಚ್ಚೆ ನಾಜಿ ವೇಗ","ಸುಮನಃಪತಿಯುಗಮು ಸೋಮುಂಡುನು\nನೆಮಕಂಗ? ಬ್ರಾವಳ್ಳು ನಿಂಡಿಮೀಱ\nಗಮನೀಯವಿಭವಂಬುಗಾಂಚುನೆಪ್ಡು\nರಮಣೀಯ ಮಲ್ಪಾಕ್ಕರಮು ಕೃತುಲ","ಒಗಿ ನಿದ್ದಱಿಂದ್ರುಲು ನೊಕವಿಧುಂಡು\nಜಗತೀಧರುನಿ ಪದಾಬ್ಜಮುಲು ಗೊಲ್ತು\nರಗಣಿತಭಕ್ತಿ ನಂಚಭಿನುತಿಂಪ\nನೆಗಡು ನಲ್ಪಾಕ್ಕರ ನಿಯತಿತೋಡ."],
madhuraakkara:["ರವಿಯು ನಿಂದ್ರುಲು ಮುವ್ವುರು ರಾಜೊಕಂಡುನು ಗಲಸಿ\nರವಿಸುಧಾಕರ ಲೋಚನು ರಾಜಿತಾಸನ ಸರೋಜ\nರವಿಕುಲೇಶ ಗೊಲುತುರನಿ ಪ್ರಸ್ತುತಿಂತುರು ಧರಿತ್ರಿ\nನವಿರಳಂ ಬಗು ಮಧುರಾಕ್ಕರಾಖ್ಯಚೇ ಸತ್ಕವುಲು","ತನರ ಜನಕುಂಡು ನನ್ನಪ್ರದಾತಯುನು ಭಯತ್ರಾತ\nಯುನು ನನ?ಗ ನಿಂತುಲಕು ಮುವ್ವು ರೊಗಿನ ಗುರುವುಲು ವೀರ\nಲನಘ ಯುಪನೇತ ಮಱಿಯು ನಿರಂತರಾಧ್ಯಾಪಕುಂಡು\nನನ?ಗ? ಬುರುಷುನ ಕಿಯ್ಯೇವು ರನಯಂಬುನು ಗುರುವುಲು","ತರಣಿ ವಾಸವ ತ್ರಿತಯಂಬು ಧವಳ ಭಾನುಯುತಿ ನೊಂದ\nನಿರತಿ ವಿಶ್ರಾಂತಿ ನಾಲವನೆಲವುನ ನಿಂಪುಮೀಱ\nಸರಸಮಧುರಾರ್ಧಮುಲ? ಜೆಪ್ಪ? ಜನು ಮಧುರಾಕ್ಕರಂಬು\nವರುಸ? ಬಂಚಗಣಮುಲನು ವಾಲಿ ಕೃತುಲ ವೆಲಯು"],
madhyaakkara:["ಓಜತೋ ನಿದ್ದಱಿಂದ್ರುಲುನು ನೊಕ್ಕಯಾದಿತ್ಯುಂಡು ಮಱಿಯು\nರಾಜಿತಂಬುಗ ನಿದ್ದ ಱಮರ ರಾಜುಲು ನೊಕ್ಕಸೂರ್ಯುಂಡು\nಪೂಜಿಂತು ರತ್ಯಂತಭಕ್ತಿ? ಬುಂಡರೀಕಾಕ್ಷು ನನಂತು,\nಭ್ರಾಜಿಲ್ಲು ಬುಧುಲು ಮಧ್ಯಾಕ್ಕರಂಬು ನೊಪ್ಪಾರ? ಬಲ್ಕುದುರು.","ಕಲದವಿ ನಾಲುಗು ಮಧ್ಯ ಕರಕುನು ಚರಣಮು ಚೂಡ, \nನಿಲುಚುನು ನಿಂಡಗು ಪ್ರಾಸ ನಿಯಮಮು ಚಕ್ಕನಿ ವಿಧಮು \nಮೊಲಕೇತ್ತುನು ಯೆತಿಯು ನಿಚಟ ಮೊದಲುಗ ನಾಲ್ಗವಗಣಮು \nಚಲುಪುಚು ಇಂದ್ರುಲುಭಯುಲು ಚಂಡಾಂಶು ರೆಂಡುಮಾರುಲಿಕ ~ ಶ್ರೀ ಪಿರಾಟ್ಲ ವೆಂಕಟ ಶಿವರಾಮಕೃಷ್ಣ ಪ್ರಸಾದ್ ಗಾರಿಚೇ ವಿರಚಿತಂ.","ಮಹಿಳನು ದೂಷಿಂಚುವಾಡು ಮಾನ್ಯುಡು ಜಗತಿನ್ ನಿಜಮ್ಮು\nಬಹುಬಂಧನಮುಲು ಗಲ್ಗಿಂಚಿ ಪಟ್ಟಿಲಾಗುಚುನುಂಡು ನನುಚು\nಬಹು ವಿಧಮುಲ ವೇದಿಕಪಯಿ ಪಲ್ಕು ಪ್ರಗಲ್ಭಾಲು ಗಾನಿ\nಮಹಿನಟ್ಟಿ ವಾಡೆ ಭಾರ್ಯಯೆಡ ಮಸಲು ನೆಂತಯು ವಿನಯಮುನ"],
mahaaakkara:["ಆದಿವಾರ ಮಾದಿಗ ನನುಕ್ರಮಮುನ - ನನ್ನಿವಾಸರಮುಲ ನೊಕ್ಕಿನುಂಡು\nನಾದಿತೇಯಾಧಿನಾಥು ಲೇಗುರು ನಲ - ರಾರಂಗ ನೊಕ್ಕಸುಧಾಕರುಂಡು\nನಾದಿ ಹರಿ? ಗೊಲ್ವ ರೆಂಡುನು ನಾಲುಗು - ನಗು ವಾಸರಂಬುನ ನರ್ಕು?ಡೈನ\nನಾದರಂಬುನ ನೆಡಸೊಚ್ಚುನನಿ ಮ - ಹಾಕ್ಕರಂ ಬಲುಕುದು ರಾರ್ಯು ಲೆಲ್ಲ.","ವಾರಿಜಾಪ್ತುಂಡು ಪಂಚೇಂದ್ರಗಣಮುಲು ವನಜಾರಿಯುನು ಗೂಡಿ ವೆಲಯುಚುಂಡ\nನಾರಯ ರೆಂಡವ ನಾಲವಚೋಟ್ಲ ನರ್ಕುಂಡಯಿನನುಂ ದನರ್ಚುಚುಂಡ?\nಗೋರಿ ಯವ್ವಡಿಪಂಚಮಗಣಮುನ? ಗೂಡಿ ಮೊದಲ ನಿಲುಪಂಗ ನಗು\nಸಾರಮೈ ಪ್ರಾಸವಡಿ ಸಪ್ತಗಣಮುಲು ಸಾ?ಗ ಮಹಾಕ್ಕರ ಯತಿಶಯಿಲ್ಲು","ಮೊದಟ  ಸೂರ್ಯುಂಡು  ಪದಪಗಾ ನಿಂದ್ರುಂಡು ಮೊದಲುಗಾ ನೇವುರು  ವರಲುಚುಮ್ಡ್ರು\nಮೆದಲ  ಸೂರ್ಯುಂಡು  ಪಿಮ್ಮಟ ನೇಗುರು ಪುರುಹುತುಲದಕಂಗ ಜಂದ್ರುಡೊಂಡು\nಮುದಮು ತೋನೆಡ ಸೊಚ್ಚು ಮಹಾಕ್ಕರ ಮೊನಸಿ ಕಾವ್ಯಮುಲಂದು  ನಿಡಗ ಕೃಷ್ಣ"],
dvipada:["ಶ್ರೀಕಾಮಿನೀನಾಧುಜಿತದೈತ್ಯನಾಧು\nಲೋಕರಕ್ಷಣಕೃತ್ಯುಲೋಕೈಕನಿತ್ಯು","ನಡುರಾತ್ರಿ ಯರುದೆಂಚೆನರಲೋಕನಾಧ\nಕಡುಡಸ್ಸಿನಾಡವುಕನುಮೋಡ್ತುಗಾಕ","ಇಂದ್ರ ಗಣಮುಲು ಮೂ? ಡಿನ ಗಣಂಬೊಕಟಿ\nಚಂದ್ರಾಸ್ಯ ! ದ್ವಿಪದಕು? ಜನು ಚೆಪ್ಪರೇಚ","ದ್ವಿಪದಕು ದ್ವಿಪದಕು? ದೆಗ ಜೆಪ್ಪವಲಯು\nನೆಪುಡು ಸಂಸ್ಕೃತಮುನ ನಿತರ ಭಾಷಲನು","ಯತುಲ ಲೋಪಲ? ಬ್ರಾಸಯತಿ ದಕ್ಕ ಸಕಲ\nಯತುಲು ಚೆಲ್ಲುನು ಬ್ರಯೋ ಗಾತಿ ಸಾರಮುನ","ದ್ವಿಪದ ತೋ ದ್ವಿಪದ ಸಂಧಿಲ ನೇಕಶಬ್ದ\nಮಪುಡು ರೆಂಟನು ಗೂರ್ಪ ನದಿ ಯಯುಕ್ತಂಬು"],
dvipadamaalika:["ಶ್ರೀಕಾಮಿನೀನಾಧುಜಿತದೈತ್ಯನಾಧು\nಲೋಕರಕ್ಷಣಕೃತ್ಯುಲೋಕೈಕನಿತ್ಯು\nನಡುರಾತ್ರಿ ಯರುದೆಂಚೆನರಲೋಕನಾಧ\nಕಡುಡಸ್ಸಿನಾಡವುಕನುಮೋಡ್ತುಗಾಕ"],
maMjareedvipada:["ಶ್ರೀಕಾಮಿನೀನಾಧುಜಿತದೈತ್ಯನಾಧು\nಲೋಕರಕ್ಷಣಕೃತ್ಯುಲೋಕೈಕನಿತ್ಯು\nನಡುರಾತ್ರಿ ಯರುದೆಂಚೆನರಲೋಕನಾಧ\nಕಡುಡಸ್ಸಿನಾಡವುಕನುಮೋಡ್ತುಗಾಕ","ಶ್ರೀಮಂದಿರಾಕಾರು ಜಿತದೈತ್ಯಧೀರು?\nಗೀರ್ತಿಂಚುಚೋ? ಬುಣ್ಯವರ್ತನುಂ ಡನುಚು\nಯತಿಮಾಱು ಪ್ರಾಸ ಮಿ ಟ್ಲಚ್ಚೋಟ ನಿಡಕ\nಸರಸಿಜನಾಭಾಯ ಸಮುದಗ್ರಸಾಹ","ಸಾಯ ನಮೋಯಂಚು ಶಬ್ದಮೊಕ್ಕಟಿಯು\nರೆಂಡುಪಾದಮುಲ ನೀಕ್ರಿಯ? ಬಂಚಿಯಿಡಕ\nವೆಲಯು ಪ್ರಾಸಮುಲೇನಿ ದ್ವಿಪದ ಯೈ ಪರ?ಗ?\nಬೂಜಿಂಪವಲಯು ವಾಕ್ಪುಷ್ಪಮಂಜರುಲ.","ಇಂದ್ರುಲು ಮುವ್ವುರು ನಿನು? ಡೊಕ್ಕರುಂಡು\nಸಾಂದ್ರಮೈ ಯೊಕ್ಕೊಕ್ಕಚರಣಂಬು? ಗೊಲುವ\nನಲರು? ಬದ್ಮೋದರು? ಡಂಚು ಧೀರೋತ್ತ\nಮುಲು ವಿಸ್ತರಿಂತುರು ಮುದಮುತೋ ದ್ವಿಪದ.","ಶ್ರೀಮಂದಿರಾಕಾರು ಜಿತದೈತ್ಯಧೀರು\nಗೀರ್ತಿಂಚುಚೋ? ಬುಣ್ಯವರ್ತನು? ಡನುಚು\nಯತಿಮಾಱು ಪ್ರಾಸಮಿಟ್ಲಚ್ಚೋಟ ನಿಡಕ\nಸರಸಿಜನಾಭಾಯ ಸಮುದಗ್ರ ಸಾಹ"],
iMdravajramu:["ಸಾಮರ್ಥ್ಯಲೀಲನ್ ತತಜದ್ವಿಗಂಬುಲ್\nಭೂಮಿಧ್ರವಿಶ್ರಾಂತುಲ ಬೊಂದಿ ಯೊಪ್ಪುನ್\nಪ್ರೇಮಂಬುತೋ ನೈಂದವಬಿಂಬವಕ್ತ್ರುನ್\nಹೇಮಾಂಬುರುಂ ಬಾಡುದು ರಿಂದ್ರವಜ್ರನ್","ಈತಾಜಗಾನಿರ್ಮಿತಿ ನಿಂದ್ರವಜ್ರಾ\nನೀತಾಖ್ಯ ವರ್ತಿಂಚು ವಿನಿರ್ಮಲೋಕ್ತಿನ್\nಇತ್ತಾ, ಜ, ಗಾ ಸಂಗತಿ ನಿಂದ್ರವಜ್ರಾ\nವೃತ್ತಂಬಗುನ್ ಸನ್ನುತ - ವೃತ್ತರೇಚಾ !"],
utpalamaala:["ಪುಣ್ಯುಡು ರಾಮಚಂದ್ರುಡಟ ವೋಯಿ ಮುದಂಬುನ ಗಾಂಚೆ ದಂಡಕಾ\nರಣ್ಯಮು ದಾಪಸೋತ್ತಮ ಶರಣ್ಯಮು ನುದ್ದತ ಬರ್ಹಿಬರ್ಹಲಾ\nವಣ್ಯಮು ಗೌತಮೀ ವಿಮಲ ವಾಃಕಣ ಪರ್ಯಟನಪ್ರಭೂತ ಸಾ\nದ್ಗುಣ್ಯಮು ನುಲ್ಲ ಸತ್ತರು ನಿಕುಂಜ ವರೇಣ್ಯಮು ನಗ್ರಗಣ್ಯಮುನ್","ಊಹ ಗಲಂಗಿ ಜೀವನಪುಟೋಲಮುನಂ ಬಡಿ ಪೋರುಚುನ್ ಮಹಾ\nಮೋಹಲತಾ ನಿಹದ್ದಪದಮುನ್ ವಿಡಿಪಿಂಚುಕೊನಂಗ ಲೇಕ ಸಂ\nದೇಹಮುಬೋದು ದೇಹಿ ಕ್ರಿಯ ದೀನದಶನ್ ಗಜ ಮುಂಡೆ ಭೀಷಣ\nಗ್ರಾಹದುರಂತ ದಂತ ಪರಿಘಟ್ಟಿತ ಪಾದ ಖುರಾಗ್ರ ಶಲ್ಯಮೈನ್","ಎವ್ವನಿಚೇ ಜನಿಂಚು ಜಗ; ಮೆವ್ವನಿ ಲೋಪಲ ನುಂಡು ಲೀನಮೈ;\nಯೆವ್ವನಿ ಯಂದು ಡಿಂದು?; ಬರಮೇಶ್ವರು? ಡೆವ್ವ?ಡು; ಮೂಲಕಾರಣಂ\nಬೆವ್ವ?; ಡನಾದಿಮಧ್ಯಲಯು? ಡೆವ್ವ?ಡು; ಸರ್ವಮು? ದಾನಯೈನವಾ?\nಡೆವ್ವ?ಡು; ವಾನಿ ನಾತ್ಮಭವು ನೀಶ್ವರು ನೇ ಶರಣಂಬು ವೇಡೆದನ್.","ಭಾನುಸಮಾನ ವಿನ್ ಬರನ ಭಾರಲಗಂಬುಲ ಗೂಡಿ ವಿಶ್ರಮ\nಸ್ಥಾನಮು ನಂದು ಬದ್ಮಜ ಯುತಂಬುಗ ನುತ್ಪಲಮಾಲಯೈ ಚನುನ್\nಪದ್ಮಜಯುಗ್ಯತಿನ್ ಭರನಭಾರಲಗಂಬುಲ? ಜೆಂದಿ ಸನ್ಮನಃ\nಪದ್ಮವಿಕಾಸ ಹೇತುವಗು ಪದ್ಯಮು ನುತ್ಪಲಮಾಲಯಂ ಡ್ರಿಲನ್","ಶ್ರೀರಮಣೀಮುಖಾಂಬುರುಹ ಸೇವನ ಷಟ್ಪದ ನಾಥ ಯಂಚು ಶೃಂ\nಗಾರ ರಮೇಶ ಯಂಚು ಧೃತ ಕೌಸ್ತುಭ ಯಂಚು ಭರೇಫನಂಬುಲನ್‌\nಭಾರಲಗಂಬುಲುಂ ಗದಿಯ? ಬಲ್ಕುಚು ನುತ್ಪಲಮಾಲಿಕಾಕೃತಿನ್‌\nಗಾರವಮೊಪ್ಪ? ಜೆಪ್ಪುದುರು ಕಾವ್ಯವಿದುಲ್‌ ಯತಿ ತೊಮ್ಮಿದಿಂಟ?ಗಾನ್‌."],
upEMdravajramu:["ಪುರಾರಿ ಮುಖ್ಯಾಮರಪೂಜನೀಯುನ್\nಸರೋಜನಾಭುನ್ ಜತಜದ್ವಿಗೋಕ್ತಿನ್\nದಿರಂಬುಗಾನದ್ರಿಯತಿನ್ನುತಿಂಪನ್\nಇರಾಸುತಾಧೀಶು ನುಪೇಂದ್ರ ವಜ್ರನ್","ಉಪೇಂದ್ರವಜ್ರಾಹ್ವಯ ಮೊಪ್ಪುನಿಂ ಪೈ\nಯುಪೇಂದ್ರಪುತ್ತ್ರಾ ಜತಜೋಕ್ತಗಾಲನ್\nಸಪದ್ಮ ಪದ್ಮಾ ! ಜತ ಜಲ್ಗಗಂಬುನ್\nಉಪೇಂದ್ರ ವಜ್ರಾಖ್ಯಮು ನೊಪ್ಪು ಜೆಪ್ಪನ್.","ಪುರಾರಿಮುಖ್ಯಾಮರು ಪೂಜನೀಯುನ್‌\nಸರೋಜನಾಭುನ್‌ ಜತಜದ್ವಿಗೋಕ್ತಿನ್‌\nದಿರಂಬುಗಾ ನದ್ರಿಯತಿನ್ನುತಿಂಪನ್‌\nಇರಾಸುತಾಧೀಶು ನುಪೇಂದ್ರವಜ್ರನ್‌."],
kaviraajaviraajitamu:["ಸರಸಸಮಾಸವಿಲಾಸವಿಭಾಸಮು ಸಾಧುನುತಂಬು  ಸುಸಂಧಿಗಮುನ್\nವರಮಧುರೋಪನತಾರ್ಥ ಸುವಾಕ್ಯನಿಬದ್ಧಮು ಯೋಗಸಮಂಜಸಮುನ್\nಖರದಶಕಂಠವಧಾಧಿಕಮುನ್ ಸುಮನಸ್ಸುಖದಂಬು ಮುನೀರಿತಮುನ್\nಸ್ಫುರದುರುಸದ್ಗುಣಭೂಷಣಭೂಷಿತಮುನ್ ಗನು? ಡೀ ರಘುರಾಮು ಕಥನ್","ಕಮಲದಳಂಬುಲಕೈವಡಿ? ಜೆನ್ನಗು ಕನ್ನುಲು ಜಾರುಮುಖಪ್ರಭಲುನ್‌\nಸಮಧಿಕವೃತ್ತಕುಚಂಬುಲು ನೊಪ್ಪ?ಗ ಶೈಲರಸರ್ತು ವಿಶಾಲಯತಿನ್‌\nಸಮುಚಿತನಾನ್ವಿತಷಡ್ಜಲಗಂಬುಲ ಜಾನುಗ? ಬಾಡಿರಿ ಚಕ್ರಧರುನ್‌\nರಮಣುಲು ಸೊಂಪಲರಂ ಗವಿರಾಜವಿರಾಜಿತಮುನ್‌ ಬಹುರಾಗಮುಲನ್‌.","ಅನವುಡುನಿಟ್ಲನುನನ್ನರಪಾಲುನಕಾತ?ಡು ಮೋಕ್ಷಮುನರ್ಥಿಜಗ\nಜ್ಜನುಲಕು?ಬುಟ್ತುಟಸನ್ಮತಿಗೋರಿವಿಶಾರದುಲಾದರಸಂಬೃತುಲೈ\nಯನಘಸುದುಸ್ತರಮೈನಭವಂಬುನಕಚ್ಚಗುನೀಯಿತಿ ಹಾಸಮುಬೋ\nಧನಮಹನೀಯವಿಧಂಬುನ?ಜೆಪ್ಪಿರಿದಾತ್ತಗುಣಾಶ್ರಯತಾಮಹಿತಾ ","ಸ್ಥಿತಿಮತುಲೈ ಮನುಜೇಂದ್ರು ಲನೇಕುಲುಸಿಂಧುವುಲೈವಿಲಸಿಲ್ಲಿನಭಾ\nರತಕವಿರಾಜ ವಿರಾಜಿತಮೈನ ಪುರಾಕೃತ ಕಾವ್ಯಮರಂದ ಮಹೋ\nನ್ನತುಲನುಕೋರ ಸನಾತನಶೈಲಿ ಘನಂಬುಗ ಘಂಟಮುನಾಡುಚುಸ\nತ್ಕೃತುಲಿಟಜಾರೆನು ಋತ್ವಿ ಜುಡೈಕೃತಿಕೃತ್ಯ ಮಿಡನ್ ಕವಿಹೃದ್ಯಮುಗಾ. ~ ಶ್ರೀ ಪಿರಾಟ್ಲ ವೆಂಕಟ ಶಿವರಾಮಕೃಷ್ಣ ಪ್ರಸಾದ್ ಗಾರಿಚೇ ವಿರಚಿತಂ."],
krauMchapadaM:["ಕಾಂಚನಭೂಷಾಸಂಚಯ ಮೊಪ್ಪನ್‌ ಘನಕುಚಭರಮುನ? ಗವು ನಸಿಯಾಡನ್‌\nಜಂಚಲನೇತ್ರಲ್ವಂಚನತೋಡನ್‌ ಸಮುಚಿತಗತಿ ವೆನುಚನಿ ತನು? ಗೊಲ್ವನ್‌\nಅಂಚಿತಲೀಲನ್ಮಿಂಚಿನಶೌರಿನ್‌  ಹರಿದಿಭಪರಿಮಿತಯತು ಲೊನ?ಗೂಡನ್‌\nಮುಂಚಿ ರಚಿಂಪಂ ಗ್ರೌಂಚಪದಂ ಬಿಮ್ಮೊಗಿ ಭಮಸಭನನಮುಲ ನಯಲೊಂದುನ್‌.","ಚಂಚಲವೀಚೂಸಂಚಯಲೀಲಾಸಲಲಿತತರಳಿತಜಲರುಹಪಾಳೀ\nಸಂಚಿತಹಸ್ತೋದಂಚಿತಭಂಗೀಜನಿತಮದನಮತಸರಣಿಗುಣವ್ಯಾ\nಖ್ಯಾಂಚಿತಗೋಷ್ಠೀಸಂಚರಣಪ್ಯತ್ಯಯಸಮುಚಿತಹಳಹಳಿಕಲತೋರಾ\nಯಂಚಲು ಮ್ರೇಯನ್‌ಗೊಂಚಲುಗೂಯನ್ ವ್ಯವಹಿತಪರರವಮಯಿನಕೊಲಂಕುನ್ "],
chaMpakamaala:["ಪದಮುಲ ಬಟ್ಟಿನಂ ದಲಕುಬಾ ಟೊಕಯಿಂತಯು ಲೇಕ ಶೂರತನ್\nಮದಗಜವಲ್ಲಭುಂಡು ಮತಿಮಂತುಡು ದಂತಯುಗಾಂತಘಟ್ಟನಂ\nಜೆದರಗ ಜಿಮ್ಮೆ ನಮ್ಮಕರಿಚಿಪ್ಪಲು ಪಾದುಲು ದಪ್ಪನೊಪ್ಪಱನ್\nವದಲಿ ಜಲಗ್ರಹಂಬು ಕರಿವಾಲಮುಮೂಲಮು ಜೀರೆ ಗೋಱಲನ್","ಅಟಜನಿಕಾಂಚೆಭೂಮಿಸುರುಡಂಬರಚುಂಭಿಶಿರಸ್ಸರಜ್ಝರೀ\nಪಟಲಮುಹುರ್ಮುಹುರ್ ಲುಠದಭಂಗತರಂಗಮೃದಂಗನಿಶ್ವನ\nಸ್ಫುಟನಟನಾನುಕೂಲ ಪರಿಪುಲ್ಲ ಕಲಾಪಕಲಾಪಿಜಾಲಮುನ್\nಘಟಕಚರತ್ಕರೇಣುಕರಕಂಪಿತಸಾರಮುಶೀತಸೈಲಮುನ್","ಅಲಸುಲು ಮಂದಬುದ್ಧಿಯುತು ಲಲ್ಪತರಾಯುವು ಲುಗ್ರರೋಗಸಂ\nಕಲಿತುಲು ಮಂದಭಾಗ್ಯುಲು ಸುಕರ್ಮಮು ಲೆವ್ವಿಯು? ಜೇಯ?ಜಾಲ ರೀ\nಕಲಿಯುಗಮಂದು ಮಾನವುಲು ಗಾವುನ ನೆಯ್ಯದಿ ಸರ್ವಸೌಖ್ಯಮೈ\nಯಲವಡು? ನೇಮಿಟಂ ಬೊಡಮು ನಾತ್ಮಕು? ಶಾಂತಿ ಮುನೀಂದ್ರ! ಚೆಪ್ಪವೇ.","ಜನನಮು ಲೇಕ ಕರ್ಮಮುಲ ಜಾಡಲ? ಬೋಕ ಸಮಸ್ತ ಚಿತ್ತ ವ\nರ್ತನು?ಡಗು ಚಕ್ರಿಕಿಂ ಗವು ಲುದಾರ ಪದಂಬುಲ ಜನ್ಮಕರ್ಮಮುಲ್\nವಿನುತುಲು ಸೇಯುಚುಂಡುದುರು ವೇದರಹಸ್ಯಮುಲಂದು ನೆಂದು? ಜೂ\nಚಿನ ಮಱಿ ಲೇವು ಜೀವುನಿಕಿ? ಜೆಪ್ಪಿನ ಕೈವಡಿ ಜನ್ಮಕರ್ಮಮುಲ್.","ಜಗದಧಿನಾಥು?ಡೈನ ಹರಿಸಂತತಲೀಲಲು ನಾಮರೂಪಮುಲ್\nದಗಿಲಿ ಮನೋವಚೋಗತುಲ? ದಾರ್ಕಿಕಚಾತುರಿ ಯೆಂತ ಗಲ್ಗಿನನ್\nಮಿಗಿಲಿ ಕುತರ್ಕವಾದಿ ತಗ ಮೇರಲು ಸೇಸಿ ಯೆಱುಂಗ ನೇರ್ಚುನೇ?\nಯಗಣಿತ ನರ್ತನಕ್ರಮಮು ನಜ್ಞು? ಡೆಱಿಂಗಿ ನುತಿಂಪ ನೋಪುನೇ?","ತನ ಕುಲಧರ್ಮಮುನ್ ವಿಡಿಚಿ ದಾನವವೈರಿ ಪದಾರವಿಂದಮುಲ್\nಪನಿಪಡಿ ಸೇವಸೇಸಿ ಪರಿಪಾಕಮು ವೊಂದಕ ಯೆವ್ವ?ಡೇನಿ? ಜ\nಚ್ಚಿನ ಮಱು ಮೇನ ನೈನ ನದಿ ಸಿದ್ಧಿ ವಹಿಂಚು? ದದೀಯ ಸೇವ? ಬಾ\nಸಿನ? ಗುಲ ಧರ್ಮಗೌರವಮು ಸಿದ್ಧಿ ವಹಿಂಚುನೆ ಯೆನ್ನಿ ಮೇನುಲನ್. ","ತ್ರಿಭುವನವಂದ್ಯ ಗೋಪಯುವತೀಜನಸಂಚಿತಭಾಗಧೇಯ ರುಕ್‌\nಪ್ರಭವಸಮುತ್ಕರೋಜ್ಜ್ವಲ ಶಿರಸ್ಸ್ಥಿತ ರತ್ನ ಮರೀಚಿ ಮಂಜರೀ\nವಿಭವ ಸಮುಜ್ಜ್ವಲತ್ಪದರವಿಂದ ಮುಕುಂದ ಯನಂಗ ನೊಪ್ಪುನಾ\nಜಭಮುಲು ಜಾಜರೇಫಮುಲು? ಜಂಪಕಮಾಲ ಕಗುನ್‌ ದಿಶಾಯತಿನ್‌."],
taralamu:["ಪರಮಪೂರುಷು? ಡೊಕ್ಕ? ಡಾಢ್ಯು?ಡು ಪಾಲನೋದ್ಭವ ನಾಶಮುಲ್\nಸೊರಿದಿ? ಜೇಯು ಮುಕುಂದ ಪದ್ಮಜ ಶೂಲಿ ಸಂಜ್ಞಲ? ಬ್ರಾಕೃತ\nಸ್ಫುರಿತ ಸತ್ತ್ವ ರಜಸ್ತಮಂಬುಲ? ಬೊಂದು ನಂದು ಶುಭಸ್ಥಿತುಲ್\nಹರಿ ಚರಾಚರಕೋಟಿ ಕಿಚ್ಚು ನನಂತಸತ್ತ್ವ ನಿರೂಢು?ಡೈ.","ಶುಕು?ಡು ಗೋಚಿಯು ಲೇಕ ಪೈ? ಜನ? ಜೂಚಿ ತೋಯಮುಲಂದು ಲ\nಜ್ಜಕು? ಜಲಿಂಪಕ ಚೀರ ಲೊಲ್ಲಕ ಚಲ್ಲುಲಾಡೆಡಿ ದೇವಕ\nನ್ಯಕಲು, ಹಾ! ಶುಕ!, ಯಂಚು ವೆನ್ಕ ಜನಂಗ ವ್ಯಾಸುನಿ? ಜೂಚಿ ಯಂ\nಶುಕಮುಲನ್ ಧರಿಯಿಂಚಿ ಸಿಗ್ಗುನ ಸ್ರುಕ್ಕಿ ರಂದಱು ಧೀನಿಧೀ!","ನಳಿನಲೋಚನ! ನೀವು ನಿಕ್ಕಮು ನಾಕು? ಬುಟ್ಟೆದ ವಂಚು ನೀ\nಖಲು?ಡು ಕಂಸು?ಡು ಪೆದ್ದಕಾಲಮು ಕಾರಯಿಂಟ ನಡಂಚೆ; ದು\nರ್ಮಲಿನಚಿತ್ತುನಿ ನಾಜ್ಞಜೇಯುಮು; ಮಮ್ಮು? ಗಾವುಮು ಭೀತುಲನ್;\nನುಲುಸು ಲೇಕ ಫಲಿಂಚೆ ನೋಚಿನ ನೋಮು ಲೆಲ್ಲನು ನೀವಯೈ.","ಪಸುಪು ಲಾಡಿ ಯುರೋಜಕುಂಕುಮ ಪಂಕಶೋಭಿತಲೈ ಲಸ\nದ್ವಸನಲೈ ಕಚಭಾರಚಂಪಕದಾಮಲೈ ಸುಲಲಾಮಲೈ\nಪಸಿ?ಡಿಮಾಡಲ ಕಾಂತು ಲಱ್ಱುಲ? ಬರ್ವ? ದೇರುಲಮೀ?ದ ಬೆಂ\nಪೆಸ?ಗ ಬಾಡಿರಿ ವ್ರೇತ ಲಾ ಹರಿಹೇಲ ಲಿಂಪಗು ನೇಲಲನ್.","ಕಡುಪುಲೋಪಲ ನುನ್ನ ಪಾಪ?ಡು ಕಾಲ? ದನ್ನಿನ? ಗಿನ್ಕತೋ\nನಡುವ? ಬೋಲುನೆ ಕ್ರಾ?ಗಿ ತಲ್ಲಿಕಿ? ನಾಥ! ಸನ್ನಮು ದೊಡ್ಡುನೈ\nಯಡ?ಗಿ ಕಾರಣ ಕಾರ್ಯರೂಪಮುನೈನ ಯೀ ಸಕಲಂಬು ನೀ\nಕಡುಪುಲೋನಿದೆ ಗಾದೆ? ಪಾಪ?ಡ? ಗಾಕ ನೇ ಮಱಿ ಯೆವ್ವ?ಡನ್?","ಜಲರುಹಾಹಿತ ಸೋದರೀ ಮುಖ ಚಂದ್ರ ಚಂದ್ರಿಕ ಲಾದಟನ್‌\nಗೊಲ?ದಿ ಮೀಱ?ಗ ಲೋಚನಂಬುಲ? ಗ್ರೋಲಿ ಯೊಪ್ಪು ಮಹಾಸುಖಿನ್‌\nಬಲುಕುಚೋ ನಭರಂಬುಲುಂ ಬಿದಪನ್‌ ಸಜಂಬು ಜಗಂಬುಲುನ್‌\nಜೆಲುವುಗಾ ದರಳಂಬುನೋಲಿ ರಚಿಂತು ರಂಧಕಜಿದ್ಯತಿನ್‌."],
tOTakamu:["ಜಗದೀಶ್ವರ  ನಾಕು  ಬ್ರ ಸನ್ನು? ಡವೇ\nನೊಗಿನಾತಪಮುನ್  ಫಲ ಯುಕ್ತಮಯೇ\nನ್ಸಗರಾತ್ಮಜುಲಂದರು ನಾವಲನನ್\nವಗದೀರ?ಗ? ಗಾಂತ್ರು ನಿವಾಪಮುಲನ್","ಜಲಜೋದರನಿರ್ಮಲಸಂಸ್ತವಮುಲ್‌\nವಿಲಸಿಲ್ಲೆಡು? ದೋಟಕವೃತ್ತಮುನನ್‌\nಬೊಲುಪೈ ಸಚತುಷ್ಕಮು? ಬೊಂಡಗ ನಿಂ\nಪಲರಾರ?ಗ? ಬಲ್ಕುದು ರಷ್ಟಯತಿನ್‌.","ಅಲಕಾಧಿಪತೀಸುಗುಣಾಭಿರತೀ\nಮಲಯೋಧ್ಭವಚಂದ್ರಸಮಾನಯಶಾ\nಕುಲಪಾವಸಯೂರುಜಗೋತ್ರವರಾ\nಲಲನಾಜನತಾಝುಷಲಕ್ಷ್ಮನುಭಾ"],
tOvakamu:["ಚೆಲ?ಗಿ ನಜಾಯಲ? ಜೆಂದಿನ ನಾರೀ\nತಿಲಕಮು ಲದ್ರಿಯತಿನ್‌ ಮೃದುರೀತಿನ್‌\nವೆಲಯ?ಗ? ದೋವಕ ವೃತ್ತಿ ವಿಭಾತಿನ್‌\nಬಲುಕುದು ರಿಮ್ಮುಲ? ಬಂಕಜನಾಭುನ್‌.","ತಮತಮತಪ್ಪುಲುದಾರೆರಿಯಂಗಾ\nವಿಮಲಮತೀ ಯಿಟು ವೀರಿಕಿನೈ ಶೋ\nಕಮುನ ದಹಿಂಪ?ಗ?ಗಾದುಮನಂಬುನ್\nಸಮುಚಿತಮಿತ್ತಱಿ ಶಾಂತಮುಸುಮ್ಮೀ"],
paMchaamaramu:["ಇ ಟಾ ಚತುರ್ಮುಖುಂ ಡರಾಗ? ನಿಷ್ಟ ಶಿಷ್ಟಪಾಳಿತೋ?\nದಟಾಲುನನ್ಮುನಿಪ್ರಭುಂಡು ತದ್ದ ಭಕ್ತಿಯುಕ್ತಿಮೈ\nನಿಟಾಲಮಂದು? ಗೇಲುದೋಯಿ ನಿಲ್ಚಿ ಮ್ರೊಕ್ಕಿ ನಿಲ್ಚಿತಾ\nನಿ ಟೇಟಿಕೋ  ನನುಂ ಗನಂಗ  ನೇಗುದೆಂಚೆ ಧಾತಯುನ್","ತ್ವರಾಸ ದೃಗ್ವಿಧೀಯಮಾನ ದಾನತೋಯ ಶೋಷಿತಾಂ\nಬುರಾಶಿ ವರ್ಧನಾತಿ ಕೃತ್ಪ್ರಭೂತ ಕೀರ್ತಿ ಮಂಡಲ\nಸ್ಫುರತ್ಸುಧಾ ಮಯೂಖ ವೈರಿ ಭೂಮಿ ಭೃಚ್ಚಿರೋಲ್ಲಸ\nತ್ಕಿರೀಟ ರತ್ನ ರಾಜಿತಕಾಂತಿ ದೀಪಿತಾಂಘ್ರಿ ಪಂಕಜಾ","ಜರೇಫಲುನ್‌ ಜರೇಫಲುನ್‌ ಜಸಂಯುತಂಬುಲೈ ತಗನ್‌\nಗುರೂಪರಿಸ್ಥಿತಿಂ ಬೊಸಂಗಿ ಗುಂಫನಂ ಬೆಲರ್ಪ?ಗಾ\nವಿರಿಂಚಿಸಂಖ್ಯ ನಂದಮೈನ ವಿಶ್ರಮಂಬುಲಂ ದಗುನ್‌\nಬ್ರರೂಢಮೈನ? ಬದ್ಮನಾಭ ಪಂಚಚಾಮರಂ ಬಗುನ್‌.","ಮರುತ್ರ್ಪರೋಹಲೋಲತಲ್ಪ ಮಧ್ಯಸಂಸ್ಥಲಾಶ್ರಯಾ\nಧರಾರಮಾಕರೋಪಲಾಲಿತಪ್ರಸಾರಿತಾಂಘ್ರಿಕಾ\nಮರುದ್ವೃಧಾಕಧಾನುಬಂಧಮಂಥರೋತ್ಸವಾನಕ\nಸ್ಫುರದ್ವಿರಾವನರ್ತಿತೋಪ ಭೂವನೀಶಿಖಾವಳಾ"],
bhujaMgaprayaatamu:["ಹರಿಂಚುಂ ಗಲಿಪ್ರೇರಿತಾಘಂಬುಲೆಲ್ಲನ್\nಭರಿಂಚುನ್ ಧರನ್ ರಾಮಭದ್ರುಂಡು? ಬೋಲೆನ್\nಜರಿಂಚುನ್ ಸದಾ ವೇದಶಾಸ್ತ್ರಾನುವೃತ್ತಿನ್\nವರಿಂಚುನ್ ವಿಶೇಷಿಂಚಿ ವೈಕುಂಠುಭಕ್ತಿನ್.","ಹರೀ ! ಚಕ್ರಧಾರೀ ! ಮುರಾರೀ ! ತ್ರಿಧಾಮಾ !\nವರಾಂಗಾ ! ಯುಪೇಂದ್ರಾ ! ಸುಬಾವೋ ! ಸ್ವಯಂಭೂ !\nಪರೇಶಾ ! ಹೃಷೀಕೇಶ ! ವೈಕುಂಠವಾಸಾ !\nವರಾಹಾ ! ಸಹಸ್ರಾಕ್ಷ ! ಪ್ರಾಗ್ವಂಶ ! ದೇವಾ ! "," ದ್ವಿಪಾಸ್ಯತ್ರಿಧಾಮತ್ರಿಧಾತುಪ್ರಸಿದ್ಧಾ!\nಸುಪರ್ವಪ್ರಮೋದಾಶುಭಾಂಗಾವೃಷಾಂಕಾ!\nಕಪಿತ್ಥಾತ್ತ ಸಂಪೃಕ್ತ ಭುಕ್ತಪ್ರಹೃಷ್ಟಾ!\nಕೃಪಾಂಭೋಧಿ! ಕುಬ್ಜಾಕೃ ತೀಶಾ! ನಮಸ್ತೇ!","ಅಭದ್ರಾಂಧಕಾರೋದಯದ್ಭಾನುಭಾವಾ\nಶುಬೈಕಾಶ್ರಯೀಭೂತ ಶುದ್ಧಸ್ವಭಾವಾ\nಅಭಕ್ತಾವಳೀದೃಷ್ಟ್ಯಹಃ ಕಾಲತಾರಾ\nಸ್ವಭಕ್ತಾಗ್ರಭೂಪಾರಿ ಜಾತಾವತಾರಾ"],
mattakOkilamu:["ಬಲ್ಲಿದುಂ ಡಗು ಕಂಸುಚೇತನು ಬಾಧ ನೊಂದುಚುಚುನ್ನ ಮೀ\nತಲ್ಲಿ? ಗಾಚಿನ ಭಂಗಿ? ಗಾಚಿತಿ ಧಾರ್ತರಾಷ್ಟ್ರುಲಚೇತ ನೇ?\nದಲ್ಲಡಂಬುನ? ಜಿಕ್ಕಕುಂಡ?ಗ ದಾವಕೀನ ಗುಣವ್ರಜಂ\nಬೆಲ್ಲ ಸಂಸ್ತುತಿ ಸೇಸಿ ಚೆಪ್ಪ?ಗ ನೆಂತದಾನ ಜಗತ್ಪತೀ!","ಅನ್ಯಸನ್ನುತ ಸಾಹಸುಂಡು ಮುರಾರಿ ಯೊತ್ತೆ ಯದೂತ್ತಮುಲ್\nಧನ್ಯುಲೈ ವಿನ? ಬಾಂಚಜನ್ಯಮು ದಾರಿತಾಖಿಲಜಂತು ಚೈ\nತನ್ಯಮುನ್ ಭುವನೈಕಮಾನ್ಯಮು ದಾರುಣಧ್ವನಿ ಭೀತರಾ\nಜನ್ಯಮುನ್ ಬರಿಮೂರ್ಚಿತಾಖಿಲಶತ್ರುದಾನವಸೈನ್ಯಮುನ್.","ತಂಡ್ರಿ ಸಚ್ಚಿನಮೀ?ದ ಮಾಪೆದತಂಡ್ರಿಬಿಡ್ಡಲು ದೊಲ್ಲಿ ಪೆ\nಕ್ಕಂಡ್ರು ಸರ್ಪವಿಷಾಗ್ನಿಬಾಧಲ ಗಾಸಿ? ಬೆಟ್ಟ?ಗ ಮಮ್ಮು ನಿ\nಲ್ಲಾಂಡ್ರ ನಂತಮು? ಬೊಂದಕುಂಡ?ಗ ಲಾಲನಂಬುನ ಮೀರು ಮಾ\nತಂಡ್ರಿ ಭಂಗಿ ಸಮುದ್ಧರಿಂತುರು ತದ್ವಿಧಂಬು ದಲಂತುರೇ?","ವಾವಿ? ಜೆಲ್ಲೆಲು ಗಾನಿ ಪುತ್ರಿಕವಂಟಿ ದುತ್ತಮುರಾಲು; ಸಂ\nಭಾವನೀಯಚರಿತ್ರ; ಭೀರುವು; ಬಾಲ; ನೂತ್ನವಿವಾಹ ಸು\nಶ್ರೀವಿಲಾಸಿನಿ; ದೀನ; ಕಂಪಿತಚಿತ್ತ; ನೀ ಕಿದೆ ಮ್ರೊಕ್ಕೆದನ್;\nಕಾವವೇ; ಕರುಣಾಮಯಾತ್ಮಕ; ಕಂಸ! ಮಾನವವಲ್ಲಭಾ!","ತಲ್ಲಿ! ನೀ ಯುದರಂಬುಲೋನ? ಬ್ರಧಾನಬೂರುಷು? ಡುನ್ನವಾ?\nಡೆಲ್ಲಿ ಪುಟ್ಟೆಡಿ?; ಗಂಸುಚೇ ಭಯ ಮಿಂತ ಲೇದು; ನಿಜಂಬು; ಮಾ\nಕೆಲ್ಲವಾರಿಕಿ ಭದ್ರಮಯ್ಯೆಡು; ನಿಂಕ ನೀ ಕಡು ಪೆಪ್ಪುಡುಂ\nಜಲ್ಲಗಾವಲೆ ಯಾದವಾವಳಿ ಸಂತಸಂಬುನ? ಬೊಂಗ?ಗನ್.","ಒಕ್ಕಚೇತ ಸುದರ್ಶನಂಬುನು ನೊಕ್ಕ ಚೇತನು ಶಂಖಮುನ್‌\nಒಕ್ಕಚೇತ? ಬಯೋರುಹಂಬುನು ನೊಕ್ಕ ಚೇತ ಗದಂ ದಗನ್‌\nಜಕ್ಕಡಂಬಗುಮೂರ್ತಿಕಿನ್‌ ರಸಜಾಭರಂಬುಲು ದಿಗ್ಯತಿನ್‌\nಮಕ್ಕುವಂದಗ? ಬಾಡಿ ರಾರ್ಯುಲು ಮತ್ತಕೋಕಿಲ ವೃತ್ತಮುನ್‌."],
maththEbhaM:["ಸವರಕ್ಷಾರ್ಥಮು ದಂಡ್ರಿ ಪಂಪ ಜನಿ ವಿಶ್ವಾಮಿತ್ರುಡುಂ ದೋಡರಾ\nನವಲೀಲಂ ದುನುಮಾಡೆ ರಾಮು ಡದಯುಂಡೈ ಬಾಲುಡೈ ಕುಂತಲ\nಚ್ಛವಿಸಂಪಜ್ಜಿತಹಾಟಕನ್ ಗಪಟಭಾಷಾವಿಫುರನ್ನಾಟಕನ್\nಜವಭಿನ್ನಾರ್ಯಮಘೋಟಕನ್ ಕರವಿರಾಜ ತ್ಖೇಟಕನ್ ದಾಟಕನ್","ಸಿರಿಕಿಂ ಜೆಪ್ಪಡು; ಶಂಖ ಚಕ್ರ ಯುಗಮುಂಜೇದೋಯಿ ಸಂಧಿಂಪಡೇ\nಪರಿವಾರಂಬುನು ಜೀರ ಡಭ್ರಗಪತಿಂ ಬನ್ನಿಂಪ ಡಾಕರ್ಣಿಕಾಂ\nತರ ಧಮ್ಮಿಲ್ಲಮು ಜಕ್ಕ ನೊತ್ತಡು ವಿವಾದಪ್ರೋತ್ಥಿತಶ್ರೀಕುಚೋ\nಪರಿಚೇಲಾಂಚಲಮೈನ ವೀಡಡು ಗಜಪ್ರಾಣಾವನೋತ್ಸಾಹಿಯೈ","ಅಲ ವೈಕುಂಠಪುರಂಬುಲೋ ನಗರಿಲೋ ನಾ ಮೂಲ ಸೌಧಂಬು ದಾ\nಪಲ ಮಂದಾರವನಾಂತರಾಮೃತ ಸರಃ ಪ್ರಾಂತೇಂದು ಕಾಂತೋಪಲೋ\nತ್ಪಲ ಪರ್ಯಂಕ ರಮಾವಿನೋದಿ ಯಗು ನಾಪನ್ನಪ್ರಸನ್ನುಂಡು ವಿ\nಹ್ವಲ ನಾಗೇಂದ್ರಮು \"ಪಾಹಿಪಾಹಿ\" ಯನ? ಗುಯ್ಯಾಲಿಂಚಿ ಸಂರಂಭಿಯೈ.","ಕಲ? ಡಂಭೋಧಿ?, ಗಲಂಡು ಗಾಲಿ?, ಗಲ? ಡಾಕಾಶಂಬುನಂ, ಗುಂಭಿನಿಂ\nಗಲ?, ಡಗ್ನಿನ್ ದಿಶಲಂ ಬಗಳ್ಳ ನಿಶಲನ್ ಖದ್ಯೋತ ಚಂದ್ರಾತ್ಮಲಂ\nಗಲ?, ಡೋಂಕಾರಮುನಂ ದ್ರಿಮೂರ್ತುಲ? ದ್ರಿಲಿಂಗವ್ಯಕ್ತುಲಂ ದಂತಟಂ\nಗಲ?, ಡೀಶುಂಡು ಗಲಂಡು, ತಂಡ್ರಿ! ವೆದಕಂಗಾ ನೇಲ ಯೀ ಯಾ ಯೆಡನ್.","ವಾ?ಡೆ ವಧೂಮಣಿ ಚೂಡವೇ ದ್ರಿದಿವದ್ರುಮಂಬು ಧರಿತ್ರಿಕಿನ್‌\nಬೋ?ಡಿಮಿ ದೆಚ್ಚಿನ ಶೂರು? ಡೀತನಿ? ಬೋಲಲೇ ರಿಲ ನೆವ್ವರುನ್‌\nವೀ? ಡಧಿಕುಂ ಡನಿ ಭೀಮವಿಶ್ರಮವೃತ್ತಿ ಭೂತಿಲಕಂ ಬಗುನ್‌\nವೇ?ಡಿ ನುತಿಂತುರು ಭಾರಸಂಬುಲ ವೆಂಟ ಜಾಗಮು ಲೊಂದ?ಗಾನ್‌."],
mahaasragdhara:["ಜಯ ಭೂಪಾ! ಕೃಷ್ಣರಾಯಾ! ಜಯ ಸರಸಗುಣಾ! ಶತ್ರುಗರ್ವಾಪಹಾರೀ!\nಜಯ ಪ್ರಾಜ್ಞಾ! ಆಂಧ್ರಭೋಜಾ! ಜಲಜಹಿತರುಚಾ! ಸಾಹಿತೀ ಸಾರ್ವಭೌಮಾ!\nಜಯ ಶ್ರೀವಿಷ್ಣುಸ್ವರೂಪಾ! ಜಯ ಸುಕವಿವರಾ! ಸಾಕ್ಷರಾನಂದಮೂರ್ತೀ!\nಜಯ ದೇವೇಂದ್ರಾಭರಾಜತ್ ಸಕಲ ವಿಭವ! ಧೀಸಾರ ತೇಜೋನಿಧಾನಾ!","ಅತಿರೌದ್ರಾಕಾರಕೀಲಾಯತದವದಹನೋಗ್ರಾಗ್ರ ಸೇನಾನಿಪೀಡಾ\nಹತು ಲೈ ನಾನಾವಿಧೋಪಾಯನಮುಲು ಗೊನಿ ಸೌಹಾರ್ದವಾಂಛನ್ ಜಯಶ್ರೀ\nಶ್ರಿತಬಾಹುಂ ಗಾನ?ಗಾ ವಚ್ಚಿರಿ ಸಕಲಜಗತ್ಸೇವ್ಯಮಾನುನ್ ಮಹೇಂದ್ರ\nಪ್ರತಿಮುಂ ಗೌರವ್ಯವಂಶಪ್ರಭು ನಖಿಲಮಹೀಪಾಲು ರಾಂಬಾಲಿಕೇಯುನ್.","ಕನಿಯೆಂ ದಾಲಾಂಕು? ಡುದ್ಯತ್ಕಟಚಟುಲ ನಟತ್ಕಾಲದಂಡಾಭಶೂಲುನ್\nಜನರಕ್ತಾಸಿಕ್ತತಾಲುನ್ ಸಮಧಿಕ ಸಮರೋತ್ಸಾಹಲೋಲುಂ ಗಠೋರಾ\nಶನಿತುಲ್ಯೋದಗ್ರ ದಂಷ್ಟ್ರಾ ಜನಿತ ಶಿಖಕಣಾಚ್ಛಾದಿತಾಶಾಂತರಾಳುನ್\nಹನನವ್ಯಾಪಾರಶೀಲುನ್ನತಿ ದೃಢಘನಮಸ್ತಾಸ್ಥಿಮಾಲುಂ ಗರಾಳುನ್","ಹರಿಪೈ ಸರ್ವಾತ್ಮುಪೈ ನತ್ಯಗಣಿತಗುಣುಪೈ ನಂತರಂಗಂಬು ಪರ್ವನ್\nಸರಿಮೇ ನುಪ್ಪೊಂಗ? ಜಾವುಂ ಜಯಮುನು ಸರಿಗಾ ಸಂತಸಂಬಂದುಚುಂ ಭೀ\nಕರು?ಡೈ ಕಾಲಾಗ್ನಿ ಪೋಲೆಂ ಗನುಲುಚು? ಗವಿಸೆನ್ ಗರ್ವದುರ್ವಾರು?ಡೈ ದು\nರ್ಭರಲೀಲನ್ ಭೂಮಿ ಗಂಪಿಂಪ?ಗ ದಿಶಲ ದ್ರುವನ್ ಭಂಡನೋದ್ದಂಡವೃತ್ತಿನ್.","ಅತಿಶೋಕಕ್ರೋಧವೇಗವ್ಯಥಿತಹೃದಯು?ಡೈ ಯಶ್ವಸಾದಿತ್ವವೀರೋ\nದ್ಧತಿ? ಬ್ರೌಢಸ್ಫುರ್ತಿ ಸೆಲ್ವೊಂದ?ಗ ಸಬಳಮು? ದದ್ಗಾತ್ರಮುಂ ಜೊಪ್ಪೆ? ಬೂ?ಚೆ\nನ್ಶೃತಸೋಮುಂ ಡಲ್ಲ? ಬಟ್ಟೆನ್ಗುರುಸುತು? ಡದಿಯುನ್ ಸ್ರುಕ್ಕ ಚೆನ್ನಾರನಲ್ಕ\nನ್ಧೃತಖಡ್ಗುಂ ಡೈನ? ಜೇಯುನ್ಸಿರಮು? ದುರಗಮುನ್ವ್ರೇಲ್ಮಡಿಂ ದ್ರುಂಚಿ ವೈಚೆನ್.","ಶ್ರುತಸೇನುಂ ಡಪ್ಡು ಕೋಪಸ್ಫುರದರುಣಮರೀಚುಲ್ ದಲಿರ್ಪಂಗ? ಜಕ್ಷು\nರ್ದ್ವಿತಯಂಬುಂ ಗೆಂಪುನಂ ಬೊಂದಿನಚೆಲುವಮು ಸಂದೀಪ್ತಘೋರಂಬುಗಾ ಬೆ\nಟ್ಟತನಿಂ ಜಂಚದ್ಗದನ್ ವ್ರೇಯ?ಗ ನುಱಕ ತದಾಸ್ಯಚ್ಛಿದಾಸ್ಫಾರಕೇಳೀ\nಚುತುರುಂಡೈ ಯಕ್ಕುಮಾರುನ್ ಜಮುಕಡ ಕನಿಚೆಂ ಜಂಡದೋರ್ದರ್ಪ ಮೊಪ್ಪನ್.","ವಿತತಜ್ಯಾನಾದ ಮಾಶಾವಿತತಿ ನಿನಿಚಿ ದೋರ್ವೀರ್ಯ ಮೇಪಾರ ಬಾಣ\nಪ್ರತತಿಂ ದನ್ಮುಂಪ ವೀ?ಕಂ ಬಲಕ ಜಡಿಯುಚುನ್ ಬಲ್ವಿಡಿಂ ಜೇರ್ಚಿ ಚಂಚ\nಧ್ಗತಿ? ಗ್ರೀಡಂ ದಂತಿಹೇಲಾದಳನರತಮೃಗೇಂದ್ರಸ್ಫುರನ್ಮೂರ್ತಿ ದೋ?ಪನ್\nಶ್ರುತಕೀರ್ತಿಂ ಗಿಟ್ಟಿ ಕಂಠತ್ರುಟನವಿಲಸನಾರೂಢಿ ನವ್ವಿಪ್ರು? ಡೊಪ್ಪೆನ್.","ಕೊಲಿಚೆಂ ಬ್ರೋತ್ಸಾಹವೃತ್ತಿಂ ಗುತಲಗಗನಮುಲ್‌ ಗೂಡ ರೆಂಡಂಘ್ರುಲಂ ದಾ\nಬಲಿ? ಬಾತಾಳಂಬು ಚೇರಂ ಬನಿಚೆ? ಗಡಮಕೈ ಬಾಪುರೇ ವಾಮನುಂಡ\nಸ್ಖಲಿತಾಟೋಪಾಢ್ಯು? ಡಂಚುಂ ಗರಿಗಿರಿವಿರಮಾಕಾರ ಮಾರನ್‌ ನತಾನೋ\nಜ್ಜ್ವಲಸೋದ್ಯದ್ರೇಫಯುಗ್ಮಾಶ್ರಯಗುರುಲ ಮಹಾಸ್ರಗ್ಧರಂ ಜೆಪ್ಪ ನೊಪ್ಪುನ್‌."],
maanini:["ಕೊನ್ನೆಲಪುವ್ವುನು ಗೋಱಲಪಾ?ಗಯು? ಗೂರ್ಚಿನ ಕೆಂಜಡ ಕೊಪ್ಪುನಕುನ್‌\nವನ್ನೆ ಯೊನರ್ಚಿನ ವಾಹಿನಿ ಯೀತನಿ ವಾಮಪದಂಬುನ ವ್ರಾಲೆನನನ್‌\nಜೆನ್ನುಗ ನದ್ರಿಭಸೇವ್ಯಗುರುನ್ವಿಲಸಿಲ್ಲು ರಸತ್ರಯ ಚಿತ್ರಯತುಲ್‌\nಪನ್ನುಗ? ನೊಂದ? ಬ್ರಭಾಸುರವಿಶ್ರಮ ಭಂಗಿಗ ಮಾನಿನಿ ಭವ್ಯಮಗುನ್‌.","ಬಂಗರುಚೇಲಯು? ಬದ್ಮನಿಖಾಕ್ಷುಲು ಬಾಹುಚತುಷ್ಕಮು ಭವ್ಯವಿಭೋ\nತ್ಸಂಗಿತ ಶಂಖಸುದನ್ಶನ ಶಾರ್ಜಗದಾಮುಖ ಚಿಹ್ನಮು ತತ್ತ್ವ ಮುನೀ\nಲಾಂಗಮು ನೀನದಿಯೌರಸೃಜಿಂಚು ನಿಜಾಶಿತ ದೇಹಿಕಿನಂತಿಕ ಸ\nದ್ರಂಗಶಯಾನು?ದಿ ರಂಬುಗ?ಜೂಚಿಕರಂಬಿದಿವೋಚತುರತ್ವಮನುನ್"],
maalini:["ಸಕಲ ನಿಗಮವೇದ್ಯುನ್‌ ಸಂಸೃತಿವ್ಯಾಧಿವೈದ್ಯುನ್‌\nಮಕುಟವಿಮಲಮೂರ್ತಿನ್‌ ಮಾಲಿನೀವೃತ್ತ ಪೂರ್ತಿನ್‌\nನಕಲಿತಸಮಯೋಕ್ತಿನ್ನಾಗವಿಶ್ರಾಂತಿಯುಕ್ತಿನ್‌\nಸುಕವುಲು ವಿವರಿಂಪನ್‌ ಸೊಂಪಗುನ್ವಿಸ್ತರಿಂಪನ್‌.","ಸರಸಸುರವಧೂಲಾಸ್ಯಂಬುಲುನ್ ಸಿದ್ಧವಿದ್ಯಾ\nಧರಪಟುಪಟಹಾತೋದ್ಯಂಬುಲುನ್ ಗಿನ್ನರೀಕಂ\nಪುರುಷಲಲಿತಗೀತಂಬುಲ್ ಮಹಾರಮ್ಯಮಯ್ಯೆನ್\nವರಮುನುದಿವಿಜಾಳೀರ್ವಾದನಾದಂಬುತೋಡನ್"],
mEghavisphooritaM:["ಸ್ಥಿರಾಂಶುಪ್ರಸ್ವಿನ್ನಾಮೃತಕರವಿಯಧ್ಧೇಶಚೂಡಾಮನೋಜ್ಞಾ\nಪುರಾಳೀಪ್ರಧ್ವಾಸಾಧ್ಭುತರತಭಿಜಾಬೋಗಕೇಳೀಸಮಜ್ಞಾ\nಮರುತ್ಪಾಳೀಕೇಳೀಗಿರಿಕೃತಧನುರ್ಮಂಡಲೀಲಗ್ನವಿಷ್ಣೂ\nಸರಜ್ಜ್ವಾಲಾಹಾಲಾಹಲವಿಷಮಹಾಸಹ್ವರೇಖಾಸಹಿಷ್ಣೂ","ರಮಾನಾಥುನ್‌ ನಾಥುನ್‌ ಯದುಕುಲಶಿರೋರಮ್ಯ ರತ್ನಾಯಮಾನುನ್‌\nಸಮುದ್ಯತ್ತೇಜಿಷ್ಣುನ್‌ ದನುಜಯುವತಿಸ್ಫಾರಹಾರಾಪಹಾರುನ್‌\nಮಿಮುಂ ಬ್ರೀತಿಂ ಬೇರ್ಕೊಂ ಡ್ರರುಣವಿರತಿನ್‌ ಮೇಘವಿಸ್ಫೂರ್ಜಿತಾಖ್ಯನ್‌\nಗ್ರಮಂಬೊಪ್ಪನ್‌ ಬೆದ್ದಲ್‌ ಯಮನಸಮುಲುನ್‌ ರಾಗಮುಲ್ಗಾ ಮುಕುಂದಾ!"],
layagraahi:["ಎಂದುನಿಲನೇಜನುಲಕುಂದಲ?ಪರಾನಿತಪಮಂದಿಕೊನಿಚೇಸಿರೊಕೊನಂದು?ಡುಯಶೋದಾ\nಸುಂದರಿಯು?ಬೂರ್ಣನಿಧಿ?ಬೊಂದಿರಿಕಡುನ್ದೊರಸಿಪೊಂದಗುನುಮುಪ್ಪುತಱಿನಂದನುನಿಗಾಶ್ರೀ\nಮಂದಿರುನಿನಂಚುನಿಟುಲಂದಮುಗ? ಬ್ರಾಸಮುಲು ಗ್ರಂದುಕೊನಿಚೆಪ್ಪುಮುನಿಬೃಂದಮುಲಯಗ್ರಾ\nಹಿಂದನರಸಬ್ಭಜಸಲುಂದಗನಕಾರಮುನುಬೊಂದನಿರುಚೋಟ್ಲನುಬಿಱುಂದಭಯಲೊಂದನ್","ಕಮ್ಮನಿ ಲತಂತಮುಲ ಕುಮ್ಮೊನಸಿ ವಚ್ಚು ಮಧು ಪಮ್ಮುಲ ಸುಗೀತನಿನ ದಮ್ಮುಲೆಸ?ಗೆಂ ಜೂ\nತಮ್ಮುಲ ಲಸತ್ಕಿಸಲ ಯಮ್ಮುಲ ಸುಗಂಧಿಮುಕುಳಮ್ಮುಲನು ನಾನುಚುಮು ದಮ್ಮೆನರ ವಾಚಾ\nಲಮ್ಮುಲಗು ಕೋಕಿಲಕುಲಮ್ಮುಲ ರವಮ್ಮು ಮಧುರಮ್ಮಗುಚು ವಿಂಚೆನನುಶಮ್ಮು ಸುಮನೋಭಾ \nರಮ್ಮುಲ ನಶೋಕ ನಿಕರಮ್ಮುಲುನು ಜಂಪಕ ಚ ಯಮ್ಮುಲುನು ಗಿಂಶುಕವ ನಮ್ಮುಲುನು ನೊಪ್ಪೆನ್"],
layavibhaati:["ಪಡಯರೆತನೂಭಮುಲ ನ್ಬಡಯುದುರುಗಾಕಪೆರಪಡತುಲುನುಭರ್ತಲುನುಬಡಸಿರೆತಲಂಪನ್\nಬುಡಮಿಗಲನಂದುಡುನುಬಡತುಕಯಶೋದಯುನುಗಡಪುನಜಗತ್ರಯಮುನಿಡಿಕೊನಿನಪುತ್ರುನ್\nಬಡಸಿರಟಯಂಚುಬೆಡಗಡರುನಸನತ್ರಿವೃತಿಗಡನಸಗಮುಲ್ಪೊಸಗನಿಡಲಯವಿಭಾತಿನ್\nನೊಡುವುದುರುಸತ್ಕವುಲೆಪುಡುನುವಿರಿತೇನಿಯಲುವಡಿಯುಪಗಿದಿನ್ರನಮುಗಡಲುಕೊನುಚುಂಡುನ್","ಅಲಿಕುಲಮು ನೀಲಮುಲ ಚೆಲುವಮು ವಹಿಂಪ ನವಡಳಮುಲ ಹರಿನ್ಮಣುಲ ಪೊಲುಪು ನದಲಿರ್ಪನ್\nದಲಿರುಗಮಿ ಕೆಂಪುಲುಗ? ಬಲುದೆಱ್?ಗು ಕ್ರೊವ್ವಿರುಲ ವಿಲಸನಮು ಮುತ್ತಿಯಪು ಗುಳಿಕಲಕು? ದಕ್ಕುನ್ \nಗಲ ಮಣುಲಕುಂ ಬಸಿ?ಡಿಕಳಕುಲಕು ನೀಡಗುಚು ವೆಲಯ?ಗ? ಬರಾಗಮುಲು ಲಲಿತಪು ವಿತಾನಂ\nಬುಲುಗ ಗೃಹಮುಖ್ಯಮುಲ  ಚೆಲುವು ಪ್ರತಿಬಿಂಬಮುಲು ಬಲೆ? ಬುರಮು ನಲ್ಧೆಸಲ? ಬೊಲುಚುನು ವನಂಬುಲ್ ","ಚಲುವ ಲೊಸ?ಗೆನ್‌ ಸರಗ? ಜೆಲುವ ಯಪು ಡೊಕ್ಕರಿತೆ ವಲ?ತಿತನ ಮೊಪ್ಪ ನೊಕಪೊಲ?ತಿ ತಡಿ ಯೊತ್ತೆನ್‌\nಗೊಲ?ದಿಗ ಜವಾದಿ ನೊಕವೆಲ?ದಿ ತಲ? ಬೂಸೆ ನೊಕ ಜಲರುಹದಳಾಕ್ಷಿ ಸಿಗ ಕಲರುಸರಿ ಚುಟ್ಟೆನ್‌\nದಿಲಕ ಮಿಡಿಯೆನ್ನಿಟಲಫಲಕಮುನ ನೊಕ್ಕ ಸತಿ ತೆಲಿ ನಿಲುವುಟದ್ದ ಮೊಕಚೆಲಿ ನಿಲಿಪೆ ಮ್ರೋಲನ್‌\nಗಲಯ ಜವರಾ ಲೊಕತೆ ಮಲಯಜ ಮಲಂದೆ ನೊಕ ಲಲನ ವಿಸರೆನ್‌ ಸುರಟಿ ಯಲನರುನ ಕರ್ಥಿನ್‌."],
vanamayooramu:["ಉನ್ನತಮುಲೈ ವನಮಯೂರಕೃತುಲೋಲಿನ್\nಎನ್ನಗ ಭಜಂಬುಲಪಯಿನ್ ಸನಗಗಂಬುಲ್\nಚೆನ್ನೊದವ ದಂತಿಯತಿ ಜೆಂದಿ ಯಲವಾರುನ್\nವೆನ್ನುನಿ ನುತಿಂತುರು ವಿವೇಕುಲತಿಭಕ್ತಿನ್","ಮಾಣವಕರತ್ನಮುಲು  ಮೌನಿವರುವೆಂಟನ್\nರಾಣಮೆಯಿ?  ಬೋವುನೆಡ  ರಾಮು? ಡು  ಮೃದುಶ್ರೀ\nವಾಣಿ ನಿಟು  ಪಲ್ಕೆ  ಋಷಿ ವರ್ಯ !  ಗಿರಿಚೆಂತನ್\nಬೊಣಿಮಿ  ನೆಸಂಗೆ?  ದರುಪುಂಜ ಮದಿ  ಗಂಟೇ ?","ರಾಜಕುಲಶೇಖರಪರಂತಪ ವಿವೇಕ\nಭ್ರಾಜಿತ ಜಗದ್ವಲಯ ಭಾಸುರಸಮುದ್ಯ\nತ್ತೇಜನಿರವದ್ಯಯುವತೀಮದನವೀರೋ\nಗ್ರಾಜಿವಿಜಯಾತ್ರಿಭಿವನಂಕುಶನರೇಂದ್ರಾ"],
vasaMtatilakamu:["ಶ್ರೀರಮ್ಯ ರಾಜಕುಲಶೇಖರ ರಾಜರಾಜಾ\nಭೂರಿಪ್ರತಾಪಪರಿಭೂತವಿರೋಧಿವರ್ಗಾ\nಹಾರಾಮೃತಾಬ್ಜಹರ ಹಾಸತುಷಾರಕುಂದ\nಸ್ಫಾರದ್ಯಶಃಪ್ರಸರ ಪಾಂಡುಕೃತತ್ರಿಲೋಕಾ","ಗೌರೀನಿತಾಂತಜಪ ಕಾರಣನಾಮಧೇಯುನ್‌\nದೂರೀಕೃತಪ್ರಣತದುಷ್ಕೃತು ನಂಬುಜಾಕ್ಷುನ್‌\nಧೀರೋತ್ತಮುಲ್ಗಿರಿಯತಿನ್‌ ತಭಜಾಗಗಲ್ಪೆಂ\nಪಾರನ್ವಸಂತತಿಲಕಾಖ್ಯ ಮೊನರ್ತು ರೊಪ್ಪುನ್‌."],
saardhoolaM:["ಶ್ರೀ ಕೈವಲ್ಯ ಪದಂಬು? ಜೇರುಟಕುನೈ ಚಿಂತಿಂಚೆದನ್ ಲೋಕ ರ\nಕ್ಷೈಕಾರಂಭಕು ಭಕ್ತ ಪಾಲನಕಳಾಸಂರಂಭಕುನ್ ದಾನವೋ\nದ್ರೇಕಸ್ತಂಭಕು? ಗೇಳಿಲೋಲವಿಲಸದ್ದೃಗ್ಜಾಲಸಂಭೂತ ನಾ\nನಾಕಂಜಾತಭವಾಂಡ ಕುಂಭಕು ಮಹಾನಂದಾಂಗನಾಡಿಂಭಕುನ್.","ಪುಟ್ಟಂ ಬುಟ್ಟ, ಶರಂಬುನನ್ ಮೊಲವ ನಂಭೋಯಾನಪಾತ್ರಂಬುನನ್\nನೆಟ್ಟಂ ಗಲ್ಗನು ಗಾಳಿ? ಗೊಲ್ವನು ಬುರಾಣಿಂಪನ್ ದೊರಂಕೊಂಟಿ ಮೀ?\nದೆಟ್ಟೇ ವೆಂಟ? ಜರಿಂತು? ದತ್ಸರಣಿ ನಾ ಕೀವಮ್ಮ?ಯೋ! ಯಮ್ಮ ಮೇಲ್\nಪಟ್ಟುನ್ ನಾಕಗುಮಮ್ಮ?ನಮ್ಮಿತಿ? ಜುಮೀ?ಬ್ರಾಹ್ಮೀ! ದಯಾಂಭೋನಿಧೀ!","ಸೂತಾ! ಯೇ ಯುಗವೇಳ ನೇಮಿಟಿಕಿ ನೆಚ್ಚೋಟನ್ ಮುನಿಶ್ರೇಷ್ಠು ನೇ\nಶ್ರೋತಲ್ ಗೋರಿರಿ? ಯೇಮಿ ಹೇತುವುನಕೈ, ಶೋಧಿಂಚಿ ಲೋಕೈಕ ವಿ\nಖ್ಯಾತಿನ್ ವ್ಯಾಸುಡು? ಮುನ್ನು ಭಾಗವತಮುಂ ಗಲ್ಪಿಂಚೆ?? ದತ್ಪುತ್ತ್ರು?ಡೇ\nಪ್ರೀತಿನ್ ರಾಜುನಕೀ ಪುರಾಣಕಥ? ಜೆಪ್ಪೆಂ? ಜೆಪ್ಪವೇ ಯಂತಯುನ್.","ತಾಟಂಕಾಚಲನಂಬುತೋ,ಭುಜನಟದ್ದಮ್ಮಿಲ್ಲ ಬಂಡಂಬುತೋ\nಶಾಟೀಮುಕ್ತ ಕುಚಂಬುತೋ, ಸದೃಢಚಂಚತ್ಕಾಂಚಿತೋ, ಶೀರ್ಣಲಾ\nಲಾಟಾಲೇಪಮುತೋ, ಮನೋಹರಕರಾಲಗ್ನೋತ್ತರೀಯಂಬುತೋ\nಗೋಟೀಂದುಪ್ರಭತೋ, ಸುರೋಜಭರ ಸಂಕೋಚದ್ವಿಲಗ್ನಂಬುತೋನ್","ಊಹ ಗಲಂಗಿ ಜೀವನಪುಟೋಲಮುನಂ ಬಡಿ ಪೋರುಚುನ್ ಮಹಾ\nಮೋಹಲತಾ ನಿಹದ್ದಪದಮುನ್ ವಿಡಿಪಿಂಚುಕೊನಂಗ ಲೇಕ ಸಂ\nದೇಹಮುಬೋದು ದೇಹಿ ಕ್ರಿಯ ದೀನದಶನ್ ಗಜ ಮುಂಡೆ ಭೀಷಣ\nಗ್ರಾಹದುರಂತ ದಂತ ಪರಿಘಟ್ಟಿತ ಪಾದ ಖುರಾಗ್ರ ಶಲ್ಯಮೈನ್","ಲಾ ವೊಕ್ಕಿಂತಯು ಲೇದು; ಧೈರ್ಯಮು ವಿಲೋಲಂಬಯ್ಯೆ; ಬ್ರಾಣಂಬುಲುನ್\nಠಾವುಲ್ ದಪ್ಪೆನು; ಮೂರ್ಛ ವಚ್ಛೆ?; ದನುವುನ್ ಡಸ್ಸೆನ್; ಶ್ರಮಂಬಯ್ಯೆಡಿನ್;\nನೀವೇ ತಪ್ಪ ನಿತಃಪರಂ ಬೆಱು?ಗ; ಮನ್ನಿಂಪಂದ ಗುನ್ ದೀನುನಿನ್;\nರಾವೇ! ಯೀಶ್ವರ! ಕಾವವೇ ವರದ! ಸಂರಕ್ಷಿಂಪು ಭದ್ರಾತ್ಮಕಾ!","ಪದ್ಮಪ್ರೋದ್ಭವಸನ್ನಿಭುಲ್‌ ಮಸಜಸಪ್ರವ್ಯಕ್ತ ತಾಗಂಬುಲನ್‌\nಬದ್ಮಾಪ್ತಾಂಚಿತವಿಶ್ರಮಂಬುಗ ಸಮುತ್ಪಾದಿಂತು ರುದ್ಯನ್ಮತಿನ್‌\nಬದ್ಮಾಕ್ಷಾಯ ನಿಜಾಂಘ್ರಿಸಂಶ್ರಿತ ಮಹಾಪದ್ಮಾಯ ಯೋಗೀಂದ್ರ ಹೃ\nತ್ಪದ್ಮಸ್ಥಾಯ ನಮೋಸ್ತುತೇ ಯನುಚು ನೀಶಾರ್ದೂಲವಿಕ್ರೀಡಿತನ್‌."],
sragdhara:["ಕೂಲುನ್ ಗುಱ್ಱಂಬುಲೇನುಂಗುಲು ಧರ? ಗೆಡಯುಂ ಗುಪ್ಪಲೆ?; ನುಗ್ಗುನೂಚೆ?\nವ್ರಾಲುನ್ದೇರುಲ್‌ ಹತಂಬೆ? ವಡಿ?ಬಡು ಸುಭಟವ್ರಾತಮುಲ್‌; ಶೋಣಿತಂಬುಲ್‌\nಗ್ರೋಲುನ್, ಮಾಂಸಂಬು ನಂಜುಂಗೊಱಕು, ನೆಮುಕಲನ್ಗುಂಪುಲೆ? ಸೋಲುಚುನ್ ಭೇ\nತಾಲಕ್ರವ್ಯಾದಭೂತೋತ್ಕರಮುಲು; ಜತಲೆ? ತಾಳಮುಲ್‌ ದಟ್ಟಿ ಯಾಡುನ್.","ಸೇವಿಂಚೆನ್ ರಂಗಧಾಮುನ್ ಶ್ರಿತನಿವಹಪಯಸ್ಸಿಂಧುಸಂಪೂರ್ಣಸೋಮುಂ\nಗಾವೇರೀ ಮಧ್ಯಸೀಮುನ್ ಘನಕಲುಷ ಮಹಾಕಾಲಕೂಟೋಗ್ರ ಭೀಮುನ್\nದೇವಾರಿಶ್ರೀವಿರಾಮುನ್ ದಿವಿಜವಿನುತ ಸಂದೀಪಿತಾನಂತ ನಾಮುನ್\nಧೀವಿಜ್ಞಾನಾಭಿರಾಮುಂ ದ್ರಿಭುವನ ವಿಲಸದ್ದೇವತಾ ಸಾರ್ವಭೌಮುನ್. ","ದಂಡಿಂ ಗೋದಂಡ ಕಾಂಡೋದ್ಧತ ರಥ ಹಯ ವೇದಂಡ ದಂಡಂಬುತೋಡನ್\nದಂಡೆತ್ತೆನ್ ಮೆಂಡುಗಾ ನದ್ದನುಜನಿಕರಮುಲ್ ದೈವವರ್ಗಂಬು ಮೀ?ದಂ\nಜಂಡಬ್ರಹ್ಮಾಂಡಭೇ ದೋಚ್ಛ್ರಯ ಜಯರವಮುಲ್ ಸರ್ವದಿಕ್ ಕ್ಷೋಭಗಾ ನು\nದ್ದಂಡಪ್ರಖ್ಯಾತಲೀಲಂ ದಲಪಡಿರಿ ಸುರಲ್ ದರ್ಪುಲೈ ವಾರಿತೋಡನ್.","ನಾ ಸಾಮರ್ಥ್ಯಂ ಬಸಾಮಾನ್ಯಮು ತ್ರಿಜಗಮುಲನ್ ಗಾಂಚೆ ನೆಂತೇ ಪ್ರಶಸ್ತಿನ್\nನಾ ಸಾಟೆವ್ವಾರು ಹಾ ಹಾ ನರುಲುನು ಗಪು ಲೀನಾಡು ನನ್ ಗಾಂಚುಡಂಚುನ್\nಜೇಸೆನ್ ನಾದಂಬು ದಿಕ್ಕುಲ್ ಚೆದರೆಡು ನಟುಲನ್ ಜೆಟ್ಟಿ ಯಿಂದ್ರಾರಿ ಬಲ್ಮಿನ್\nವೇಸೆನ್ ಬ್ರಹ್ಮಾಸ್ತ್ರಮಂತನ್ ವಿವಿಧ ಕಪುಲಪೈ ಭೀಕರಂಬೈನ ರೀತಿನ್ ","ಶ್ರೀವಾಣೀ! ನಿನ್ನು ಪೂಜಿಂಚಿ ಮನೆದನು ಸದಾ ಸೇವ ನೇ ಜೇತುನಮ್ಮಾ!\nಭಾವಮ್ಮಂದುಂಚಿ ಯರ್ಚಿಂಪ ದಲಚೆದ ರಮಾ ಪಾರ್ವತೀ ತೋಡ, ರಮ್ಮಾ!\nದೇವೀ! ನೀ ನಾಮಮಂದೇ ದೃಢಮಯಿನ ಗತಿನ್ ತೀವ್ರ ವಿಶ್ವಾಸಮುಂತುನ್.\nನಾ ವಿಶ್ವಾಸಮ್ಮು ಲೋನುನ್ನ ಪದಮುಲವಿ ವೀಣಾಧರೀ ನೀವೆ ನಮ್ಮಾ! ","ವಾಣೀ! ಬ್ರಹ್ಮಾಣಿ! ವಿದ್ಯಾ! ವನಜಭವ ಮುಖಾಬ್ಜಾತ ದಿವ್ಯಾಸನಸ್ಥಾ!\nವೀಣಾಪಾಣೀ! ಸುವೇಣೀ! ವಿಮಲ ಗುಣಗಣಾ! ವೇದಮಾತಾ! ಶುಭಾಂಗೀ!\nಏಣೀನೇತ್ರಾ! ಪವಿತ್ರಾ! ಹಿಮಕರವದನಾ! ಈಪ್ಸಿತಾರ್ಥಪ್ರದಾತ್ರೀ!\nಕ್ಷೋಣಿನ್ ನೇ ವ್ರಾಲಿ ನೀ ಯಂಘ್ರುಲ ಕಿವೆ ನತುಲನ್ ಗೂರ್ತು ನೋ ಕೀರಪಾಣೀ!","ತೆಲ್ಲಂಬೈ ಶೈಲವಿಶ್ರಾಂತಿನಿ ಮುನಿಯತಿನಿಂ ದೇಜರಿಲ್ಲುನ್‌ ದೃಢಂಬೈ\nಚೆಲ್ಲೆಂ ಬೆಲ್ಲೈ ಮಕಾರಾಂಚಿತ ರಭನಯಯಲ್‌ ಚೆಂದ ಮೀ?ದನ್‌ ಯಕಾರಂ\nಬುಲ್ಲಂ ಬಾರನ್‌ ಬುಧಾರಾಧ್ಯು ನುರಗಶಯನುನ್‌ ಯೋಗಿವಂದ್ಯುಂ ಗಡುನ್‌ ರಂ\nಜಿಲ್ಲಂ ಜೇಯಂ ಗವೀಂದ್ರುಲ್‌ ಜಿತದನುಜಗುರಂ ಜೆಪ್ಪುದುರ್‌ ಸ್ರಗ್ಧರಾಖ್ಯನ್‌."],
sragviNi:["ದೇವಕೀನಂದನುನ್‌ ದೇವಚೂಡಾಮಣಿನ್‌\nಭೂವಧೂವಲ್ಲಭುಂ ಬುಂಡರೀಕೋದರುನ್‌\nಭಾವನಾತೀತುನಿಂ ಬಲ್ಕ?ಗಾ ಸ್ರಗ್ವಿಣೀ\nಭಾವ ಮಾದ್ಯಂತರೇಫಂಬಗುನ್‌ ಷಡ್ಯತಿನ್‌.","ಅಂಡಜಾ ಧೀಶವಾ ಹಾ ಜಗದ್ಧೇಹ ದೋ\nರ್ದಂಡ ಚಂಡಾರಿನಿರ್ಧಾರಿತಾರೀ ನತಾ\nಕ್ಷಂಡಲಾ ಗಂಡರಿಂಖನ್ಮಣೀ ಕುಂಡಲಾ\nಪುಂಡರೀಕೇಕ್ಷಣಾ ಪ್ರೋವುನನ್ ಸುಕ್ಷಣಾ"],
svaagatavRttamu:["ರಾಜರಾಜಗುಣರಾಜಿತ ರಾಜ\nತ್ತೇಜ ರಾಜಕುಲದೀಪವಿಶಿಷ್ಟಾಂ\nಭೋಜಮಿತ್ರ ನೃಪಪೂಜಿತಪಾದಾಂ\nಭೋಜ ಭೂವಿನುತಪುಣ್ಯವರೇಣ್ಯಾ","ನಾರದಾದಿಮುನಿನಾಯಕ ವಂದ್ಯುನ್‌\nಶೌರಿ? ಜೇರು? ಡನ ಸ್ವಾಗತ ಮೊಪ್ಪುನ್‌\nಸಾರಮೈನಯತಿ ಷಣ್ಮಿತಿ ನೊಂದನ್‌\nಭೂರಿರೇಫನಭಮುಲ್‌ ಗಗಯುಕ್ತಿನ್‌."],
kshama:["ಇತ?ಡು ಶತಸಹಸ್ರೇಡಿತಾನೀಕಿನೀ\nಪತಿ ಸುರಪತಿಸಾಪತ್ಯಭೋಗುಂಡುನುನ್\nಶತವಲಿ ಯನ?ಗಾ ಶೌರ್ಯನಾರಾಯಣುಂ\nಡಿತ?ಡು ಹರಿಚಮೂಹೀರ ಮಾರ್ಯೋತ್ತಮಾ","ಕ್ಷಮ ನಿಹಪರಮುಲ್‌- ಸಾಧ್ಯಮೌ ನಾತ್ಮತೇ\n  ಜಮತಿ ವಿತತಮೈ- ಜನ್ಮ ಲಕ್ಷ್ಯಾಪ್ತಿಕೈ\nಸಮಯಮು? ಗನ?ಗನ್‌- ಸ್ವಸ್ವಜೀವಕ್ಷಪಾ\n  ಸಮುದಯ ಮೆಡಲುನ್‌, ಸ್ವರ್ಗ ಮೊಪ್ಪನ್‌ ಮದಿನ್‌"],
khacharaplutamu:["ವರದ ಕೇಶವ ದೈತ್ಯವಿದಾರೀ ವಾರಿಜನಾಭ ಜಗನ್ನಿಧೀ\nಕರುಣ? ಜೂಡುಮು ಮಮ್ಮು? ಬ್ರಸನ್ನಾಕಾರ ಹರೀಯನಿ ಪಲ್ಕಿನನ್‌\nವರುಸತೋ ಸಭಭಂಬು ಮಸಾವಲ್‌ ವಾಲ?ಗ ರುದ್ರವಿರಾಮ ಮೈ\nಯರುದುಗಾ ಮುನಿಪುಂಗವವರ್ಣ್ಯಂಬೈ ಖಚರಪ್ಲುತ ಮೊಪ್ಪಗನ್‌.","ಕನಕಸಾರಸಸಾರಸರೇಖಾಗ್ರಸ್ಥಿತಪಕ್ಷಿಚಯಂಬಹೋ\nಯನಿನಯಟ್ಟುಲಕಟ್ಟಿನರೆಕ್ಕಲ್‌ವ್ಯಾಯತಚಂಚುಲುನಾಡ?ಗನ್\nಕನಿನಮುನ್ನುಲಕನ್ನುಲ?ಬಂಪಾಕಾಂಡಸರೋಜಲಮೂಗ?ಗಾ\nದನುಜನಾಯಕು?ಡಾಯಕ?ಗೊಂಚುನ್‌ದಾಟಿಚನೆನ್ ಗಗನಾಧ್ವಮುನ್ "],
geetaalaMbanamu:["ನಾಳೀಕಭವಾಮರನಾಥು ಲೊಗಿನ್‌\nಶ್ರೀಲೋಲುನಿ ಗೀರ್ತನ ಸೇಯ ನೊಗಿನ್‌\nಬೋಲಂಗ? ದಜಾವಲ? ಬೊಂದಿನ ಗೀ\nತಾಲಂಬನ ಮೈ ಚನು ನದ್ರಿಯತಿನ್‌.","ಧಾರಾಧರವಾಹನಧೈರ್ಯಕೃತೀ\nಕ್ಷೀರಾಭ್ಧಿಶಿಬೀಶ್ವರಶೀತಲರು\nಗ್ಧಾರಾಧರಕಲ್ಪಕಕಾಮಗವೀ\nತಾರಾಧಿಪಸನ್ನಿಭದಾನನಿಧೀ"],
chaMchareekaavaLi:["ಜ್ವಾಲಾಲೀಢಂಬೌಚುನ್ ಬಾನಶಾಲಲ್ಸೆಲಂಗನ್\nಹೇಲಂಬಾನೀಯಂಬೈ ಯೇಪುಮೀ ಱೆನ್ಮಹಾಗ್ನುಲ್\nಕ್ರಾಲುಂಗತ್ತುಲ್ ನಿಪ್ಪುಲ್ ಗೌಣಮೌವೃತ್ತಿಮುನ್ನೈ\nಯೇಲೆನ್ ವಾಚ್ಯತ್ವಂಬೇ ಯಿಪ್ಪುಡೀ ಕಲ್ಲುಬಾನನ್","ಕಂಬುಗ್ರೀವಾ ಸತ್ಯಾಕಾಮಿನೀಪ್ರಾಣನಾಥಾ\nಬಿಂಬೋಷ್ಠಾಮಾರಾಗಲ್ಪೇರ್ಚಿ ಭೂಭೃದ್ಯತುಲ್ಗಾಂ\nಚಂ ಬಾದಂಬೈ ಧಾತ್ರಿಂ ಜಂಚರೀಕಾವಳೀನಾ\nಮಂಬೊಂದುಂ ಗಾವ್ಯಶ್ರೀಮಾನಿನೀಭೂಷಣಂಬೈ."],
chaMdrakaLa:["ಮುನ್ನುವಿನ್ನದಿ ದೇವರಹಸ್ಯಂಬುನ್ ದಮಕುನ್ ವಿನಿಪಿಂಪಗಾ\nನೆನ್ನೊಸಾರ್ಲು ತಲಂಚಿತಿಗಾನೀ ಯೇನು ವಚಿಂಪನೆಲೇದು ನೇ\nಡೆನ್ನಜೆಪ್ಪಕಯುನ್ನಫಲಂಬೊಕ್ಕಂತಯುಲೇದುಧರಾಧಿಪಾ\nಮುನ್ನುದೇವಯುಗಂಬುನ ವಿಂಟಿನ್ ಭೂಪಭವತ್ಸುತ ಹೇತುವುನ್","ವೀನುಲಾರ? ಬ್ರಸಿದ್ಧಪದಂಬುಲ್‌ ವೇಡುಕ? ಗೂರ್ಚಿ ದಿಶಾಯತಿನ್‌\nಗಾನ ವಚ್ಚಿ ರಪಾತಜಜಂಬುಲ್‌ ಗಲ್ಗ ದಿಟಂಬುಗ? ಜೆಪ್ಪಗನ್‌\nಜಾನಕೀವದನಾಂಬುಜ ಶಶ್ವತ್ಸೌರಭಲೋಲ ಮಧುವ್ರತಾ\nದಾನವಾಂತಕ ಚಂದ್ರಕಳಾ ವೃತ್ತಂಬು ಸಭಂ ಗಡು ನೊಪ್ಪಗುನ್‌."],
chaMdraSree:["ಜಗನ್ನಾಥುನ್‌ ಲಕ್ಷ್ಮೀಹೃದಯಜಲಜಪ್ರೋದ್ಯದರ್ಕುನ್‌\nಖಗಾಧೀಶಾರೂಢುನ್‌ ಸುಕವಿಜನಕಲ್ಪದ್ರುಮಂಬುನ್‌\nದಗನ್ವರ್ಣಿಂಪಂಗಾ ಯಮನಸಯುತಂಬೈ ರಗಂಬುಲ್‌\nಮೊಗಿಂ ಜಂದ್ರಶ್ರೀಕಿನ್ನಿಲುಚು ಯತಿ ಮುಕ್ಕಂಟಿನೊಂದುನ್‌."],
chitrapadamu:["ವಾರಕ ಭಾಗುರುಯುಗ್ಮಂ\nಬಾರ?ಗ? ಜಿತ್ರಪದಾಖ್ಯಂ\nಜೇರಿನ ವೇಡ್ಕ? ಗವೀಂದ್ರುಲ್‌\nಗೋರಿ ನುತಿಂತುರು ಶೌರಿನ್‌.","ಕೂಡಿಯು ಮುನ್ನುಗ?ದೋಚಿನ್\nವಾ?ಡಿಶರಂಬುನ ದೂಯುನ್\nಬೋಡಿ ನಿಯತುನಯಂದುನ\nಲೇಡಿಯಕಂಪಡಕುಂಡುನ್"],
jaladamu:["ನೀಪಲುಕೆಲ್ಲ ನಿಕ್ಕಮಯ ನಿಂದ್ಯಗುಣಾ\nಯೀಪುರುಷಾರ್ಧಹಾನಿಸುತುಲೀಲ್ಗುಂಟಕುಂ\nದಾಪಮು? ಬೊಂದಿ ತಾಲ್ಮಿ?ದಿಗ ದ್ರಾವಿ ಮಹಾ\nಕೋಪು?ಡನೈನ?ಬಾಟಿಲೆ?ದಗುಂಗಿನಿಯನ್","ಮ್ರೊಕ್ಕುಲ ಕೆಲ್ಲ ನೆಲ್ಲ ಯಗುಮೂರ್ತಿ ಗದಾ\nಯಕ್ಕಮಲಾಕ್ಷು? ಡಂಚು? ಜತುರಾಸ್ಯಯತಿನ್‌\nದಕ್ಕಕ ಪ್ರಸ್ತುತಿಂಪ ಜಲದಂ ಬಗು ನಿ\nಟ್ಲೊಕ್ಕಟಿಯೈ ಭರೇಫನಭ ಲೊಂದು ಗುರುನ್‌."],
jaladharamaala:["ಶ್ರೀತನ್ವೀಶುಂ ದಗಿಲಿತಿ? ಜಿತ್ತಂ ಬಾರನ್‌\nಮಾತಾ ಯಂಚುನ್‌ ಜಲಧರಮಾಲಾವೃತ್ತಂ\nಬೇತೇರಂಗಾ ಮಭನಮ ಲಿಂಪೊಂದಂಗಾ?\nಬ್ರೀತಿಂ ಬಲ್ಕನ್ವಿರತಿ ಕರಿನ್‌ ಬ್ರಾಪಿಂಚುನ್‌.","ಆಕಾಶಂಬಂದುನಗರುದಾಕ್ಷೋದಂಬೈ\nಯೇಕೋನಲ್ಪೋಯಿತಿಮಟ ನೇದಿಕ್ಕೇದೋ?\nಕಾಕುಂಡಂ ಗನ್ನುಲು ಜತುಕಾವರ್ಣಂಬೈ\nಯೇಕೋನಲ್ತೋಚವುಮದಿಕೇದೋಭೀತಿನ್"],
jalOddhatagati:["ಸರೋರುಹದಳಾಕ್ಷ ಶಾಶ್ವತಯಶಾ\nಪುರಾರಿನುತ ಯಂಚು ಭೂದರಯತಿನ್‌\nಸರಾಗ ಮಗುಚುನ್‌ ಜಸಲ್‌ ಜಸಲತೋ\nನುರುಪ್ರಭ ಯಗುನ್‌ ಜಲೋದ್ಧತಗತಿನ್‌.","ಪಯೋಧುಲಿವಿ ಯೇಡು ಪಾಲಿತಮಿನೋ\nದ್ರಯಾಗಪರಿರಕ್ಷಣಾರ್ಧಮು ಸದಾ\nವಯಶ್ಲಧಶರೀರುವಾಂಛನುಬಡಿನ್\nಪ್ರಯಾತಮುಲು ಮೌನಿರಾಜವಪತಿನ್"],
tanumadhyaavRttamu:["ಗೋಪಾಲುನಿ ದೇವೇ\nನಾಪಾಲಿಕಿ ನಾ?ಗಾ?\nಬೈ ಪೈ ತನುಮಧ್ಯನ್‌\nಬ್ರಾಪಿಂಚು? ದಯಂಬುಲ್‌.","ಗೌರೀತನುಮಧ್ಯನ್\nಸ್ವಾರಿಂಗೊನಿ ಸಿಂಹಂ\nಬಾರಾಧನಲಂದುನ್\nಕ್ರೂರಾಗ್ರಿಯಮಯ್ಯುನ್"],
taraLamu:["ಚಾರುಭಸನ ಭೂರಿಜನ ರಸಾಂದ್ರಗಣಮುಲನ್‌ ದಿಶಾ\nಸಾರ ವಿರತಿ ನಂದಮುಗ ನಿಜಂಬು ತರಲಿ ಚೆನ್ನಗುನ್‌.\nಚಾರುಭಸನ ಭೂರಿಜನ ರಸಾಂದ್ರಗಣಮುಲನ್‌ ದಿಶಾ\nಸಾರ ವಿರತಿ ನಂದಮುಗ ನಿಜಂಬು ತರಲಿ ಚೆನ್ನಗುನ್‌."],
turagavalgitavRttamu:["ನನನನಸಜಜಗಲು ತಿಥಿವಿರಮಣಂಬಗುನ್ ದುರಗಂಬುನನ್\nಗನಲುಚು ನಗರಮುಪಯಿ ವಿಡಿಸಿನ? ಗಾಂಚಿ ತಾ ನೊಕರುಂ ಡೆದು\nರ್ಕೊನಿ ದವುಲಕು? ಗೊನಿ ಚನಿ ಗಿರಿಗುಹ? ಗೂರ್ಕು ನಾಮುಚಿಕುಂದುಚೇ\nತನು ಯವನುನಿ? ಬೊರಿಗೊನಿ ತನಿ ವಸುಧನ್ಗಣಿಂತುರು ಭೂಸುರುಲ್.","ತರುಣರವಿಕರವಿಕಚಸರಸಿಜ ದರ್ಪಮೋಚನ ಲೋಚನಾ\nಶರಧಿನಿರಪಧಿನಿಖಿಲಜಲಹೃತಿ ಸಾಂದ್ರಕಂಧರಬಂಧುರಾ\nಗಿರಿಮಧನಮಧುವಿಧುರಕರ ಶ್ರಿತಕೀರವಾಹನಮೋಹನಾ\nಸ್ಫುರದ ಚಿರ ರುಚಿ ರುಚಿರಚಿರರುಚಿ ಪೋಷಕಾಂಬರಡಂಬರಾ "],
dRtavilaMbitamu:["ಶ್ರುತಿ ಮತಾಂಗ ನಿರೂಢಮಹಾಯತಿನ್‌\nಯತಿವರಪ್ರಮುಖಾರ್ಯಜನಂ ಬೊಗಿನ್‌\nದ್ರುತವಿಲಂಬಿತ ತೋಷಿತರೀತುಲನ್‌\nಕ್ಷಿತಿಧರುನ್‌ ನುತಿಸೇಯು ನಭಾರಲನ್‌.","ತ್ರಿಭುವನಾಂಕುಶದೀಪ್ತನಿಧೀಸಮ\nಸ್ತ ಭುವನಾಶ್ರಯಧರ್ಮಧುರಂಧರಾ\nಶುಭಯಶಃ ಪರಿಶೋಭಿತಪೂರ್ವದಿ\nಕ್ಪೃಭುವಿಲಾಸಕೃಪಾರಸಭಂಧುರಾ"],
nadeepraghOshamu:["ನಾಗತಲ್ಪಾ ಮೊದ ಲ್ನಾಲ್ಗು ರೇಫಂಬುಲುನ್‌\nಜಗನ್ನಿವಾಸಾ ಜತಜಂಬು ರೇಫಯುನ್‌\nದಗಂಗ ನಮ್ಮೂ?ಡು ಪದಂಬುಲಂದು ಜಾ\nತಿಗಾ? ಬ್ರವರ್ತಿಂಚು ನದೀ ಪ್ರಘೋಷಕುನ್‌."],
narkuTamu:["ಕೊಲಿಚೆದ ನಂದಗೋಪಸುತು ಕೋಮಲಪಾದಮುಲನ್‌\nದುಲಿಚೆದ? ಬೂರ್ವಸಂಚಿತಪು ದೋಷಮುಲನ್‌ ಸುಖಿನೈ\nನಿಲಿಚೆದ ನನ್ನ ನರ್ಕುಟಮು ನಿರ್ಮಲವೃತ್ತಮಗುನ್‌\nಸಲಲಿತಮೈ ನಜಂಬುಲ ಭಜಾವಲ ದಿಗ್ವಿರತಿನ್‌.","ಪ್ರಸೃತಿವಿಲೋಚನಾಕುಸುಮಬಾಣದಿಶಾಲಲನಾ\nಘಸೃಣಪಟೀರಲೇಪಕೃತಿಕೋವಿದಬಾಹುತಟೀ\nವಿಸೃಮರಕೀರ್ತಿಜಾಲರಣವೀಕ್ಷಿತವೈರಿನೃಪ\nತ್ಯಸೃಗತಿಪಂಕಿಲಾಸಿಮುಖಯೈಂದವವಂಶಮಣೀ!!"],
navanaMdini:["ನವನಂದಿನಿನ್ ಸಜಗಣಸ್ನಗಗಲಾಯೆನ್\nನವವಿಶ್ರಮಂಬುನು ದನರ್ಚಿ ಚೆಲುವೊಪ್ಪನ್\nನವನೀತಚೋರಕು ಜನಾರ್ದನು ನುಪೇಂದ್ರುನ್\nಭವದೂರು ನೆಂತುರು ಸಭಾಸದುಲು ಭಕ್ತಿನ್.","ಕನುಮೂಸಿಕನ್ದೆ ಱಚುಲೋ?ಗಡುವಶಿಷ್ಠುಂ\nಡನೆ ಭೀತಿಲೇದು ಪದ?ಡಾಯನುಚು ಗಾಧೇ\nಯುನಿ ನೀವುಲೇವುಕುಟಿಲಾಯುದರುಪಾಟಾ\nಮುನಿಪಲ್ಲೆಮಂಟನಿಡೆದೋಮುಲುಚ ಯಂಚುನ್"],
naaree:["ನಾರೀವೃ\nತ್ತಾರಂಭಂ\nಬಾರುನ್ಮಾ\nಕಾರಂ ಬೈ","ನಾರೀಲೋ\nಕಾರಾಧ್ಯಾ\nಸಾರಸ್ಯಾ\nಧಾರಾಧ್ಯಾ"],
naareeplutavRttamu:["ಕ್ಷೀರೋದನ್ವನ್ಮಧ್ಯಗೇಹಾ ಮತಾಗಾ\nಸಾರಂಬು ನುದ್ಯತ್ತತಜಲ್ಗಗಂಬುನ್‌\nಬೂರಿಂಪಂಗಾ? ಬಾದಮುಲ್‌ ರೆಂಟ ರೆಂಟನ್‌\nನಾರೀಪ್ಲುತಂ ಬಯ್ಯೆ ನನಂತಮೂರ್ತೀ!","ದಾನೋದಾರಶ್ರೀಮತಾ ಗಾನಿಯುಕ್ತಿಂ\nಗಾನಂಗ?ದಾಜಸ್ಥ ಗಗಪ್ರಸಕ್ತಿನ್\nಮಾನೈ' ಚಾಳುಕ್ಯಕ್ಷಮಾಪಾಲರಮ್ಯ\nಸ್ಥಾನಂಬುನಾರೀಪ್ಲುತ ಸಂಜ್ಞಮಯ್ಯೆನ್"],
padmakamu:["ನಕಲಿತಂಬು ನಭಜಾಜಗಣಂಬುಲು ಗಾಂತಮೈ\nಸಕಲದಿಗ್ವಿರಮಣಂಬುಲು ಸನ್ನುತಮೈ ಚನನ್‌\nಶಕಟದೈತ್ಯಮದಭಂಜನು ಸನ್ನುತಿಸೇಯ?ಗಾ?\nಬ್ರಕಟಮೈ ಕೃತುಲ? ಬದ್ಮಮು ಪದ್ಮಕು? ಬಟ್ಟಗುನ್‌."],
padmanaabhamu:["ಮುನ್ನೆವ್ವರುನ್‌ ಲೇನಿ ಕಾಲಂಬುನನ್‌ ಸೃಷ್ಟಿ ಮೂಲಂಬುಗಾ? ಬದ್ಮಗರ್ಭುಸೃಜಿಂಚೆನ್‌\nಮುನ್ನೀಟಿಲೋ? ಬಾ?ಪತಲ್ಪಂಬು ಪೈ ವೆನ್ನು ಮೋಪೆಂ ದ್ರಿಲೋಕಂಬುಲುಂ ಗುಕ್ಷಿ ನುಂಡನ್‌\nಎನ್ನಂಗ ನೀತಂ ಡನಾದ್ಯಂತು? ಡಂಚುನ್‌ ನಿರೀಕ್ಷಿಂತು ರೆವ್ವಾರಿ ವಾ?ಡೆಲ್ಲನಾ?ಡುನ್‌\nನನ್ನೇಲು ನಾ ನರ್ಕವಿಶ್ರಾಂತಮೈ ಪದ್ಮನಾಭಂ ಬಗುನ್‌ ಸಪ್ತತಂಬುಲ್ಗಗಂಬುನ್‌.","ಶ್ರೀರಂಗನಾಧಪ್ರಧನ್ ಬದ್ಮನಾಭುಂಡು ಸೃಷ್ಟಿಸ್ಥಿ  ತಿಂದಾನೆಯೈ,ಸ್ರಷ್ಟಕೊಲ್ವನ್\nಕ್ಷೀರಾಬ್ಧಿ ಕನ್ಯಾಪ್ರಸೇವಾಸುಖಾನಂದಸಿಧ್ಧಿಂಗನನ್   ಶೇಷತಲ್ಪಂಬುಪೈ\nನಾರೂಢಯೋಗಪ್ರಶಾಂತಿನ್ ಸುವಿಶ್ರಾಂತಿನಾತ್ಮಾಂತಸಂಸೃಷ್ಟಿರಕ್ಷಿಂಚುಚುನ್ ಭ\nಕ್ತಾರಾಧ್ಯದೈವಂಬುಗಾವೈಭವೋಪೇತು?ಡೈ ವೆಲ್ಗುಧಾತ್ರಿನ್ ಸ್ವಲೀಲಾವಿಭೂತಿನ್   "],
paalaaSadaLamu:["ಪದುನಯಿದು ಲಘುವುಲುನು ಬರ?ಗ ಗಗ ಮೊಂದನ್‌\nಬದಿಯಗುನೆಡ ವಿರತುಲು ಬಲಸಿ ಪೊಡಸೂಪನ್‌\nಬೊದಲಿ ಹರಿನುತುಲ? ಗಡು ದೊಲುಪಗುಚು? ಬಾಲಾ\nಶದಳ ಮನ?ಬರ?ಗು? ಗವಿಜನುಲು ಗೊನಿಯಾಡನ್‌."],
pRthiveevRttamu:["ಅಮೂಲ್ಯಮಣಿಭೂಷಣಂಬುಲು ಗಜಾಶ್ವಬೃಂದಂಬುಲುನ್\nಸಮೃದ್ಧಧನಧಾನ್ಯರಾಸುಲು ಪ್ರಶಸ್ತಗೋವರ್ಗಮುಲ್\nಗ್ರಮಂಬುನನು ಭೂಸುರೇಶುಲ ಕಗಣ್ಯಪುಣ್ಯಾರ್ಥಿಯೈ\nಯಮರ್ತ್ಯನಿಭು?ಡಿಚ್ಚೆ? ಬಾಂಡುವಿಭು? ಡತ್ಯುದಾರಸ್ಥಿತಿನ್","ಜಸಂಬುಲು ಜಸಂಬುಲುನ್‌ ಯಲಗ ಸಂಗತಿನ್‌ ಸಾಂಗಮೈ\nಪೊಸಂಗ ನಮೃತಾಂಶುಭೃದ್ಯತುಲು ಪೊಂದ? ಬಾದಂಬುಲೈ\nಬಿಸಪ್ರಸವಲೋಚನಾ! ವಿನುಮು ಪೃಥ್ವಿನಾ? ಬೃಥ್ವಿಲೋ\nನಸಂಶಯಮಗುನ್‌ ಭವದ್ವಿನುತುಲಂದು ನಿಂಪೊಂದಿನನ್‌."],
praguNa:["ಸಗಣಾಸಕ್ತಿಂ\nಗಗಸಂಯುಕ್ತಿನ್\nಬ್ರಗುಣಾಖ್ಯಂಬೈ\nತಗು ನಿಂಪಾರನ್"],
pramaaNi:["ಸರೋಜನಾಭು? ಡಚ್ಯುತುಂ\nಡರಾತಿಭಂಜನುಂ ಡನನ್‌\nಜರೇಫಲನ್‌ ಗಲಂಬುಲನ್‌\nಧರನ್ ಬ್ರಮಾಣಿ ಯೊಪ್ಪಗುನ್‌.","ಸ್ವಮಾಂಸಭೋಕ್ತಲೈಚನನ್\nಸಮುಲ್‌ಸಹಸ್ರಮುಲ್‌ಚನುಂ\nಡಮಂದದರ್ಪುಲೈವೃಧಾ\nಭ್ರಮನ್‌ಮನುಷ್ಯಪಾಳೀಲೋ"],
pramitaaksharamu:["ಕಮನೀಯತೇಜುನಿ ನಗಣ್ಯಯಶುನ್‌\nಗಮಲಾಧಿಪುಂ ಬಲುಕ?ಗಾ ಸಜಸಲ್‌\nಕ್ರಮಮೊಪ್ಪು? ಗೂಡ?ಗ ಸಕಾರಮುತೋ?\nಬ್ರಮಿತಾಕ್ಷರಂ ಬಹಿವಿರಾಮಮಗುನ್‌.","ಪ್ರಮಿತಾಕ್ಷರಪ್ರಣವರಾಜಿತಮೌ\nಪ್ರಮಧಾಧಿಪಪ್ರಧಿತತೌಧನನಾ\nಮಮುಲಾತ್ಮನೇಮಶುಭಮಂತ್ರಮುಲೈ\nವಿಮಲಾತ್ಮಬುಧ್ಧಿಸಮವೀತಮುಲನ್"],
praharaNakalita:["ವನಮುಲು ನದುಲುನ್ ವರುಸಗ? ಗನುಚುನ್\nಜನಪತಿ ಚನೆ? ದಿನ್ನನಿ ಪಯನಮುಲನ್\nಮುನಿಕುಲತಿಲಕುನ್ ಮುನು ಚನಿ ಕನೆ? ಬಾ\nವನಶುಚಿರುಚಿ ನವ್ವರಋಷಿತನಯುನ್","ವನರುಹಸಖು?ಡನ್‌ ವನರುಹರಿಪು?ಡನ್‌\nಗನು?ಗವ ಯಗು ನಾಕರಿ ವರದುನಕುನ್‌\nನನಭನಲಗಮುನ್ನಗಯತಿ? ಬಲುಕನ್‌\nಬನುಪಡು? ಗೃತುಲಂ ಬ್ರಹರಣಕಲಿತನ್‌.","ಇದಿ ಯಿಟುಲಗುಟಟ್ಲೆಱಿ?ಗಿ ಪಲಿಕೆ ನಾ\nವಿದುರು?ಡು ಸಭ?ಗೋವಿದುಲು ವೊಗಡ?ಗಾ\nನದಿವಿನಿಯುನು ನೇನಡಪನದುರಿತಂ\nಬೊದವೆ?ಗಲಕಸೇಟೊಲಯಕುಡುಗುನೇ"],
praharshiNi:["ಮುಕ್ತಿಶ್ರೀಕರು ಭವಮೋಚನುನ್ಮುರಾರಿನ್‌\nಭಕ್ತಿಂ ಬ್ರೋಡಜನುಲು ಪ್ರಸ್ತುತಿಂಪ ನೊಪ್ಪುನ್‌\nವ್ಯಕ್ತಗ್ರಾವಯತಿ? ಬ್ರಹರ್ಷಿಣಿ ಸಮಾಖ್ಯನ್‌\nಯುಕ್ತಂಬೈ ಮನಜರಗೋಜ್ಜ್ವಲದ್ಗಣಾಪ್ತಿನ್‌."],
priyaMvada:["ತ್ರಿಭುವನಾಭಿನುತು ದೇವದೇವುನಿನ್‌\nಬ್ರಭು ಮುಕುಂದು ನಿಟು ಪ್ರಸ್ತುತಿಂಪ?ಗಾ\nನಭಜರಲ್ಗದಿಸಿನಂ ಬ್ರಿಯಂವದಾ\nವಿಭವ ಮೊಪ್ಪು ಗಿರಿ ವಿಶ್ರಮಂಬುಲನ್‌.","ದಿವಿಷದೀಶ್ವರು?ಡು ತೇಪಮೌನುಲುನ್\nಗವುರುಗಪ್ಪುಚುಪೊಗಲ್ ವೆಲಾರ್ಪ?ಗಾ\nನವುದಪಸ್ಸುಲ ಮಹಾಗ್ನಿರೇಗ?ಗಾ\nನವುರಯಚ್ಚರಲನಂಪುನಂಟ?ಗಾ"],
priyakaaMta:["ದ್ವಿಪದಮುಲಂ ಗಾನ ತಿರಿಗಿತಿನ್ ಗಾದೆ ಹರೀ ಯೀ\nವಿಪಿನಮು ನಂದೆಲ್ಲ ವೆದಕಿ ಪಿಲ್ಚೇನು ಸದಾ ನಾ\nಜಪ ಮಿಟ ನೀ ಪೇರೆ ಚಲಮು ಚಾಲಿಂಚು ಹಿತಾನನ್\nಕೃಪ ಸುಧ ಚಲ್ಲೇವ ಹೃದಿಯು ತೃಳ್ಳೇನು ಮುದಾನನ್","ಅವನಿಯು ಶ್ರೀಯುನ್ಸತು ಲಜು?ಡಾತ್ಮೋದ್ಭವು? ಡಾಪ್ತುಲ್‌\nದಿವಿಜುಲು ದಾಮೋದರುನಕು ದೇವಳ್ಳಿ? ಕನೇರೀ\nಸವತು ಗ ನಾ?ಗಾ ನಯನಯಸಮ್ಯಕ್ಸಗಯುಕ್ತಿನ್‌\nಗವಿನುತಮೈ ದಿಗ್ಯತಿ? ಬ್ರಿಯಕಾಂತಾಕೃತಿ ಯೊಪ್ಪುನ್‌."],
phalasadanamu:["ಅನಲ ಮಿಟುಲ ಪುರಮು ನಲಮಿ ಯಱುಮಂಗಾ\nದನುಜ ಸಮಿತಿಚೆಡಿ ಸದನಮು  ಲಱವಂಗಾ\nದನುಜಪತಿಕಿ ನೆಡದ ತಲರಿ ಚೆದರಂಗಾ\nಮನಸು ವಿವಶಮಗುಚು ಮಱಲ ಗರುವಂಬೈ","ನನಲುನು ನನಲುನು ದನರ?ಗ ಸಗಯುಕ್ತಿನ್‌\nವನರುಹ ಭವಯತು ಲವಹಿತ ಮತಿತೋಡನ್‌\nನಿನುಪುಚು ಸುಕವುಲು ಮಣಿವಿಲಸದುರಸ್ಕುನ್‌\nಗೊನಕೊನಿ ಪೊಗಡ?ಗ ನಗು ಫಲಸದನಂಬುಲ್‌."],
baMdhuramu:["ಋಭುವುಲು ದಿತಿತನಯುಲು ಸಮಬಲುಲೈ ಯೆಂತಯು ಮತ್ಸರಮುಲ್ಬೆರಯನ್‌\nರಭಸ ಮಲರ? ಗಲಶನಿಧಿ? ದಱವ?ಗಂ ಗ್ರಕ್ಕುನ? ಗವ್ವಪು?ಗೊಂಡಕು ನೀ\nಪ್ರಭು ವನುವುಗ? ಗುದುರುಗ ನಿಲಿಚೆ ನನಂ ಬಂಚದಶಾಕ್ಷರವಿಶ್ರಮಮೈ\nಪ್ರಭ ಮಿಗುಲ?ಗ ನನನನಸಭಭಭಗಲ್‌ ಬಂಧುರ ವೃತ್ತಮು ಚೆಪ್ಪ?ದಗುನ್‌."],
bhadrakamu:["ಆದಿ ಭ?ಜೇಸಿಯವ್ವಲರನದ್ವಯಂಬು ನೊಗಿ ಮೂ?ಡು ತಾನಕಮುಲನ್‌\nಬಾದುಕೊನಂಗ ನೊಕ್ಕಗುರುವೊಂದ? ಬೈ ವಿರತಿ ರುದ್ರಸಂಖ್ಯ ನಿಡಿನನ್‌\nಗಾದನರಾದು ಭದ್ರಕಮುನಾ?ಗ ಗಾಢಮಗು ವೃತ್ತ ಮೊಪ್ಪು? ಗೃತುಲನ್\nಶ್ರೀ ದನರಾರ ನಾಶ್ರಿತವಿತಾನಚಿಂಚಿತಫಲಪ್ರದಾನ ನೃಹರೀ!"],
bhadrakamu1:["ಕಾದ್ರವೇಯಶಯನಾ ಸಮು\nನ್ನಿದ್ರದೈತ್ಯಮದಭಂಜನಾ\nರುದ್ರಮಿತ್ರ ರನರೇಫಮುಲ್\nಭದ್ರಕಂಬುನಕು ಭಾಸಿಲುನ್."],
bhadriNeevRttamu:["ಭಾದಿರನತ್ರಯಂಬು ಗುರು ಯುಕ್ತಮೈ ಗಿರಿಶವಿಶ್ರಮಪ್ರಕಟಮೈ\nಮೇದಿನಿ ನೊಪ್ಪು ಭದ್ರಿಣಿಕಿ ನಂದು ಮೇರುನಗಧೀರ ವಿಶ್ವನೃಪತೀ\nಭಾದಿರನತ್ರಯಂಬು ಗುರು ಯುಕ್ತಮೈ ಗಿರಿಶವಿಶ್ರಮಪ್ರಕಟಮೈ\nಮೇದಿನಿ ನೊಪ್ಪು ಭದ್ರಿಣಿಕಿ ನಂದು ಮೇರುನಗಧೀರ ವಿಶ್ವನೃಪತೀ"],
bhaaskaravilasitamu:["ಗೋಪನಿಕರಮುಲ ನೇಲಿನವಾನಿನ್‌ ಗೋವೃಷದನುಜುಲ ನಡ?ಚಿನವಾನಿನ್‌\nಗೋಪಿಕಲನು ಬ್ರಮಯಿಂಚಿನವಾನಿನ್‌ ಗುಬ್ಜಕು ವಿಲಸನ ಮೊಸ?ಗಿನವಾನಿನ್‌\nಗೋಪಕುಲಮು ವೆಲಯಿಂಚಿನವಾನಿನ್‌ ಗೊಲ್ಚೆದ ಮನಿ ಬುಧು ಲಿನಯತಿ? ಬಲ್ಕನ್‌\nಬ್ರಾಪುಗ ಭನಜಯಭಾಶ್ರಿತ ನಾಸಲ್‌ ಭಾಸ್ಕರವಿಲಸಿತಮಗು ಗುರುಯುಕ್ತಿನ್‌."],
bhujaMgavijRMbhitamu:["ಸ್ವಾರಾಜಾರಿವ್ರಾತಾರಾತೀಶಶಿತಪನಸಮನಯನ ಸರ್ವದಾ ಮುನಿವಂದಿತಾ\nಗೌರೀಶಾದ್ಯಾಮರ್ತ್ಯಸ್ತುತ್ಯಾ ಕಮಲಭವಜನಕ ಮಧು ಕೈಟಭಾಸುರಮರ್ದನಾ\nಶ್ರೀರಾಮಾಹೃತ್ಸ್ವಾಮೀ ಯಂಚುನ್‌ ಜೆಲ?ಗಿ ಮಮತನನನಲ? ಜೆಂದ ರೇಫಸಲುನ್‌ ಲಗನ್‌\nಘೋರಾಘೌಷೂಭಿದ್ವೇಷಿಂ ಬೇರ್ಕೊನ?ಗ ವಸುದಶಯತಿಯಗುನ್‌ ಭುಜಂಗವಿಜೃಂಭಿತನ್‌.","ಭುಜಂಗೇಶಪರ್ಯಂಕ ಪೂರ್ಣಾನುರಾಗುನ್‌\nಭುಜಂಗಪ್ರಭೂತಾಖ್ಯ? ಬೂರಿಂಚುಚೋಟನ್‌\nನಿಜಂಬೈ ಪ್ರಭೂತಾವನೀಭೃದ್ವಿರಾಮಂ\nಬಜಸ್ರಂಬುಗಾ? ಗೂರ್ಪ ಯಾದ್ವಂದ್ವ ಮೊಪ್ಪನ್‌."],
bhujagaSiSirutamu:["ನಿಜಮುನ ನನಯಲೊಪ್ಪನ್\nಭುಜಗಶಿಶುರುತಮಯ್ಯೆನ್\nಸುಜನವಿನುತಚರಿತ್ರಾ\nವೃಜಿನತೃಣಘನದಾತ್ರಾ."],
bhootilakamu:["ವಾ?ಡೆ ವಧೂಮಣಿ ಚೂಡವೇ ದ್ರಿದಿವದ್ರುಮಂಬು ಧರಿತ್ರಿಕಿನ್‌\nಬೋ?ಡಿಮಿ ದೆಚ್ಚಿನ ಶೂರು? ಡೀತನಿ? ಬೋಲಲೇ ರಿಲ ನೆವ್ವರುನ್‌\nವೀ? ಡಧಿಕುಂ ಡನಿ ಭೀಮವಿಶ್ರಮವೃತ್ತಿ ಭೂತಿಲಕಂ ಬಗುನ್‌\nವೇ?ಡಿ ನುತಿಂತುರು ಭಾರಸಂಬುಲ ವೆಂಟ ಜಾಗಮು ಲೊಂದ?ಗಾನ್‌.","ವೆನ್ನೆಲ ಲೋ ವಿಹರಿಮ್ಚ ವೆಳ್ಳಗ ವೇಡ್ಕಗಾ ವಿರಿತೋಟಕುನ್\nಕನ್ನುಲ ಮುಮ್ದರ ತೋಚೆ ಕಾಂತುಲ ಕಲ್ಕಿಯೈ ಕನುಪಮ್ಡುವೈ\nಅನ್ನುಲ ಮಿನ್ನಯೆ ತಾನು ಅಲ್ಲನ ನಾಡುಚುನ್ ಚಿರುಹಾಸಮುನ್\nವೆನ್ನೆಲೆ ಆಡಿನ ರೀತಿ, ಪೇರ್ಮಿನಿ ವೀಣತೋ ನೊಕ ವೇದಿಕನ್"],
bhoonutamu:["ಶ್ರೀನಿವಾಸ ಪುರುಷೋತ್ತಮ ಸಿಂಧುವಿಹಾರಾ\nಪೂನಿ ಮಮ್ಮು? ಗೃಪ ಜೇಕೊನಿ ಪ್ರೋವು ಮನಂಗಾ\nಭೂನುತಂಬು ರನಭಾಗಲ? ಬೊಂದಿ ಗಯುಕ್ತಿನ್‌\nಪೂನಿ ಸೊಂಪುಗ ಗ್ರಹಾಕ್ಷರಮುನ್‌ ವಡಿನೊಂದನ್‌.","ಆಕ?ಲೇಕಯಯಪಾಂಪತಿನೈನನುದಾಟುನ್\nದೋ?ಕಚಿಚ್ಚನ? ಗರಕ್ಕಸಿತುಂಗದಹಿಂಚುನ್\nವೀ?ಕ ಯೀದೃಶಮುಲೋಕಮು ವೀರುಲಕೆಲ್ಲನ್\nಜೋ?ಕ ಯೀತನಿಕಿನಂಜನಿ ಸೂಮನಕೆಂದುನ್"],
maMgaLamahaaSree:["ಚಿತ್ತಮುಲ? ಜೂಪುಲನು ಜಿತ್ತಜುನಿ ತಂಡ್ರಿಪಯಿ? ಜೆಂದಿ ಗಜದಂತಿಯತು ಲೊಂದನ್‌\nನೃತ್ತಮುಲತೋಡ? ದರುಣೀಮಣುಲು ಗಾನರುಚು ಲಿಂಪುಗನು ಮಂಗಳಮಹಾಶ್ರೀ\nವೃತ್ತಮುಲ? ಬಾಡಿರಿ ಸವೃತ್ತಕುಚಕುಂಭಮುಲ ವಿಂತಜಿಗಿ ಯೆಂತಯು? ದಲಿರ್ಪನ್‌\nಮತ್ತಿಲುಚು ನಬ್ಭಜಸನಂಬು ಲಿರುಚೋಟುಲ? ದನರ್ಪ?ಗ? ದುದನ್‌ ಗಗ ಮೆಲರ್ಪನ್‌.","ಈ ವಿಧಮುನನ್ ವಿಬುಧು ಲೇಕತಮ ಚಿತ್ತಮುಲ; ನೇಕತಮು ಲೇಕ ಹರಿನೀಶುನ್\nಭಾವಮುನ ನಿಲ್ಪಿ ತಗು ಭಾಗವತಯೋಗ ಪರಿ; ಪಾಕಮುನ ನೊಂದುದರು ವಾರಿಂ\nದೇವಲದು ದಂಡನಗತಿಂ ಜನದು ಮಾಕು ಗುಱು; ತಿಂಪ ನಘಮುಲ್ದಲ?ಗು ಮೀ?ದನ್\nಶ್ರೀವರುನಿ ಚಕ್ರಮು ವಿಶೇಷಗತಿ? ಗಾಚು ಸುರ; ಸೇವಿತುಲು ಮುಕ್ತಿ? ಗಡು? ಬೆದ್ದಲ್.","ಚಿತ್ತಕಭಿದಂಘ್ರಿಯುಗ ಚಿಂತನ ಕಳಾಧಿಗತ ಜಿಷ್ಣು ಸಮವೈಭವ ವಿಶೇಷಾ\nವಿತ್ತರಮಣಾಮರಗವೀ ತರಣಿಭೂಜಲದ ವಿಶ್ರುತ ಕರಾಂಬುರುಹ ಗೋಷ್ಠೀ \nನೃತ್ತಮಣಿರಂಗತಲ ನೀತಿಮನುರಾಜನಿಭನಿರ್ಭರದಯಾರಸಪಯೇಧೀ\nಮತ್ತಗಜಯೂಧ ಮದಮಗ್ನಸಿಖಿತಾಳಿರವಮಾನ್ಯಗೃಹಮಂಗಳಮಹಾಶ್ರೀ "],
maMjubhaashiNi:["ದಿವಿಜೇಂದ್ರು? ಡಾದಿಯಗು ದೇವಸಂಘಮುಲ್‌\nಭುವಿ ಮಂಜುಭಾಷಿಣಿಕಿ ಭೋಗಿರಾಡ್ಯತಿನ್‌\nಸವರಿಂಪ?ಗಾ ಸಜಸಜಂಬು ಗಾಂತಮೈ\nಭುವನೋದರಸ್ತುತಿ ಯಪೂರ್ವ ಮೈ ಚನುನ್‌."],
maMdaakraaMta:["ವೀಣಾನಾದಪ್ರತಿಮ ನಿಗಮಾವಿರ್ಭವತ್ಸಾರಪುಣ್ಯ\nಶ್ರೇಣೀಸಂಪಾದಿತ ವಿಮಲತಾಸ್ಥೇಮನಿರ್ಲೇಪಚಿತ್ತ\nತ್ರಾಣಕ್ರೀಡಾಕಲನಸತತೋತ್ಸಾಹವದ್ಧಿವ್ಯಭಾವಾ\nಪ್ರಾಣಾಪಾನಾಹರಣ ನಿಪುಣಪ್ರಾಪಣೀಯಾನುಭಾವಾ","ಚೆಂದೆಂ ಬಾದಾಂಬುಜರಜಮುಚೇ ಸ್ತ್ರೀತ್ವ ಮಾರಾತಿಕಿಂ ಜೇ\nಯಂದೆಂ ಜಾಪಂ ಬಿರುತುನುಕಲೈ ಯದ್ಭುತಂ ಬಾವಹಿಲ್ಲನ್‌\nಮ್ರಂದೆನ್ಮಾರೊಡ್ಡಿ ದಶಮುಖು?ಡುನ್‌ ರಾಮುಚೇ ನಂಚು? ಜೆಪ್ಪನ್‌\nಮಂದಾಕ್ರಾಂತನ್‌ ಮಭನತತಗಾ ಮಂಡಿತಾಶಾ ಯತುಲ್ಗಾನ್‌."],
maNigaNanikaramu:["ಗೊಡುಗುಲು ಪಱಿಯಲು ಗುಱುಕುಲು ಗೊನುಟನ್\nಸಿಡಮುಲ ತುನುಯಲು ಸೆದರಿ ಯುನಿಕಿ? ಬೆಂ\nದಡಿಗಲು? ಬಡಗಲು ದಱ್ಚು ಮುಱಿಯಲೈ\nಪುಡಮಿ? ಗಲಯುಟಕು? ಬೊಗುಲೊಲಯ ಮದಿನ್","ಕನಕಪು ವಲುವಲು? ಗರಕಟಕಮುಲುನ್‌\nನುನುಪಗು ತುಱುಮುನು ನೊಸಲಿತಿಲಕಮುನ್‌\nದನರೆಡು ಹರಿ? ಗನಿ ತಗನನನನಸಲ್‌\nನಿನಿಚಿನ ಮಣಿಗಣನಿಕರ ಮಿಭಯತಿನ್‌."],
maNibhooshaNamu:["ರಾಮವಿಕ್ರಮು?ಡ ಜೇಯು?ಡ ರಾತಿಗಜಾವಳೀ\nಸಾಮಜಾಹಿತು?ಡು ಸಾಂಬುಡು ಸಾಲ್ವಚಮೂಪತೀ\nಕ್ಷೇಮವೃಧ್ಧಿಯನುವಾನಿ ನ ಕೃತ್ರಿಮ ಸಾಹಸೋ\nದ್ಧಾಮು ದಾಕೆ ಶರಧಾರಲಧಾರುಣಿ?ಗಪ್ಪುಚುನ್","ಹಸ್ತಿರಾಜಭಯನಿರ್ಹರ ಯಂಡಜವಾಹನಾ\nಧ್ವಸ್ತಸಂಸರಣ ಯಂಚು? ಬಿತಾಮಹವಿಶ್ರಮ\nಪ್ರಸ್ತುತಂಬುಗ ರನಂಬುಲ ಭಾರಗಣಂಬುಲನ್‌\nವಿಸ್ತರಿಂಪ ಮಣಿಭೂಷಣ ವೃತ್ತಮು ಚೆಲ್ವಗುನ್‌."],
maNimaala:["ಶರಣಾಗತಾರ್ತಿಹರಣಾಂಬುಜಾತದಳಸನ್ನಿಭಾಂಬಕಯುಗಾ\nಕರುಣಾಸಮುದ್ರ ಜಗದಾದಿಕಾರುಣ ಪುರಾಣಮೂರ್ತಿ ಯನುಚುನ್‌\nವರುಸನ್‌ ಸಜತ್ರಿತಯಮುನ್‌ ದ್ರಿವಾರಮೊನರುನ್‌ ಸಕಾರಮು ತುದಿನ್‌\nದಿರಮೊಂದ ದಿಗ್ಯತಿ? ಗವುಲ್ನುತಿಂಪ ಮಣಿಮಾಲವೃತ್ತ ಮಮರುನ್‌.","ಕದಿಯಂಗಮೂ?ಡುಸಜಮುಲ್ ಸಕಾರಯುತಮೈ ದಿಶಾಖ್ಯಯತಿಗಾ\nಮದಿನಾನುಕಾರಿ ನಿಖಿಲಾಗಮಜ್ಞಮಣಿಮಾಲಯಂಡ್ರುಸುಕವುಲ್ \nಕದಿಯಂಗಮೂ?ಡುಸಜಮುಲ್ ಸಕಾರಯುತಮೈ ದಿಶಾಖ್ಯಯತಿಗಾ\nಮದಿನಾನುಕಾರಿ ನಿಖಿಲಾಗಮಜ್ಞಮಣಿಮಾಲಯಂಡ್ರುಸುಕವುಲ್ "],
maNiraMgamu:["ಶ್ರೀಮನಸ್ಸರಸೀರುಹಮಿತ್ರುನ್‌\nಬ್ರೇಮ ಮೊಪ್ಪ?ಗ ಬೇರ್ಕೊನುಚೋಟನ್‌\nರಾಮ ನಸ್ತ್ರವಿರಾಮ ರಸಾಗಲ್‌\nಕೋಮಲಂಬುಲಗುನ್ಮಣಿರಂಗನ್‌.","ಚೆಂಗನಾಲುಗ-ಚಿತ್ರಗತುಲ್ಗಾ\nದೊಂಗಯೇಣಮುತೋಚುನುದೂರೋ\nತ್ತುಂಗಧಾರುಣಿ-ದೂರ್ವನುಮೇಯನ್\nವಂಗಿನಟ್ಟುಲು-ಪಾತರಲಾಡುನ್"],
mattamayooramu:["ಭೋಜಾಧೀಶುಂ ಡಂಚು? ಬ್ರಭೂತಾತ್ಮಕು? ಡಂಚುನ್‌\nಭ್ರಾಜಿಷ್ಣುಂ ಡಂಚುನ್‌ ಯತಿ ಬಾಗೌ ಗಿರಿ ಸಂಜ್ಞನ್‌\nಓಜಸ್ಸ್ಫೀತಂಬೈ ಮತಯೋಪೇತ ಸಗಂಬುಲ್‌\nಓಜಂ ಬಲ್ಕನ್ಮತ್ತಮಯೂರಂ ಬಲರಾರುನ್‌.","ನಾನಾಭೂಷಾಮಂಜುಲ ನಾರೀಚಯಮಂತನ್\nರಾನುಂಬೋನುನ್ ನೂಪುರ ರಾವಂಬುಲು ಕಾಂಚೀ\nಸ್ಥಾನಾಲೋಲತ್ಕಿಂಕಿಣಿ ಸಂರಾವಮುಗಾಗನ್\nಗಾನಂಗಾನೈನಂಗನಿ ಕನ್ನುಲ್ ಚಲಿತಂಬೈ"],
mattahaMsini:["ಮನೋಹರಾಕಾರ ಮಧುದೈತ್ಯಸಂಹರಾ\nವಿನಾಯಕಾರೂಢ ವಿಬುಧೇಂದ್ರವಂದಿತಾ\nಜನಾರ್ದನಾ ಜತ್ಸಜಗುರುಲ್ ಕುಭೃದ್ಯತಿನ್\nದನರ್ಚು ಪದ್ಯಂಬು ದಗು ಮತ್ತಹಂಸಿನಿನ್."],
madanavilasitamu:["ಪದಪಡಿ ನನಗಲ್\nಗದಸಿ ವೆಲಸಿನನ್\nಮದನವಿಲಸಿತಂ\nಬದಿ ಯದುತಿಲಕಾ.","ಮಧುರಿಪು? ಡನಿನನ್‌\nಮಧುರಪುನನಗಲ್‌\nಮಧುರಮು ಲಗುಚುನ್‌\nಮಧುಮತಿ ನಮರುನ್‌."],
madanamu:["ದೈತೇಯಭಂಜನ ಹರೀ ತಭಜಾಗಗಂಬುಲ್\nಮಾತಂಗ ವಿಶ್ರಮಮುನನ್ ಮದನಾಖ್ಯ ನೊಪ್ಪುನ್.\nದೈತೇಯಭಂಜನ ಹರೀ ತಭಜಾಗಗಂಬುಲ್\nಮಾತಂಗ ವಿಶ್ರಮಮುನನ್ ಮದನಾಖ್ಯ ನೊಪ್ಪುನ್."],
manOj_namu:["ವಿಮಲಮನೋಜ್ಞಗುಣಪ್ರವೃತ್ತಿನಿ?ದೆಲ್ಪು ವಾ\nಕ್ಸುಮ ಮೆದಚಾಟುನ ನೂಗು ಚೊಕ್ಕಪು? ಬೂವು?ಗಾ\nಸ್ವಮನಿತವಸ್ತುವಿಭೂತಿ ಪೈಕೊನ ಹೃಲ್ಲತಾ\nಪ್ರಮಿತಿನಿ? ಜಾಟು ಸುಗಂಧ ಭಾವಸಮಜ್ಞಲನ್","ಅಜಶಿವಶಕ್ರನಿರಂತರಾರ್ಚಿತಪದ್ದ್ವಯುನ್‌\nಭುಜಗಕುಲಾಧಿಪತಲ್ಪು? ಬೂನಿ ನುತಿಂಪ?ಗಾ\nನಜಯತಿ ನೊಂಡಿ ನಜಾಭರಾರ್ಚಿತ ಮೈಚನುನ್‌\nಋಜು ವಗು ನುರ್ವಿ ಮನೋಜ್ಞ ಋಷ್ಯನುರಾಗಮೈ."],
mayoorasaari:["ಚೂತಮಾ ಯಶೋದಸೂನು ನಂಚುನ್‌\nವ್ರೇತ ಪಲ್ಕು? ದರ್ಕವಿಶ್ರಮಂಬುಲ್‌\nಭಾತಿಗಾ ರಜಂಬುಪೈ ರಗಂಬುಲ್‌\nಜಾತಿಗಾ ಮಯೂರಸಾರಿ? ಜೆಪ್ಪುನ್‌."],
malayajamu:["ನಳಿನ ವಿಲೋಚನ ನಜನಸನಂಬುಲು ನಭನಗಣಂಬುಲು ನಟ ಲಗಮುನ್\nಮಲಸಿ ಗಿರಿತ್ರಯಮಹಿತಯತುಲ್ ತಗಿ ಮಲಯಜ ವೃತ್ತಮು ಮಹಿ ವೆಲಯುನ್\nನಳಿನ ವಿಲೋಚನ ನಜನಸನಂಬುಲು ನಭನಗಣಂಬುಲು ನಟ ಲಗಮುನ್\nಮಲಸಿ ಗಿರಿತ್ರಯಮಹಿತಯತುಲ್ ತಗಿ ಮಲಯಜ ವೃತ್ತಮು ಮಹಿ ವೆಲಯುನ್","ನಲಿನ ವಿಲೋಚನ ನಜನಸನಂಬುಲು ನಭನಗಣಂಬುಲು ನಟಲಗಮುನ್ \nಮಲನಗಿರಿತ್ರಯಮಹಿತಯತುಲ್ದಗಿಮಯಲಜವೃತ್ತಮು ಮಹಿವೆಲಯುನ್ \nನಲಿನ ವಿಲೋಚನ ನಜನಸನಂಬುಲು ನಭನಗಣಂಬುಲು ನಟಲಗಮುನ್ \nಮಲನಗಿರಿತ್ರಯಮಹಿತಯತುಲ್ದಗಿಮಯಲಜವೃತ್ತಮು ಮಹಿವೆಲಯುನ್ "],
maedini:["ವಿನು ಮಿಟುಲೇಟಿಕಿಂ ಜನಿನ ವೃತ್ತಮೂದಿ ಯಲ್ಗನ್\nಜನಮು ನುತಿಂಚು ನೀದು ಗುರುಸಾರಧೀರಬುದ್ಧಿನ್\nನಿನು ನತಿಶಾಂತಚಿತ್ತಯನಿ ನಿಕ್ಕ ಮೇನು ಗಂದುನ್\nಮನಮುನ ನಿಟ್ಟಿನೀಕಗುನೆ ಮತ್ಸರಂಬು ವತ್ಸಾ.","ನಗಣಮುತೋ ಜಕಾರಭಗಣಂಬುಲುನ್ ಜಕಾರ\nಪ್ರಗುಣಿತ ರೇಫಯುನ್‌ ಗುರುವುಭಾತಿ?ಗಾಗ ನೋಲಿನ್‌\nದಗ ನವತಾರ ವಿಶ್ರಮಮು ದಂಡಿಗಾ ನೊನರ್ಪನ್‌\nಮೃಗಮದವರ್ಣು? ಡೀಯಕೊನು ಮೇದಿನೀ ಸಮಾಖ್ಯನ್‌."],
vaaraaMgi:["ಚಳುಕ್ಯವಂಶಾಜತಜಲ್ ಗಗಂಬುಲ್\nಚೆಲಂಗಿ ಯರ್ಥಂಬುನ? ಜೆಂದಿ ರೀತಿಂ\nಗ್ರಾಲಂಗ? ದಾಯತ್ತಜಗಾನಿಯುಕ್ತಿನ್\nಮೇಲಯ್ಯೆ ವಾರಾಂಗಿ ಸಮೀಹಿತಾಖ್ಯನ್","ಸರಿತ್ಪದಾಬ್ಜಾ ಜತಜಲ್‌ ಗಗಲ್‌ ಬಂ\n	ಧುರಂ ಬಗುನ್‌ ರೆಂಟ ಜತುರ್ಥಕಾಂಘ್ರಿನ್‌\nಗಾರಾಮುತೋ? ದಾಜಗಗಲ್‌ ವರಾಂಗಿನ್‌\nಹರಾರ್ಚಿತಾ ಮೂ?ಡವಯಂಘ್ರಿ ನೊಂದುನ್‌."],
ratipriyavRttamu:["ಖ್ಯಾತಶ್ರೀ ಮನಜರಗಂಬುಲುಂಡ?ಗಾ? ದ\nದ್ಗತಂಬುಲೈ ಜಭಸಜಗಂಬು ಲೊಂದಗಾ\nವೀತಾಘಪ್ರಮುದಿತವಿಶ್ವಭೂಪಾ\nಧೃತಿಂ ದಲಂಪ ನಿದಿ ರತಿಪ್ರಿಯಂ ಬಗುನ್"],
rathOddhatamu:["ನಂದಗೋಪವರನಂದನುನ್‌ ರಮಾ\nನಂದು? ಬ್ರಸ್ತುತಿ ಯೊನರ್ಚಿ ಷಡ್ಯತಿನ್‌\nಅಂದಮೈ ರನರವಾಹ್ವಯಂಬು ಲಿಂ\nಪೊಂದ? ಜೆಪ್ಪಿನ ರಥೋದ್ಧತಂ ಬಗುನ್‌.","ಹಾರಹೀರಧವಳಾಂಶುನಿರ್ಮಲೋ\nದಾರಕೀರ್ತಿರಣದರ್ಪ ಸದ್ಗುಣಾ\nವೈರಿವೀರರಸವೈದ್ಯಮನ್ಮಧಾ\nಕಾರ ಧೀರಪರಗಂಡಭೈರವಾ"],
ramaNakamu:["ಮಸಸಿತ ಜನಕ ಸಮದರಿಪು ಗಜಹರಿ  ಮದಗಜವಸು ವಿರಮಣಮುಲತೋ\nನನನನ ನನನನ  ನಲಗಮು ಲೆನಯ?ಗ  ನರವರನುತ! ರಮಣಕ ಮಮರುನ್‌.\nಮಸಸಿತ ಜನಕ ಸಮದರಿಪು ಗಜಹರಿ  ಮದಗಜವಸು ವಿರಮಣಮುಲತೋ\nನನನನ ನನನನ  ನಲಗಮು ಲೆನಯ?ಗ  ನರವರನುತ! ರಮಣಕ ಮಮರುನ್‌.","ತೆರಗುತೆರಗುಲಗುತೆಲುಗುನುಡುವುಲನತೆರ ಪಯಿನವೆನುಕ ದಿಟವುಗತಾ\nಕರಮುಗಪಲುಕುಚುಕಲಮುನಕದುಪುಚುಕದಲಿಚಿ ನೆಡದಲಕವಿನಟುಡೈ\nಉರುನಟನಕವನಒಡುಪುಲನಿಪುಣುಡುಯುವನವಪಧಬಲಯುತಮದಿಯಾ\nಭರಣಿತನಿಕೆಳೊಕಪಸಿಡಿತೊಣಿಕಿಸಲಭರಿಣೆರಜತಪಟಪಟಲಮುಲನ್ ~ ಶ್ರೀ ಸೂರ್ಯನಾರಾಯಣ  ಸರಿಪಲ್ಲಿ ಗಾರಿಚೇ ವಿರಚಿತಂ."],
rugmavati:["ಅಂಗಯತಿಂ ಬೊಂದೈ ಭಮಸಲ್ ಪ\nರ್ವುಂ ಗುರುಯುಕ್ತಿನ್ ರುಗ್ಮವತಿನ್ ಸ\nತ್ಯಾಂಗನಕೈ ತೇ? ದಾ ಸುರಶಾಖಿಂ\nಬೊಂಗುಚು ಗೋಪೀಪುತ್ರು? ಡನಂಗನ್."],
ruchiramu:["ಅನಂಗಕೋಟಿವಿಲಸದಂಗವೈಭವುನ್‌\nಮನಂಬುಲೋ ನಿಲಿಪಿನ ಮಾನು ನಾಪದಲ್‌\nಅನನ್‌ ಜಭಂಬುಲು ಸಜಗಾನುಸಂಗತಿನ್‌\nದನರ್ಚು ನೀರುಚಿರಕು ದಂತಿರಾಡ್ಯತಿನ್‌."],
lata:["ಸತವಡಿ ರಂಗೇಶ್ವರ ನಯನನಗೋ\nನ್ನತಿನಿ ಲತಾವೃತ್ತಮು ಚೆಲುವಮರುನ್\nಸತವಡಿ ರಂಗೇಶ್ವರ ನಯನನಗೋ\nನ್ನತಿನಿ ಲತಾವೃತ್ತಮು ಚೆಲುವಮರುನ್"],
layahaari:["ಚದುವುಲುನು ಗಿದುವುಲನು ಜದುವ ಧನ ಮೊದವು ನನಿ ಮದಿ? ದಲ?ಪವಲದು ಮುನು ಚದಿವಿರೆ ಧರಿತ್ರಿನ್‌\nಸದಮಲಿನಹೃದಯು? ಡನ? ಬೊದಲು ದಿತಿಸುತಸುತು?ಡು -    ಮೊದಲ? ಬಲಿಕಿನಪಲುಕು ಜದುವ?ಗ ಮುಕುಂದುಂ\nಡದ ನೆಱಿಗಿ? ಕದಿಸೆ? ಗದ! ಚದಿವಿನಭೃಗುವುಕೊಡುಕು -    ಚದುವುತುದಿ ನೊಕಪನಿಕಿ ನೊದವೆನೆ ಯಟಂಚುನ್‌\nಪದುನೊಕ?ಡು ನಗಣಮುಲು ಗದಿಸಿ ಸಗಮೆನಯ ಭುವಿ -    ವಿದಿತಮುಗ ಬುಧುಲು ಪಲುಕುದುರು ಲಯಹಾರಿನ್‌.","ಪಿಡುಗುಲುರಲಿ ನಗತಿನಿ ಬೊಡುಚುಚುನು ನಡಚುಚುನು ಬೆಡಿದಮುಗ ವಿದಲುಚುಚು ವಿಡಿಪಡನಿ ಪಟ್ಟುನ್ \nನಡಗಿರುಲು ವೆಡದರುಲು ವಿಡಿಲುಕೊನಿ ಪೆನುಗರುಲ ಸುಡಿವಡಿನ ಯುಲಿಉಲುನು ಪೊಡುಚುಕೊನು ರೀತಿನ್ \nತೊಡಲು ತೊಡಲು ವಿ ದ್ರುಚುಚು ಮೆಡಲು ಮೆಡಲು ವಿರುಚುಚು ನೊಡಲು ನೊಡಲು ಕುಮುಲ್?ಗ ಬೊಡುಚುಚು ಮಹೋಗ್ರುಲ್\nವಿಡಿವಡಿನ ಕನಲು ವೆಲು ವಡಿನ ಪೆನುಪರಿಚಲಮು ಕಡವ ನೊಕ?ಡೊಕ?ಡು ಪೆನುವಡಿನ ಗತಿ ಪೋರನ್ "],
laaTeeviTamu:["ಸಗಣಂಬುಲುನಾಲ್ಗಿಟಿಪೈ ಮತಯಲ್‌ ಸಮ್ಯಗ್ಭಾವಂಬೈ ಯರುದೇರನ್‌\nಬಗಲಿಂಟಿಕಿ ನೇಲಿಕ ಯೆವ್ವ?ಡು ನಾ ಭಾವಿಂಪಂಗಾ ಭಾಸುರಭಂಗಿನ್‌\nಮಿಗುಲನ್ಮಧುರಂಬಗು ಶಬ್ದಮುಲನ್‌ ವಿಶ್ರಾಂತಿನ್‌ ಲಾಟೀವಿಟವೃತ್ತಂ\nಬಗು ನಿಂದುಕಳಾಧರಸನ್ನುತನಾಮಾಂಕಾ ಶಂಕಾಂತಂಕ ವಿದಾರೀ!","ಅವುನಿಲ್ಲಲುಕಂಗಬೆ ಪಂಡುವುಕಾದಂಭೋದೋದ್ಯದ್ರಾಕ್ಷಸರಾಜುಲ್\nವಿವೃತಾನನುಲುದ್ಯತಬಾಹುಲುಪೃಧ್ವೀಘೋಷಾಪರ್ಯಾಪ್ತಭುಜೋಗುಲ್\nದವುಲಂಜನುದೆಂತುರುಮೀದಗುನೀದರ್ಪಾವೇಶಾಧಃಕೃತಿಬಧ್ಧುಲ್\nನವಲಾಚೆವುಲುನ್ ಮುನಿನಾಸಿಕಯುನ್ ನಧ್ಧಂಪೆಟ್ಟಂಬಂಡವು ಪ್ರಜ್ಞಲ್"],
vaMSasthamu:["ನಮೋ ನಮೋ ದೇವ ಜನಾರ್ದನಾಯ ತೇ\nನಮೋ ನಮಃ ಪಂಕಜನಾಭ ನಾವುಡುನ್‌\nರಮಿಂಚು ವಂಶಸ್ಥ ವಿರಾಮಮದ್ರುಲನ್‌\nಸಮಂಚಿತಂಬೈ ಜತಜಂಬು ರೇಫಯುನ್‌.","ಲತಾಂಗು ಲಾನಂದ ವುಲಾಸ ಮೂರ್ತುಲೈ\nನಿತಾಂತ ಗರ್ಭಂಬುಲು ನಿಕ್ಕಿಮುಂದಟನ್\nಪತಂಗ ರಾತ್ಚಂಚುವು ಭಾತಿ ಶಾರ್ ಙ್ಗಸ\nಜ್ಯತಾಧುರಾವೈಖರಿ ನಧ್ಭುತಂಬುಗಾನ್"],
vanamaMjari:["ಹರಿ ಪುರುಷೋತ್ತಮ ಕೃಷ್ಣ ಕೃಪಾನಿಧಿ ಯಾದಿಮೂಲಮ ಯಂಚು ನಾ\nಕರಿಪತಿ ಪಲ್ಕ?ಗ? ಗಾಚೆ ನಿತಂ ಡನಿ ಕೌತುಕಂಬುನ? ಬಲ್ಮರುನ್‌\nಜರಗು? ದ್ರಯೋದಶವಿಶ್ರಮಮುಲ್‌ ನಜಜಾಜಭಾಂಚಿತರೇಫಲನ್‌\nಮರುಗುರುನಿಂ ಬ್ರಣುತಿಂತು ರಿಲನ್‌ ವನಮಂಜರಿಂ ಗವಿಪುಂಗವುಲ್‌.","ನಯುತ ಜಕಾರ ಚತುಷ್ಕಭರೇಫಗಣತ್ರಯೇದಶ ವಿಶ್ರಮಾ\nಶ್ರಯಮಗು ನವ್ವನಮಂಜರಿ ರೇಚನ ಸರ್ವಶಾಸ್ತ್ರ ವಿಶಾರದಾ\nನಯುತ ಜಕಾರ ಚತುಷ್ಕಭರೇಫಗಣತ್ರಯೇದಶ ವಿಶ್ರಮಾ\nಶ್ರಯಮಗು ನವ್ವನಮಂಜರಿ ರೇಚನ ಸರ್ವಶಾಸ್ತ್ರ ವಿಶಾರದಾ"],
vasaMtamaMjari:["ಕಮಲನೇತ್ರನು ಬಂಕಜಮುಖಿನಿ? ಗನ್ಯಕಾಜನಧಿಕ್ಕೃತನ್\nಸುಮನಿಭಾಂಗಿನಿ? ಬಲ್ಲವಪದನು ಸುಂದರೀವರರತ್ನಮುನ್\nವಿಮಲದಂತಿನಿ ಹಂಸಗಮನನು ಬಿಂಬಸಾಮ್ಯಪುಯೋನಿನಿನ್\nಸಮದಕುಂಜರಕುಂಭಕುಚನು ವಸಂತಮಂಜರಿ ನಂಜಲಿನ್."],
vaatOrmi:["ದೇವಾಧೀಶುನ್‌ ಹರಿ? ದೇಜೋವನಧಿನ್‌\nಭಾವಿಂಪಂಗಾ ಋತುಭಾಸ್ವದ್ವಿರತಿನ್‌\nಈ ವಾತೋರ್ಮಿನ್‌ ಮಭಲೇಪಾರು? ದಕಾ\nರಾವಾಸಂಬೈ ಲಗ ಮರ್ದಿನ್‌ ಗದಿಯನ್‌.","ಅಂತನ್ ದೈತ್ಯೇಶ್ವರು?-ಡಾಕಾಶಗತಿನ್\nಕಾಂತಾರೋದಧ್ವನಿ-ಕಪ್ಪಂಗ ದಿಶಲ್\nಕ್ರಾಂತಮ್ಮೈದಕ್ಷಿಣಗಾಢೋಗ್ರಕಕು\nಪ್ಪ್ರಾಂತಮ್ಮೈತೇರಗ ಪ್ರಾಣಮ್ಮುಲೊಗಿನ್"],
vichitramu:["ಖರಪ್ರೌಢಚಾಪ\nಸ್ಫುರದ್ಬಾಣಧಾರನ್\nಧರಾಕನ್ಯಕಾರಾ\nಟ್ಮರಾಸಂಬುವಿರ್ಗೆನ್","ವಿಚಿತ್ರಂಬುನಂದುನ್\nರುಚಿಂಚುನ್ ಯಯಂಬುಲ್\nವಿಚಿತ್ರಂಬುನಂದುನ್\nರುಚಿಂಚುನ್ ಯಯಂಬುಲ್"],
vidyunmaala:["ಮಾದ್ಯದ್ಭಕ್ತಿನ್‌ ಮಾಗಾಯುಕ್ತಿನ್‌\nವಿದ್ಯುನ್ಮಾಲಾ ವೃತ್ತಂ ಬೊಪ್ಪನ್‌\nಚೈದ್ಯಧ್ವಂಸಿನ್‌ ಸಂಬೋಧಿಂಪನ್‌\nಸದ್ಯಶ್ಶ್ರೇಯೋಜಾತಂಬಯ್ಯೆನ್‌."],
vibhootivRttamu:["ಸ್ವಸ್ಥ ಸದ್ವಿಭೂತಿ ದಾ\nರಸ್ಥ ಜಸ್ಥಗಂಬುನನ್\nಸ್ವಸ್ಥ ಸದ್ವಿಭೂತಿ ದಾ\nರಸ್ಥ ಜಸ್ಥಗಂಬುನನ್","ಅಯೆಡನ್ ಮುನೀಶ್ವರುಂ\nಡೀಯೆಡನ್ ರಘೂತ್ತಮಂ\nಡಾಯೆಡನ್ ರಘೂತ್ತಮಂ\nಡೀಯೆಡನ್ ಮುನೀದ್ರುಡುನ್"],
viSvadaevi:["ಜಾನೊಂದಂ ಗಾವ್ಯಶ್ರೀಕಿ ಸಂಪ್ರೀತಿತೋಡನ್‌\nಮಾನಾಥುನ್ ನಾಥುಂ ಜೇಸಿ ಮಾಯಾಗಣಂಬುಲ್‌\nಧೀನಿತ್ಯುಲ್‌ ಧಾತ್ರೀಭೃದ್ಯತಿಂ ಗೂರ್ತು ರಿಂಪುಲ್‌\nತೇನೆಲ್‌ ಸೋನಲ್‌ ಗಾ ವಿಶ್ವದೇವೀಸಮಾಖ್ಯನ್‌.","ಅಂಭಾರಾವೋತ್ಸೃಷ್ಟಂಬುಲೈಪಪ್ಲವೋಗ್ರೋ\nಜ್ಜೃಂಭಮ್ಮುಲ್ ಸೈನ್ಯಂಬುಲ್ ಧುರೀಣಾಂಬುಲಂತನ್\nಭುಂಭುಂಧ್ವಾನಂಬುಲ್ಗಾಗ?ಬುಟ್ಟೆನ್ ಧರಾಬೃ\nದ್ಗಂಭೀರಾನೀಕಂಬುನ್ ವಿಘಾತಂಬು ಚೇಸೆನ್"],
SarabhakreeDaa:["ಚತುರ್ವರ್ಣಾಧಾರಾ ಯ ಮ ನ ಸರಗವ್ಯಾಪ್ತಿ ನಾದ್ಯ\nದ್ವಿತೀಯಾಂ ತ್ಯಾಂಘ್ರಿಪ್ರಸ್ತುತಗತಿ ನತಿಸ್ಪಷ್ಟಮೈನನ್\nಖ್ಯಾತಾಸಕ್ತಿನ್ ಮ ಭ ನ ಯ ಯ ತೃತೀಯಾಂಘ್ರಿನೊಪ್ಪನ್\nಬ್ರತಿಪ್ರೇಮೋತ್ಪತ್ತಿಂ ಬರ?ಗಿ ಶರಭಕ್ರೀಡ ಯಯ್ಯೆನ್"],
Saalini:["ಧೀರಶ್ರೇಷ್ಠುಲ್ಸನ್ನುತಿಂಪಂ ಗವೀಂದ್ರಾ\nಧಾರಂಬೈ ಧಾತ್ರಿನ್ಮತಾಗಾಗಣಾಪ್ತಿನ್\nದೋರಂಬೈ ಭೂಭೃದ್ಯತುಲ್ ಸಂಘಟಿಂಪನ್\nನೀರೇಜಾಕ್ಷಾ ಶಾಲಿನೀವೃತ್ತ ಮೊಪ್ಪುನ್.","ಭಾವಶ್ರೀಗಮ್ಯಪ್ರಭಾಶಾಲಿನಿನ್‌ಸ್ವೇ\nಚ್ಚಾವಿರ್ಭೂತಾತ್ಮಸ್ವಯಂಭಾಸಿನಿನ್ ಬ್ರ\nಙ್ಞಾವೈದಗ್ಧ್ಯವ್ಯಕ್ತಸರ್ವಾಂತರಾತ್ಮನ್\nಶ್ರೀವಿದ್ಯೋಪಾಸ್ಯನ್ ಭಜಿಂತುನ್ ಭವಾನಿನ್"],
SikhariNi:["ತಪಸ್ಸ್ವಾಧ್ಯಾಯಾದಿಕ್ಷಪಿತಮಲಚಿತ್ತಪ್ರಕಲಿತಾ\nವಿಪಜ್ಜಾಲಜ್ವಾಲಾವಿರಮಣಸುಧಾವೃಷ್ಟಿಲಲಿತಾ\nಜಪಾಪುಷ್ಪಕ್ಷೀರಚ್ಛವಿಕಿರಣಸಂಸರ್ಜನಧುರಾ\nಸಪರ್ವಾನಿರ್ವಾಹಪ್ರಚುರಕಲನಸ್ಥೈರ್ಯಮಧುರಾ","ಗಜೇಂದ್ರಾಪದ್ಧ್ವಂಸಿನ್‌ ಮುದಿರಸದೃಶುಂ ಗಂಜನಯನುನ್‌\nಭಜಿಂತುಂ ದಾತ್ಪರ್ಯಂಬುನ ನನಿನಚೋ ಭಾಸ್ಕರಯತಿನ್‌\nಪ್ರಜಾಹ್ಲಾದಂ ಬೈನನ್‌ ಯಮನಸಭವಪ್ರಸ್ಫುರಿತಮೈ\nದ್ವಿಜಶ್ರೇಷ್ಠುಲ್ಮೆಚ್ಚನ್‌ ಶಿಖರಿಣಿ ಗಡುನ್‌ ವಿಶ್ರುತಮಗುನ್‌."],
SuddhaviraaTi:["ಶ್ರೀಮಂತುಂಡಗು ಚಿನ್ನ ಕೃಷ್ಣುನಿನ್‌\nಧೀಮಂತುಲ್ಪ್ರಣುತಿಂಪ ಬಾಣವಿ\nಶ್ರಾಮಂಬುನ್‌ ಮಸಜಂಬು ಗಂಬುನೈ\nರಾಮಾ ಶುದ್ಧವಿರಾಟಿ ಯೊಪ್ಪಗುನ್‌."],
Syaeni:["ಆರಮಾಧಿನಾಥು? ಡಕ್ಷಯಂಬುಗಾ?\nಜೀರ ಲಿಚ್ಚೆ ಯಾಜ್ಞಸೇನಿ ಕಂಚು? ಬೆಂ\nಪಾರ? ಜೆಪ್ಪ ಶ್ಯೇನಿ ಯಯ್ಯೆ ಷಡ್ಯತಿನ್‌\nಸ್ಫಾರಮೈ ರಜಂಬುಪೈ ರವಂಬುಗಾನ್‌.","ಮಿಂಟಡೇಗಪಿಂಡುಮೇಲಿಚಕ್ರಮುಲ್\nವೆಂಟವೆಂಟತಿರ್ಗಿವೇಗ ವ್ರಾಲುಚುನ್\nಮಂಟಲೇಚುವಟ್ಟಿಮಾಸಖಂಡಮುಲ್\nಗೆಂಟುಕೊಂಚು?ಬೋವು?ಗೀರ್ಣಧಾತ್ರಿಗಾ"],
Sree:["ಶ್ರೀ\nಶ್ರೀಂ\nಜೇ\nಯುನ್","ಶ್ರೀ\nಭಾ\nವಿಂ\nತುನ್‌."],
stree:["ಸ್ತ್ರೀರೂ\nಪಾರುನ್‌\nಘೋರಾ\nಘೋರೀ.","ಸ್ತ್ರೀರೂ\nಪಾರುಂ\nಗಾರೂ\nಪಾರುನ್"],
SreeramaNamu:["ಆರಭಮವ್ಯಾಯತ್ತಸಗವ್ಯಾ\nಪಾರಮು ನಾದಿಮ ಪಾದಮು ಸೆಂದನ್\nಜಾರು ಭಭಾಗಗಸಂಗತಿಚೇತನ್\nಶ್ರೀರಮಣಂಬನಿ ಚೆಪ್ಪಿರಿ ಮೂ?ಟನ್","ಧಾತ್ರಿ ಭಮಂಬುಲ್‌ ತತ್ಸಗ ಮಾದಿನ್‌\nಭತ್ರಯಗಾಗಣಪದ್ಧತಿ ಮೂ?ಟನ್‌\nಗೋತ್ರಧರಾ ಯಿಟು ಗೂರ್ಪ? ಬದಂಬುಲ್‌\nಚಿತ್ರಗತಿಂ ಜನು ಶ್ರೀರಮಣಂಬುಲ್‌."],
samaani:["ಈ ಸಮಾನಿಕಿನ್ ರಜವ\nನ್ಯಾಸ ಮೊಪ್ಪಗುಂ ಗೃತುಲನ್\nಈ ಸಮಾನಿಕಿನ್ ರಜವ\nನ್ಯಾಸ ಮೊಪ್ಪಗುಂ ಗೃತುಲನ್","ಇಂಬುಗಾರಜಂಬುವಕಾ\nರಂಬುಗಾ ಸಮಾನಿ ಯಗುನ್\nಇಂಬುಗಾರಜಂಬುವಕಾ\nರಂಬುಗಾ ಸಮಾನಿ ಯಗುನ್"],
sarasaaMkavRttamu:["ಸರಸಾಂಕ ವೃತ್ತಮಮರುನ್ ಸಜಸಾಯ ಲೊಂದನ್\nಸರಸೀಜ ಸಂಭವಯತಿನ್ ಜಲಜಾತ ನೇತ್ರಾ\nಸರಸಾಂಕ ವೃತ್ತಮಮರುನ್ ಸಜಸಾಯ ಲೊಂದನ್\nಸರಸೀಜ ಸಂಭವಯತಿನ್ ಜಲಜಾತ ನೇತ್ರಾ"],
sarasijamu:["ಸಂಬಂಧಿಂಚುನ್ಮತ್ಯಲು ನಾನಾಸಲು ದಶನಿಧಿಯತಿ ಸರಸಿಜಮುನಕುನ್\nಗಂಬೂರನ್ಬೃಂದಾಟವಿಲೋನಂ ಗವಿಸಿಕೊನಿನ ಸುರಕರುವಲಿ ದನುಜುನ್\nಶಂಬಾಭೀಲಂಬೈ ತಗುಮುಷ್ಟಿಂ ಜದಿಪಿನ ಯದುಪತಿ ಸ್ತವಮುಲ ನನುರಾ\nಗಂ ಬೂರನ್ಶೋಭಿಲ್ಲ?ಗ? ಬ್ರಾಂಚತ್ಕವಿವರು ಲಭಿನುತಿ? ಗಱಪುದು ರವನಿನ್.","ರಮ್ಯತ್ವಂಬಾರ?ಗ?ಬೆಂಪೂರ್ಜಿತಮುಗ ಮಣಿವಿರಚಿತಮಕುಟಮುಲುಂ\nದಾರುಂಜೂಡನ್ ಸಾರವಿಭೂತಿನ್ ಧರಣಿಪುಲನಿಮಿಷದವನಿಭಿಲಗುಚುನ್ \nಭೂರಿಪ್ರೀತಿನ್ ಸೂರೆಲಗೊಲ್ವನ್ ಭುವನವಿನುತಮಗು ಪೊಲುಪುವೆಲಯ ಮು\nನ್ನೀ ರಾಜುಂಡುನ್ ದಾರುಣದೈವಂ ಬಿಟುವಱು ಚುನೆತುದಿ ನಿತನಿ?ಗಟಕಟಾ "],
saadhveevRttamu:["ನಾರದಸನಕಸನಂದನವಿನುತ ಸನಾಥ ಭನಜನಸನಾಭಗುರುಲ್‌\nಚಾರುಶಿಖರಿಯತಿ ಶೈಲ ವಿರಮಣಮು ಕ್ಷ್ಮಾಧರ ವಿರತಿಯು ಸಾಧ್ವಿಯಗುನ್‌.\nನಾರದಸನಕಸನಂದನವಿನುತ ಸನಾಥ ಭನಜನಸನಾಭಗುರುಲ್‌\nಚಾರುಶಿಖರಿಯತಿ ಶೈಲ ವಿರಮಣಮು ಕ್ಷ್ಮಾಧರ ವಿರತಿಯು ಸಾಧ್ವಿಯಗುನ್‌."],
siMharaekha:["ಶ್ರೀರಜಂಬುಪೈ ಗಗಂಬುಲ್\nಚೇರ ಸಿಂಹರೇಖ ಯಯ್ಯೆನ್\nಶ್ರೀರಜಂಬುಪೈ ಗಗಂಬುಲ್\nಚೇರ ಸಿಂಹರೇಖ ಯಯ್ಯೆನ್\n","ಈರಜಾಗ್ರಗಾ ನಿಯುಕ್ತಿನ್\nಗೋರಿ ಸಿಂಹರೇಖ ಯೊಪ್ಪುನ್\nಈರಜಾಗ್ರಗಾ ನಿಯುಕ್ತಿನ್\nಗೋರಿ ಸಿಂಹರೇಖ ಯೊಪ್ಪುನ್"],
sukaaMti:["ಜಗಂಬುಲಂ\nದಗುನ್ ಸುಕಾಂ\nತಿ ಗಲ್ಪಿತ\nಪ್ರಗಲ್ಭತನ್","ಅಗುನ್‌ ಸುಕಾಂ\nತಿ ಗೂರ್ಪ?ಗಾ\nಜಗಂಬುಲನ್‌\nಜಗತ್ಪತೀ."],
suMdari:["ಕೋರಿನ ಕೋರಿಕ ಲಿಚ್ಚು? ಗೋಮಲಿ ಚೂಡವೇ\nಮಾರುನಿತಂಡ್ರಿ ಯನಂ ಗ್ರಮಂಬುನ ನೀಕ್ರಿಯನ್‌\nಭಾರಸವಂಬುಲ ನೊಪ್ಪು? ಬನ್ನಗರಾಡ್ಯತಿನ್‌\nಸೂರಿಜನಂಬುಲು ಸೆಪ್ಪ ಸುಂದರಿವೃತ್ತಮುಲ್‌.","ವೆನ್ನೆಲ ಲೋ ವಿಹರಿಮ್ಚ ವೆಳ್ಳಗ ವೇಡ್ಕಗಾ\nಕನ್ನುಲ ಮುಮ್ದರ ತೋಚೆ ಕಾಂತುಲ ಕಲ್ಕಿಯೈ\nಅನ್ನುಲ ಮಿನ್ನಯೆ ತಾನು ಅಲ್ಲನ ನಾಡುಚುನ್\nವೆನ್ನೆಲೆ ಆಡಿನ ರೀತಿ , ಪೇರ್ಮಿನಿ ವೀಣತೋ"],
paMkti:["ಸುಂದರಿ ಯೊಪ್ಪುಂ\nಜೆಂದಿ ಭಗಾ ನಿಂ\nಪೊಂದ ನಿಯುಕ್ತಿನ್\nಗಂದುಕಲೀಲನ್","ಚೆಂದಿ ಭಕಾರಂ\nಬೊದಗಗಂಬುಲ್\nಸುಂದರಿ ಯಂಪೇ\nರಂದುರು ಸೂರುಲ್"],
sugaMdhi:["ನಿನ್ನು ವೇ?ಡುವಾರ ಮಯ್ಯ ನೀರಜಾಕ್ಷ! ಮಮ್ಮು ನಾ\nಪನ್ನುಲಂ ಬ್ರಪನ್ನುಲಂ ಬ್ರಪಂಚಮುನ್ ದಯಾಮತಿಂ\nಜೆನ್ನುಮೀರ? ಗಾವವೇ, ಪ್ರಸಿದ್ಧು? ಡಿದ್ಧಕೀರ್ತಿಸಂ\nಪನ್ನು?ಡುನ್ ವದಾನ್ಯು?ಡುಂ ದಪಸ್ವಿತುಲ್ಯತೇಜು?ಡುನ್","ಇಟ್ಟು ಲಾಮುನೀಂದ್ರು?  ಡಾಡಿ ಯೀಯ ನನ್ನ ಥೇನುವುನ್\nಬಟ್ಟಿ  ಕಟ್ಟಿ  ಕೊಂಚು?  ಬೋವ ಬಾರ್ಥಿವುಂಡು  ಬಲ್ಮಿ ಮೈ?\nದೊಟ್ಟ? ಗನ್  ದುರಂತಚಿಂತ  ದುಃಖಿತಾತ್ಮ ಯೌಚು ನ\nನ್ನಿಟ್ಟು  ವಾಯ?ಗಾ  ಮುನೀಂದ್ರು? ಡೇಮಿ  ತಪ್ಪು ಚೇಸಿತಿನ್","ಓರಿ ನೀದುಮಾಯರೂಪಮುನ್ನದುನ್ನಯಟ್ಲುಗಾ?\nಗೋರಿಪಟ್ಟುಕೋ?ದಲಂಪ?ಗೂಡಿರಾವು ದುರ್ಮತೀ\nಯೌರ ಚಾವುಮಂಚು ಸ್ವಾಮಿ ಯಗ್ನಿ ಬಾಣಸಂಧಿಗಾ\nನೂರಿತಾಟಕೇಯುಮೇನ ನೊಲ್ಕೊನನ್ವಿದಿರ್ಚಿನನ್","ಪುಂತವಿಂತಲನ್ಕನಂಗಭೂಪ್ರದಕ್ಷಿಣಶ್ರಮಲ್\nಸುಂತಸೇದದೀರ್ಚುಕೊಂಡುಚೂಡರಂಡುಮಾಗೃಹಂ\nಅಂತಪೆದ್ದವಿಂದುಲೇವಿಅಂದಬೋರುಮೀರಿಟನ್\nಅಂತರಂಗಮಂದುಪೂರ್ತಿಆದರಾಭಿಮಾನಮುಲ್\nಸಂತರಿಂಚುಕೊಂಚುತೇಟಚಲ್ಲಬುವ್ವಪಚ್ಚಡಿನ್\nಯಿಂತಜೇರ್ಚಿಕುಡ್ವಬೆಟ್ಟಯೇಮಿಲೋಟುಲೇದುಲೇ\nಶಾಂತದಾಯಕಮ್ಮುಲೈನಸಾಧುವರ್ತನಮ್ಮುಲನ್\nಸ್ವಾಂತಮಂದುಸಂತಸಿಂಪಶಾಯಜೇಯಮೇಮಿಮುನ್ ~ ಶ್ರೀ ಸೂರ್ಯನಾರಾಯಣ ಸರಿಪಲ್ಲಿ ಗಾರಿಚೇ ವಿರಚಿತಂ."],
matta:["ಮೊತ್ತಂ ಬಾರುನ್ಮಭಮುಲು ನಿತ್ಯೋ\nದಾತ್ತಂಬೈ ಸಸ್ಫುರಿತ ಗಕಾರಾ\nಯತ್ತಂಬೈ ಷಣ್ಮಿತಯತಿ ನೊಂದುನ್‌\nಮತ್ತಾವೃತ್ತಂಬಗು ಮಹಿ? ಗೃಷ್ಣಾ!"],
tribhaMgi:["ನನನನ ನನಸಸ ಲುನು ಭಮಸಗಲುನು ದನರಿ ನಟಿಂಪ? ಗಣಂಕನ್‌ ನಲುವಂಕನ್‌ ಬೆಂಪುದೊಲಂಕನ್‌\nಮುನುಕೊನಿ ನಖಮುಖಮುನ ವೆಡ?ಗದಲುಪ? ಜನು? ಗಡುನೊಪ್ಪಗುವೀಣಲ್‌ ನೆರಜಾಣಲ್‌ ವೇಲುಪುಗಾಣಲ್‌\nವನರುಹ ಜನಿತುನಿ ತನಯುಲು ಮೊದಲುಗ ಘನಮತುಲಾದಟತೋಡನ್‌ ಶ್ರುತಿಗೂಡನ್‌ ವೆನ್ನುನಿ?ಬಾಡನ್‌\nವಿನ?ಗಲಿಗಿನ ನದಿಜನನಮು ಫಲಮನಿ -    ಮುನಿಜನು ಲಿಂದು ಶುಭಾಂಗುನ್‌ ದಗುಭಂಗಿನ್‌ ಜೆಪ್ಪು? ದ್ರಿಭಂಗಿನ್‌.","ತೆಲುಗು ಮಧುರಿಮಲು,ಪಲುಕು ಪರಿಮಳಮು ತೆಲಿಪಿನ ತಲ್ಲಿವಿ ನೀವೇ ! ಗತಿನೀವೇ ! ನಾ ಧೃತಿ ನೀವೇ !\nಸಲಿಪಿ ಪ್ರಣತುಲನು ತೆಲಿಪಿನನು ಮದಿನಿ ಪಲುಕುಲ ನೀಯಗ ರಾವಾ ! ಅಲಿಗೇವಾ ! ವಿದ್ಯಲ ದೇವೀ !\nತೆಲಿಸಿಯು ವಿಷಯಮು ಕಲತ ನಿಡುದುವಿಟು ! ಪಲುಕುಲ ಭಾಂಡಮು ಲೇದೋ ! ದಯ ರಾದೋ ! ಕೂತುನು ಕಾದೋ !\nಅಲುಕನು ವದಲುಚು ನಿಲುಪಗ ಪರುವುನು ಪಲುಕಗ ರಮ್ಮಿಕ ವೇಗನ್ ಎದ ಯೂಗನ್ ಗಂಟಮು ಸಾಗನ್\nಪಲುಕುಗತುಲನಟ ತೆಲುಪಗ ಕವಿತನೆ ತಲಪುನ ಪ್ರೇರಣ ನಿಮ್ಮಾ! ವಿಧಿಕೊಮ್ಮಾ ! ಬಂಗರು ಬೊಮ್ಮಾ !"],
vinayaM:["ವಿನಯಂ\n	ಬೊನರಿಂ\n	ತು ನನಂ\nತುನಕುನ್‌."],
biMbamu:["ಶ್ರೀಕಲಿತಾ\nಸ್ತೋಕ ಭಗಲ್‌\nಪೈಕೊನು ಬಿಂ\nಬಾಕೃತಿಕಿನ್‌.","ಪಂಚಿಭಕಾ\nರಂಬುಗಕಾ\nರಂಬುನುಗಾ\nಬಿಂಬಮಗುನ್"],
madhumati:["ವಗರು ಪಿಂದೆಲತೋ?\nಜಿಗುರು ಟಾಕುಲತೋ?\nದೊಗರು ವನ್ನೆಲತೋ?\nಮಿಗಿಲೆ ಮಾವಿತರುಲ್","ಮಧುಮತೀ ದರಿ ರಾ\nಮಧುರಮೌ ಸ್ಮೃತಿತೋ\nವ್ಯಧಲ ಬಾಪಗ ರಾ\nಸುಧಲ ನೀಯಗ ರಾ"],
madaraekha:["ಕೋದಂಡಾಗತರಜ್ಜುಲ್\nಪಾದಾಂತಮ್ಮುನಯಂದುನ್\nಮೋದಿಂಚೆನ್ ಹರಿಣಂಬುನ್\nನಾದೂಕುನ್ ಬದಿಬಾರಲ್","ರೂಪಿಂಪನ್ಮಗಣಾದ್ಯಂ\nಬೈ ಪೆಂಪಾರ ಸಗಂಬುಲ್‌\nದೀಪಿಂಚುನ್ಮದರೇಖನ್‌\nಗೋಪಸ್ತ್ರೀಹೃದಯೇಶಾ!"],
halamukhi:["ಚಿತ್ತಜಾತುನಿ ಗುರುನಿಕೈ\nಯೆತ್ತು? ಡಂಜಲು ಲನಿನಚೋ\nಸತ್ತುಗಾ ರನಸಮುಲೊಗಿನ್‌\nಬೊತ್ತುಗಾ ಹಲಮುಖಿ ಯಗುನ್‌.","ಎಂತಲೇಸಿಕುಟಿಲುಲು ರಾ\nವಿಂತಲೈನವಲಪುಲು ರಾ\nಜಂತಲಿಂಕ ತೆಲಿಯುನು ಲೇ\nಸ್ವಾಂತಮಂದುಶಿಖುಲೆಗಯನ್"],
upajaati:["ಪಿನಾಕಿಕೋದಂಡಮು ಬಿಟ್ಟು ದ್ರುಂಚೆನ್‌\nದಾನೊಪ್ಪಗೆಲ್ಚೆನ್‌ ಜಮದಗ್ನಿ ಸೂನುನ್‌\nಅನಂತಸತ್ತ್ವುಂ ಡಿತ? ಡಂಚು ಮೆಚ್ಚನ್‌\nಜಾನೈನ ವೃತ್ತಂ ಬುಪಜಾತಿ ಯಯ್ಯೆನ್‌."],
iMdravaMSamu:["ಸೊಂಪಾರ ನೀ ದೇವುನಿ ಸೂನು?ಡೈ ಕದಾ\nಱಂಪಿಲ್ಲೆ? ಬುಷ್ಪಾಸ್ತ್ರು?ಡು ಱಾ?ಗ ಯೌನನನ್‌\nಇಂಪಾರ ಭೂಭೃದ್ಯತಿ ನಿಂದ್ರವಂಶಮುನ್‌\nಬೆಂಪಾರ? ದಾಜಂಬುಲ? ಬೇರ್ಚು ರೇಫತೋನ್‌.","ಆಕಾಶಮಂದೈನ? ಗಟಾಚವಂದರಂ\nಗಾಕೀರ್ಣ ಘೋರಾಕೃತಿಯಾಡನೀಯಕೇ\nರೇಕೈನ ಱೆಕ್ಕನ್ವಿನಿ ಕೃತ್ತಶಕ್ತಿಯೈ\nಕಾಕಂಬು ವಿಷ್ಣ್ವಾಶಪೊಕಾರಿಪೋವ?ಗಾ"],
aparaajitamu:["ಮುನಿಜನವಿನುತುಂ ಡಮೋಘಜಯೋನ್ನತುಂ\nಡನಿತರಸದೃಶುಂ ಡನಂಗ ಗುರುಂ ಡನಂ\nಜನು ನನಯುತಮೈ ರಸಂಬು ಲಗಂಬುಲೈ\nತನರ?ಗ ನಪರಾಜಿತಂ ಬಹಿರಾಡ್ಯತಿನ್‌.","ನನರಸಲಗಮುಲ್ ಪೆನಂಗಿನಸದ್ಯಶೋ\nಧನವಿನುಪರಾಜಿತಂಬಗುರೇಚನಾ\nನನರಸಲಗಮುಲ್ ಪೆನಂಗಿನಸದ್ಯಶೋ\nಧನವಿನುಪರಾಜಿತಂಬಗುರೇಚನಾ"],
asaMbaadha:["ಕೋಟುಲ್ ಲಕ್ಷಲ್ ದಾನವಬಲಮುಲು ಕ್ಷೋದಿಂಪನ್\nನೀಟುಲ್ ಗೋಟಿಲ್ ಸಾಗವು ಪೊಸಗದು ನಿಲ್ವಂಗನ್\nದಾಟೀಘೋಟೀಘಟ್ಟನಶಕಲಿತದರ್ಪಂಬೌ\nನಾಟೋಪಂಬುನ್ ಜೂಪ?ಗ ವೆಲ?ದುಕ ಯನ್ನಟ್ಲಾ","ಸೌಮ್ಯಂಬೈ ವಿಷ್ಣುಸ್ತುತುಲನು ನತಿ ಸೇವ್ಯಂಬೈ\nರಮ್ಯಸ್ಫೂರ್ತಿನ್‌ ರುದ್ರವಿರಮಣಮು ರಮ್ಯಂಬೈ\nಗಮ್ಯಾಕಾರಂ ಬೊಪ್ಪು ಮತನಸಗಗಪ್ರಾಪ್ತಿನ್‌\nಸಮ್ಯಗ್ಭಾವಂಬೈ ಪೊಲುಪಮರು ನಸಂಬಾಧನ್‌."],
kamalavilasitamu:["ನಗಣಮು ನಗಣಮು ನಗಣಮು? ಜೇರನ್\nನಗಣಮು ಗಗಮು ನೊನರ ನಟ ಮೀ?ದನ್\nದಿಗಿ ಭ ವಿರಮಣಮು ದಿರಮಗುನೇನಿನ್\nದಗು?  ಗಮಲವಿಲಸಿತಮು ಕಮಲಾಕ್ಷಾ","ಕ್ರಮಮುನ ನನನನಗಗಮುಲು ಗೂಡನ್\nಗಮಲವಿಲಸಿತಮು ಕಮಲಜವಿಶ್ರಾ\nಮಮು ಜಗತಿನಿ ನಗು ಮಹಿತಚರಿತ್ರಾ\nಕಮಲದಳನಯನ ಕಡು? ಬೊಗಡೊಂದುನ್."],
sukaesaramu:["ನನಲು ಚಿವುಳ್ಳು ವಹ್ನಿಪರಿಣಾಮಮೂರ್ತುಲೈ\nಯನಲಮು ಲಂಟುಕೊನ್ನ? ದಮವೈನ ಯಾಕೃತುಲ್\nಕೊನಕೊನಿ ಮಾರೆಗಾನಿ ಮಱಿಕೋಲುಪೋವು ನೈ\nಜನಿಭೃತಮೈನ ವನ್ನಿಯಲ ಜಾಲಿ ತೋಟಲನ್","ಯತಿಯವತಾರಸಂಖ್ಯ ನಿಡಿ ಯಾದರಂಬುತೋ\nನತಿಶಯಮೈ ನಜಂಬುಲು ಭಜಾಂತರೇಫಲುನ್‌\nವಿತತಮುಗಾ ನೊನರ್ಚಿ ಯರವಿಂದಲೋಚನುನ್‌\nಕ್ಷಿತಿಧರು ಸಂಸ್ತುತಿಂಚಿನ ಸುಕೇಸರಂಬಗುನ್‌."],
hariNi:["ಹರಿಣಿಯನು ವೃತ್ತಂಬೊಪ್ಪುನ್ ಭಾಸ್ಕರಾತ್ತವಿರಾಮಮೈ\nಸರಿನಮರೇಫಸ್ವಂಬೈ ಷೋಡಶಪ್ರಮದಾಸಹ\nಸ್ರರಮಣು? ದೃಣಾವರ್ತಕ್ರವ್ಯಾದಸಂಹರು ಮಸ್ತಕೋ\nಪರಿರುಚಿಪಿಂಛಾಚೂಡುಂ ಬೀತವಸ್ತ್ರು ನುತಿಂಪ?ಗಾ","ಜರಗು ನಸಮಪ್ರೋದ್ಯದ್ರೇಫಲ್‌ ಸಸಂಗತಮೈ ಲಗಲ್‌\nದೊರಯ?ಗ ಮುರದ್ವೇಷಿನ್‌ ಸದ್ಭಕ್ತಿತೋ ವಿನುತಿಂಚೆದನ್‌\nಸರಸಿರುಹಗರ್ಭೇ ಶಾನಾದಿತ್ಯಸತ್ತಮು ನನ್ನಚೋ\nಹರಿಣಿ ಯನುವೃತ್ತಂ ಬೊಪ್ಪಾರುನ್‌ ಬುರಾರಿ ವಿರಾಮಮೈ."],
kusumitalataavaellita:["ಶ್ರೀನಾಥುನ್‌ ಬ್ರಹ್ಮಾದ್ಯಮರವರ ಸಂಸೇವ್ಯಪಾದಾರವಿಂದುನ್‌\nದೀನಾನಾಥವ್ರಾತಭರನು ಗುಣೋದೀರ್ಣುನಿಂ ಬಾಡಿ ವೋಲಿನ್‌\nಗಾನಾರೂಢಾತ್ಮುಲ್‌ ಮತನಯಯಯಲ್‌ ಕಾಮಜಿದ್ವಿಶ್ರಮಂಬೈ\nವೀನುಲ್‌ ನಿಂಡಾರಂ ಗುಸುಮಿತಲತಾವೇಲ್ಲಿತಾವೃತ್ತಮೊಪ್ಪುನ್‌."],
aMburuhamu:["ತಾರತುಷಾರ ಪಟೀರ ಮರಾಳ ಸುಧಾಸಮಾನ ಮಹಾಯಶಾ\nನೀರದಭೃಂಗ ತಮಾಲದಳಾಸಿತನೀರಜೇಂದ್ರ ಮಣಿದ್ಯುತೀ\nಹಾರ ಕಿರೀಟ ಮುಖಾಭರಣಾಂಚಿತ ಯಂಚು ಶ್ರೀಪತಿಗೂರ್ಚಿ ಭಾ\nಭಾರಸವಂಬುಲ ಭಾನು ವಿರಾಮಮು? ಬಲ್ಕ ನಂಬುರುಹಂಬಗುನ್‌.","ದೇವಕುಲಾರ್ಚಿತದೇವಶಿರೋಮಣಿದೇವದೇವಜಗತ್ರಯೀ\nಪಾವನಮೂರ್ತಿಕೃಪಾವನಮೂರ್ತಿವಿಭಾವನಾಕುಲಚಿತ್ತರಾ\nಜೀವಮುಧವ್ರತಜೀವದಶಾಪರಿಚೇಷ್ಟಿತಾಖಿಲಲೋಕಲ\nಕ್ಷ್ಮೀವದನಾಸವಶೀತಲಸೌರಭಸೇವನಾಂಚಿತಜೀವನಾ"],
aSvalalitamu:["ಇನವಿರಮಂಬುನನ್ ನಜಭಜಂಬುಲಿಂಪುಗ ಭಜಂಬುಲುನ್‌ ಭವಮುಲೈ\nಚನ? ಜನನೊಪ್ಪು ನಶ್ವಲಲಿತಂಬು ಸತ್ಕೃತುಲ? ಜೆಪ್ಪ?ಗಾ ವಿಶದಮೈ\nಯನುಪಮವೈಭವೋಜ್ಜ್ವಲ ಹರೀ ಸಹಸ್ರಕರದೋರ್ವಿದಾರಣಚಣಾ\nನಿನು?ಗೊನಿಯಾಡ ಧನ್ಯು?ಡು ಗದಯ್ಯ ನೀ ಕರುಣ ದಾನನಂತ ಮಗುಟನ್‌.","ಇರುದೆಸಲಂದುರಜ್ಜುವುಲುಗಟ್ಟಿಯಿಟ್ಟಟುಲಲಾಗುನಟ್ಟಿವೆರವೈ\nತುರಗಚಯಂಬುಘೋರಖರರಾಜಿ ತ್ರೋಲ?ಗನು ದ್ರಾಳ್ಳು ವ್ರೀಲಿಚನಿನನ್\nಖರತುರಗಂಬುಲಂಗ್ರಮಮುನೇಗಿಘಾಢಮುಗಗೋಡಲಂದು?ಡುನಗನ್\nತಿರಿಗಿಸುರಾರಿಬಾಹುವುಲುಗಾನಿ ದೇಹಮುನುಗಾನಿಸುಂತಚೆಡದುನ್ "],
ashTamoorti:["ಶ್ರೀನಾಥುನ್‌ ಸರಸಿಜಾಕ್ಷುನ್‌ ಸಿತಸರೋಜಾತನಾಭುನ್‌ ಜಿತನಿಶಾಟವರೇಣ್ಯುನ್‌\nಗಾನೋದಂಚಿತರಸಜ್ಞುಂ ಗರಿಭಯಧ್ವಾಂತಭಾನುನ್‌ ಗನಕವಸ್ತ್ರವಿಲಾಸುನ್‌\nಜಾನೊಂದನ್ಮನತಯುಕ್ತಿನ್‌ ಸರಭಜಲ್‌ ಯಾಂತಮೈ ಕುಂಜರಯತಿದ್ವಯ ಮೊಪ್ಪಂ\nಗಾ ನಿಟ್ಲೊಂಪೆಸ?ಗ? ಜೆಪ್ಪೆಂ ಗವಿಜನಂ ಬಷ್ಟಮೂರ್ತಿನ್‌ ಘನಸಮಾಗಮರೀತಿನ್‌.","ನಾಕ್ಪೃಗ್ವೀವಿಧಿತಿನೇಗುನ್‌ನತಮಹಾಸಾರಮಾಗುನ್‌ನಗಮಹಾಕೃತಿಜೋಗುನ್\nಬಾಕಾರಿಪ್ರಮುಖಸೌರಪ್ರಣತಿ ಗಂಭೀರರೇಖಾಪ್ರವಿಮಲಾಧುತತೇಜಃ\nಪ್ರಾಕಾರಾಂತರನಿಗೂಢಪ್ರಚಲನಾಭೋಗಧರ್ಮಪ್ರಸರಣಾಂಚಿತಮೂರ್ತಿನ್\nಲೋಕಾಲೋಕಕುಧರಾಂಭೋಲುಲಿತಪರ್ಯಾಯಮೂರ್ತಿನ್ ಲುಠನಮಂಥರಮೂರ್ತಿನ್ "],
manOharamu:["ಕ್ಷ್ಮಾರಾಜ ರಮೇಶ ಜತಾವಮು ಲು\nದ್ಧುರ ಮೈನಸಕಾರಚತುಷ್ಕಮುತೋ?\nಗೂರಂಗ ಸಗಂಬುಲು ಗೂಡಿ ಮನೋ\nಹರವೃತ್ತಮು ಚೆಲ್ವಗು ನದ್ರಿಧರಾ!"],
aMgajaastramu:["ಭೂರಿಭಮಂಬುಲ್‌ ಪೊಂದು ಸಗಂ ಬಿಂ\nಪಾರ?ಗ ನರ್ಥಂಬೈ ಯಟಸಾಮುನ್‌\nಶೌರೀ ವಿನ್ಮಸಜಂಬು ಗಾಂತಮೈ\nಯಾರೂಢಂ ಬಗು ನಂಗಜಾಸ್ತ್ರಮುನ್‌.","ದಾನಬಲೇಂದ್ರೋದಾರಭಮಂಬುಲ್\nಪೂನಿಸಗಾ ಪ್ತಿಂ ಬೊಂಪಿರಿವೋವನ್\nಜಾನಾರನ್ಮಸಜಂಬು ಗಸ್ಥಿತಂ\nಬೈ ನೀಜಂಜನು ನಂಗಜಾಸ್ತ್ರ ಮೈ."],
rathagamanamanOharamu:["ರಥಗಮನ ಮನೋಹರಂಬು ರೆಂಡವಘ್ರಿನ್‌\n	ಪ್ರಥಿತಂ ಬಗುನ್‌ ಸಜಜಂಬು ರಪ್ರಯುಕ್ತಯಂಬುನ್‌\nಪ್ರಥಮಪದಮುನಂದು? ಬೈಸಗಂಬುನಂದುನ್‌\nಗಥಿತನನರಜಂಬು ಗದ್ವಯಂಬು? ಗೃಷ್ಣಾ!"],
veeNaarachanamu:["ವೀಣಾರಚನಂ ಬಯ್ಯೆ ಭುವಿನ್‌ ತಯಸಾಗಲ್‌\nಬಾಣಪ್ರಹರಾ ತಜನಭಭವ್ಯಗಗಂಬುಲ್‌\n	ಚಾಣೂರಹರಾ ತಜನಭಸ ಲ್ಪ್ರಕಟಯತಿನ್‌\nವೇಣುಧರ ಭನನಭಸವಿಶ್ರುತ ಮಗುಚುನ್‌."],
kumaari:["ಸಕಲಮುನೀಂದ್ರಬೃಂದಹೃದಯಾಬ್ಜರವಿಮ್\nಪ್ರಕಟಿತಭಕ್ತರಕ್ಷಣಚಣಾಗ್ರಸರಮ್\nವಿಕಚಸರೋಜಸುಂದರದರಸ್ಮಿತಕಮ್\nಪ್ರಕೃತಿವಿಭಾಸುರಂ ಭವ! ಭಜಾಮಿ ಸದಾ!"],
kumaaralalita:["ಕುಮಾರಲಲಿತಕುನ್\nಸಮಗ್ರಜನಗಮುಲ್.\nಕುಮಾರಲಲಿತಕುನ್\nಸಮಗ್ರಜನಗಮುಲ್."],
kOmalavRttamu:["ಸಲಲಿತರೀತಿ ನಜಾಯಗಣಂಬುಲ್\nಚಳುಕ್ಯಭೂಪ ಜಭಸಜಸ್ಥಗಸ್ಥಿತಿನ್\nಮಲಯುಚು ನರ್ಥಸಮರ್ಥತಚೇತ\nನ್ವೆಲುಂಗ? ಗೋಮಲಿ ಯನು ವೃತ್ತ ಮೊಪ್ಪಗುನ್."],
paNavamu:["ನೀಯುಲ್ಲಂ ಬೊಕನಿಯತಿಂ ಗಾರ್ಯಂ\nಬಾಯತ್ತಂಬುಗ ನನುಸಂಧಿಂಪಂ\nಜೇಯಂಜಾಲವು ಚೆಡುತೆರ್ವುಂ ಬೋ\nಬಾಯಂದ್ರೋಯವು ಬಲಿಮಿಂ ಬುತ್ರುನ್","ಆರಂಗಾ ಮನಯಗಸಂಯುಕ್ತಿನ್‌\nಸಾರೋದಂಚಿತಶರ ವಿಶ್ರಾಂತಿನ್‌\nಶ್ರೀರಾಜುಂ ಬೊರಸಿನ ನತ್ಯಂತ\nಸ್ಫಾರಂಬೈ ಚನು ಪ್ರಣವಂ ಬುರ್ವಿನ್‌.","ಅಂದಂಬೈ ಮನಯುಗಮುಲ್ ಸೊಂಪಿಂ \n ಪಂ ದಪ್ಪೊಂದಕ ಪಣವಂ ಬಯ್ಯೆನ್."],
suralata:["ಶಶಿವದನಾಭನ್\nಶಶಧರು?ಡೋಟನ್\nದಶ?ಜೂಟನ್\nವಿಶಯಮುನಂದೆನ್","ಸುರಲತ? ಜೆಪ್ಪನ್ \n ಸೊರಿದಿ ನಯಂಬುಲ್.\nಸುರಲತ? ಜೆಪ್ಪನ್ \n ಸೊರಿದಿ ನಯಂಬುಲ್."],
sumaMgali:["ಕರುಲನ್ ಸುಮಂಗಲಿ ಕದಾ ಸಜಸಾಗಾಲನ್\nಕರುಲನ್ ಸುಮಂಗಲಿ ಕದಾ ಸಜಸಾಗಾಲನ್\nಕರುಲನ್ ಸುಮಂಗಲಿ ಕದಾ ಸಜಸಾಗಾಲನ್\nಕರುಲನ್ ಸುಮಂಗಲಿ ಕದಾ ಸಜಸಾಗಾಲನ್"],
karibRMhitamu:["ಮೂ?ಡು ಭನಮುಲು ರೇಫಮುನು ಬದುಮೂ?ಟ ವಿರತಿಯು ಸೊಂಪುಗಾ?\nಗೂಡುಕೊನ? ಗರಿಬೃಂಹಿತಮು ಸಮಕೂರ್ಚಿ ವಸುಮತಿಮಂಡಲಾ\nಪೀಡ ಮನು ಕರಿಬೃಂಹಿತರವಮು ಪೆಲ್ಲುಗ? ಬಲುಕುಚುಂಡ?ಗಾ?\nಗೋಡಿಗಪು? ಜಿನನಾ?ಡು ಶಕಟುನಿ? ಗೂಲ್ಚಿನ ಹರಿ ನುತಿಂಚೆದನ್.","ಉತ್ತರದಿಶಕು?ಬೋಯಿತಿ ಹಿಮವ ದುರ್ವಿಧರಮುನವಾಲಿಯೈ\nಕತ್ತಳಮನುಚು?ಬೋಯಿಪರುಗುನ? ಗ್ರೌಂಚಗಿರಿಪಯಿವಾಲಿಯೈ\nಜೊತ್ತಿಲನಡುಗುದೋಯಿತುದಿಕೊಸಸೋಮಗಿರಿಪಯಿವಾಲಿಯೈ\nತತ್ತರಪಡುಚುವೇರುದೆಸಮದಿತಟ್ಟಕಮುಡುಗುಚುಂಡ?ಗಾ."],
kanakaprabha:["ಧನಮಂತಯುಂ ಬೊಲಿಯ ದಾರಣಂಬುಗಾ\nದನಯ ವ್ರಜಂಬುದೆಗ ದೈನ್ಯಮಾರ?ಗಾ?\nದನಬಂಧುಲಂದಱು ಮೃತಂಬು? ಬೊಂದ ನೆ\nವ್ವನಿನೈನ ಶೋಕಮನು ವಹ್ನಿಗಾಲ್ಪದೇ","ಕನ ನೇಡು ನಿಂಡೆ ಕನಕಪ್ರಭಾ ದ್ಯುತುಲ್\nವನಭೂಮಿ ರಂಗುಲ ತಿವಾಸಿ ಯಯ್ಯೆನೇ\nತನರಾರೆ ಕನ್ನೆದುಟ ತಾಮ್ರಪರ್ವತಂ\nಬನಿಶಮ್ಮು ಖೇಚರಮು ಲಾಕಸಮ್ಮುಲೋ"],
viyOgini:["ಮುದ ಮೆಕ್ಕಡ ಮ್ರೋಡು ನೇ ವನಿನ್\nನಿದುರೇ ಲೇದುಗ ನೇ ವಿಯೋಗಿನಿನ್\nಮಧುಮಾಸಪು ಮೈಕ ಮೆಪ್ಪುಡೋ\nಸುಧತೋ ನೂತನಶೋಭ ಲೆಪ್ಪುಡೋ "],
ajitaprataapamu:["ಸಜಸಾಗಣಾವಲಿ? ಬ್ರಸನ್ನ ನಭಾ\nಗ್ರಜರಪಂಕ್ತಿ ನಭಿರಾಮರೂಪಮೈ\nಯಜಿತಪ್ರತಾಪಚೆಲುವಾರು? ಗೃತಿ\nನ್ವಿಜಯವಿಕ್ರಮಣ ವಿಶ್ವಭೂವರಾ"],
aMbuja:["ಇಂಬಗು ಭಕಾ\nರಂಬುನು ವಕಾ\n	ರಂಬುನು ಜುಮೀ\nಯಂಬುಜ ಮಗುನ್.","ಇಂಬುಲಭಕಾ\nರಂಬುನು ಲಗಂ\nನುಂ ಬೊನರಗಾ\nನಂಬುಜಮಗುನ್","ವಂದಿಂತುನು ನೇ\nನಂದಾತ್ಮಜುನಾ\nನಂದಂಬುನ ಸ್ವ\nಛ್ಚಂದಪ್ರಣತಿನ್"],
tripadi2:["ತ್ರಿಪದ ನೀಯಗಮನ್ನ ಇಪುಡು ಕಾದನೆದವಾ !\nತ್ರಿಪದ ಪೇರುನ್ನ ದೇವಿವಯಿ\nಕೃಪಜೂಪವಾ ಕೀರವಾಣಿ !","ಮೂಡು ಪಾದಾಲೆ ನನ್ನೇಡಿಪಿಮ್ಚೆ ನಿಟುಲ !\nವಾಡಿಪೋವಗ ಮೋಮು ಯಂತ\nಮೂಡು ಅಂತಯು ಮಾರಿ ಪೋಯೆ !","ಕಪಟ ನಾಟಕಮಾಡು ನಿಪುಣತ ಉಮ್ದನಿ ,\nತಪನ ನೊಮ್ದಗಜೇಸಿ ಸುತನು ,\nಇಪುಡು ಜಾರಗ ಜೇಸಿನಾವ !","ಏಮಿ ಪಾಟುಲೆ ತಲ್ಲಿ ನೀ ಮಾಟ ಕೊಱಕಿಟ !\nಪ್ರೇಮ ಜೂಪಗ ರಾವೆ ಯನ್ನ\nಬಾಮು ಲಿಚ್ಚೆದವೇಮಿಟಮ್ಮ !","ಚಾಲು ಚಾಲುಲೆ ಆಟ, ಚಾಲುಲೇ ನೇಟಿಕಿ\nವೇಳ ಮೀರಿನದೆಂತೊ ! ವೆಳ್ಳಿ\nವಾಲ ವಲೆನೆ ಪಾನ್ಪು ಪೈನ .","ಸರವಿ? ಬ್ರಾಸಮುನೊಂದಿ ಸುರಪತುಲ್‌ ನಲುವುರು\nಹರಿಯು ಗೈ ಕಾರ್ಕುಲು ಕಲಿಯ\nಜರಗು ನಿಪ್ಪಗಿದಿ ಯೈ ತ್ರಿಪದ."],
utkaLika:["ಭುವನಸುವನ ಫಲಮು ಲಲಮಿ\nಜವನಪವನ ಬಲಮು ಕಲಿಮಿ\nಯೆದಲು ಪೊದಲ ಮರಗಿ ತಿರಿಗಿ\nಚದಲ ತುದಲ ಕರಿಗಿ ಪೆರಿಗಿ\nಪೇಪುಮಾಪು ಮಿಂಚಿ ಪೊಂಚಿ\nರೂಪು ಚೂಪಿ ಸಂಚರಿಂಚು\nಯೋಗರಾಗ ಕೀರಮುನಕು\nಯಾಗಭಾಗ ಸಾರಮುನಕು"],
vijayabhadraragaDa:["ಶ್ರೀಕಿ ನೊಡಯಂ ಡನ?ಗ? ಜಿತ್ತಜುನಿಗುರು? ಡನ?ಗ    ಶೇಷಶಯನುಂ ಡನ?ಗ? ಜೆಲುವುಗ? ಜತುರ್ಭುಜು?ಡು\nನಾಕೌಕಸುಲ ನೇಲು ನಮುಚಿಸೂದನುವೂಜ    ನತ?ಡು ದಾ?ಗೈಕೊನ್ನ ನಂದಗೋಪಾತ್ಮಜು?ಡು\nಇತನಿ? ಗೊಲ್ಚಿನ? ಗಾನಿ ಯಿಹಪರಂಬುಲು ಗಲುಗ    ವಿತರಸೇವಲ ನನ?ಗ ನೆಸ?ಗು ನಿವ್ವಿಭು? ಡಂಚು?\nಜತುರಮತು ಲೊನರಿಂಪ ಜಯಭದ್ರರಗಡ ಲಿಟು    ಸದ್ದ್ವಿರದಗತಿ ರೆಂಟ? ಜಾಟಿಂಪುಲಂ ಬೆಂಚು"],
haMsagatiragaDa:["ಮಱಿಯುನು ಗ, ಟಾಕ್ಷಜಿತ - ಮಾರುನಂದು\nತಱಿ ತ್ರಾಡು, ಸೊಮ್ಮಗು ನು - ದಾರುನಂದು."],
vRshabhagatiragaDa:["ಶ್ರೀಮನೋಹರು ನಂಬುಜೋದರು?    ಜಿತ್ತಜಾತಗುರುಂ ದಲಂಚೆದ?\nಗಾಮಿತಾರ್ಥವಿಧಾಯಿ ನಿರ್ಜಿತ    ಕಾಳಿಯಾಹಿನಿ ನಾಶ್ರಯಿಂಚೆದ\nನನುವುಗಾ ಭಗಣಮುಲು ಭಾನುಸ    ಮನ್ವಿತದ್ವಿತಯಮುಲು ನಾಲುಗು\nನನಿಮಿಷಾಧಿಪಲಘುಯತಿನಿಡ?ಗ    ನಲರುವೃಷಭಗಮನಮು ಮೇಲಗು."],
dviradagatiragaDa:["ಶ್ರೀಯುವತಿ ನಿಜಯುವತಿ? ಜೇಸಿ ಯೆಂತಯು ಮಿಂಚಿ\nಕಾಯಜುನಿ? ದನತನಯು? ಗಾ ನೆಲಮಿ? ಬಾಟಿಂಚಿ\nಸಕಲ ದೇವತಲ? ಬರಿಜನುಲುಗಾ ಮನ್ನಿಂಚಿ,\nಪ್ರಕಟಗತಿ ಶ್ರುತುಲ ನುತಿಪಾಠಕುಲ? ಗಾವಿಂಚಿ\nಹರಿ ಯೊಪ್ಪು ನನ ನೊಪ್ಪು ನವತಾರ ಲಘುವಿರತಿ\nಶರದಿ ನಗನಲಲಭಲಸಲತರಲ ದ್ವಿರದಗತಿ."],
hariNagatiragaDa:["ಶ್ರೀನಿವಾಸು ಭಜಿಂತು ನೇ ನನಿ \nಪೂನಿ ಕುಜನುಲಪೊಂತ ಬೋನನಿ","ಭಾನುಯುತನಲಭಸಗಗಂಬುಲ \n ಲೋನನಿರುದೋಲುನನಗಂಬುಲ","ನಿರವುಗಾ ನಿರುಮಾಱುಲಘುವುಲ \n ನೆಲ್ಲವಾರುನು ನೊಗಿ ಗಣಿಂಪ?ಗ","ವಿರತುಲನು ಗಾವಿಂಪನಿಮ್ಮುಲ\n ಹರಿಣಗತಿ ಚೆಲುವಗು ಜಗಮ್ಮುಲ."],
harigatiragaDa:["ಶ್ರೀರಾಮಾಕುಚಕುಂಕುಮಪಂಕಮು ಚೇ? ಬೊಲುಪಗು ವಿಪುಲೋರಃಫಲಕಮು\nತಾರತುಷಾರಪಟೀರಸಮಾನೋ ದಕವಾಹಿನಿ ಯೊದವಿನ ಪದಕಮಲಮು\nನತಿಶಯ ಮೈ ಯಲವಡು ನೇದೇವುನಿ    ನನವರತೋದಾರತ ನಾಹರಿಗತಿ\nಯಿತರುಲ ಕಲವಡ ದನಿ ನೃಪ ಲಘುಯತಿ ನಿಭನಲಗಗಭಸಲ ನಗುನು ಹರಿಗತಿ."],
madhuragatiragaDa:["ಶ್ರೀವನಿತಾಧಿಪು? ಜೇರಿ ಭಜಿಂಪು?ಡು\nಭಾವಜ ಜನಕುನಿ ಭಕ್ತಿ? ದಲಂಪು?ಡು\nಅನಿ ಗಗನಲಭಸಲನು ನಾಲ್ಗಿಟ? ಗೃತಿ\nಜನು ಗಜಲಘುವಿಶ್ರಮಮು ಮಧುರಗತಿ."],
vijayamaMgaLaragaDa:["ಶ್ರೀಧರಾಯ ಶಿಷ್ಟಜನನಿಷೇವಿತಾಯ ಭಕ್ತಲೋಕ ಜೀವಿತಾಯ ಗರ್ವಿತೋರುಸಿಂಧುರಾಜಬಂಧನಾಯ\nಗಾಧಿಪುತ್ರಯಜ್ಞ ವಿಘ್ನಕರಮಹಾಸುರೀಮಹೋಗ್ರ ಕಾಯ ಶೈಲದಳನ ನಿಪುಣ ಘನ ಸುರಾಧಿಪಾಯುಧಾಯ","ಕೇಶವಾಯ ತೇ ನಮೋ?ಸ್ತು ಕೃಷ್ಣ ಪಾಹಿಪಾಹಿ ಯನು?ಚು ಗೇಲುಮೊಗಚಿ ಮೌಳಿನುನಿಚಿ ಕೃಷ್ಣು? ಬಲಿಕೆನನುಚುನಿಟ್ಲು\nದೇಶಭಾಷಣಮುಲ? ಜೆಪ್ಪ ದ್ವಿಗುಣತುರಗವಲ್ಗನಮುನ? ದೇರು ವಿಜಯಮಂಗಳಂಬು ತೀಯಚೆಱಕು ರಸಮುನಟ್ಲು."],
hayaprachaararagaDa:["ತೆಲ್ಲಗ ಪಡೆ ತಿನ್ನಗ ಪಡೆ\nಮೆಲ್ಲಗ ಪಡೆ ಮೃದುವುಗ ಪಡೆ\nಚಲ್ಲಗ ಪಡೆ ಚಕ್ಕಗ ಪಡೆ\nವೆಲ್ಲಗ ಹಿಮ ವೃಷ್ಟಿಯು ಪಡೆ","ಹನಚತುಷ್ಟಯಂಬು ಋತುಲ\nಜನಿತಯತುಲ ಜರಗು? ಗೃತುಲ?\nಜನು ಹಯಪ್ರಚಾರ ರಗಡ\nವಿನುತಶಾಸ್ತ್ರವಿಧುಲು ವೊಗಡ."],
turagavalganaragaDa:["ದಶರಥಾವನೀಶ ವಿಮಲತರ ತಪಃಫಲಾವತಾರ\nನಿಶಿತ ಶರ ಲಘುಪ್ರಯೋಗ ನಿಹತ ತಾಟಕಾ ವಿಹಾರ\nಕಪಟ ಪಟು ಸುಬಾಹು ದಶನ ಘಟಿತ ಗಾಧಿಸೂನು ಯಾಗ\nಅಪರಿಮೇಯ ಗೌತಮಾಂಗನಾಘ ದಮನ ಪದ ಪರಾಗ\nಕೋಮಲೇಕ್ಷು ದಳನ ಸದೃಶ ಘೋರ ಶಂಭು ಚಾಪ ಭಂಗ\nಭೂಮಿಜಾ ವಿವಾಹ ವಿಭವ ಪೂರ್ಣ ಸಮ್ಮದಾಂತರಂಗ\nಪರಶುರಾಮ ಗರ್ವ ಪವನ ಪಾಪ ಪೀನ ಬಾಹು ನಾಗ\nಗುರು ವಚೋ?ನುಪಾಲ ನಾತಿ ಕುತುಕ ವಿಧುತ ರಾಜ್ಯಭೋಗ\nಪಾದ ಭಜನ ವಿತರಣಾತಿ ಫಲಿತ ಗುಹ ಸಮಸ್ತ ಪುಣ್ಯ\nಪಾದುಕಾ ಪ್ರದಾನ ವಿಹಿತ ಭರತ ಸೌಹೃದಾನುಗುಣ್ಯ\nಘನ ವಿರಾಧ ಮದ ವಿನಾಶ ಕಲಿತ ಬಹು ವಿಪನ್ನಿರಾಸ\nವಿನುತ ಪದ ನಿವೇಶ ಪೂತ ವಿವಿಧ ಮೌನಿ ಕುಲ ನಿವಾಸ\nತತ ನಿಶಾಚರೀ ವಿರೂಪತಾ ಕೃತಪ್ರಿಯಾ ವಿನೋದ\nಅತುಲ ಬಲ ಖರಾದಿ ದನುಜ ಹನನ ಜನಿತ ವಿಬುಧ ಮೋದ\nಹರಿಣ ರೂಪ ಧಾರಿ ದಾರು ಣಾಸು ರಾಸು ಹರಣ ಬಾಣ\nಪರಮ ಘೋರ ಬಾಹುಬಲ ಕಬಂಧ ಮರ್ದನಪ್ರವೀಣ\nಅಮಲ ಶಬರಿಕಾ ಫಲೋಪಹಾರ ರುಚಿ ಘನಾಭಿಮುಖ್ಯ\nಸಮದ ವಾಲಿ ದರ್ಪ ದಮನ ಸಫಲಿತಾರ್ಕ ತನಯ ಸಖ್ಯ\nಶರಣ ವರಣ ಪರ ಪರಾನುಜಪ್ರದೀಪಿತಪ್ರಸಾದ\nಅರುಣಿತಾಕ್ಷಿ ಕೋಣ ವಿರಚಿತಾಂಬುರಾಶಿ ಗರ್ವ ಸಾದ\nಪರ್ವತೌಘ ರಚಿತ ಸೇತು ಬಂಧ ಸುತರ ಸಿಂಧು ಕಾಂಡ\nಗರ್ವ ಪಂಕ್ತಿಕಂಠ ಕಂಠ ಖಂಡನಪ್ರಚಂಡಕಾಂಡ\nಸಕಲ ದಿವಿಜ ನುತ ಚರಿತ್ರ ಸಾಧು ಭವ ಲತಾ ಲವಿತ್ರ\nಸಕರುಣಾ ತರಂಗ ನೇತ್ರ ಜಾನಕೀ ಮನೋಜ್ಞ ಗಾತ್ರ\nಯತಿ ಜಪಾರ್ಹ ಪುಣ್ಯ ನಾಮ ಯತಿ ವಿತೀರ್ಣ ಭಕ್ತ ಕಾಮ\nಸತತ ಸಿತ ಯಶೋ?ಭಿರಾಮ ಸರ್ವಲೋಕ ಪೂರ್ಣ ಧಾಮ\nಅಹಿತ ವಿದಳ ನಾತಿ ರೌದ್ರ ಯಾರ್ತ ಪಾಲನಾ ವಿನಿದ್ರ\nಮಹಿತ ನಿಖಿಲ ಗುಣ ಸಮುದ್ರ ಮಮ್ಮು ಬ್ರೋವು ರಾಮಭದ್ರ"],
mutyaalasaramu2:["ಚೆಲಿಯ ಬಂಗರು ಚೆಲಿಮಿ ಬಂಗರು\nವಲಪು ಬಂಗಾರಮನಿ ಚೆಬಿತಿವಿ\nಚೆಲಿನಿ ಚೂಡವು ಕಾದು ಸರಿ ಯಿದಿ\nಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ","ಕಲತ ನಿದ್ದುರಲೋನ ಕಂಟಿನಿ\nಕಲುವ ಕನ್ನುಲ ವಾನಿ ಕಲಲೋ\nನುಲಿಕಿ ಪಡಿ ಲೇಚಿತಿನಿ ನೇನಿಟ\nಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ","ವೆಲಿಗೆ ನಾಕಾಶಮುನ ತಾರಲು\nವೆಲಿಗೆ ನಾಕಾಶಮುನ ಚಂದ್ರುಡು\nವೆಲುಗು ನವ್ವುಲ ರೂಪು ಚೂಪರ\nಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ","ಪಲುಕು ವಜ್ರಪು ತುನಕಲಾ ಹರಿ\nಪಿಲಿಚಿ ಯಲಸಿತಿ ಪಿಲುಪು ವಿನದಾ\nಚಿಲುಕರಿಂಚಗ ಸುಧಲ ವಡಿ ರಾ\nಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ"],
bhaamineeshaTpada:["ಚೆಲಿಯ ಬಂಗರು ಚೆಲಿಮಿ ಬಂಗರು\nವಲಪು ಬಂಗಾರಮನಿ ಚೆಬಿತಿವಿ\nಚೆಲಿನಿ ಚೂಡವು ಕಾದು ಸರಿ ಯಿದಿ ಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ\nಕಲತ ನಿದ್ದುರಲೋನ ಕಂಟಿನಿ\nಕಲುವ ಕನ್ನುಲ ವಾನಿ ಕಲಲೋ\nನುಲಿಕಿ ಪಡಿ ಲೇಚಿತಿನಿ ನೇನಿಟ ಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ","ವೆಲಿಗೆ ನಾಕಾಶಮುನ ತಾರಲು\nವೆಲಿಗೆ ನಾಕಾಶಮುನ ಚಂದ್ರುಡು\nವೆಲುಗು ನವ್ವುಲ ರೂಪು ಚೂಪರ ಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ\nಪಲುಕು ವಜ್ರಪು ತುನಕಲಾ ಹರಿ\nಪಿಲಿಚಿ ಯಲಸಿತಿ ಪಿಲುಪು ವಿನದಾ\nಚಿಲುಕರಿಂಚಗ ಸುಧಲ ವಡಿ ರಾ ಚಿಲಿಪಿ ಕೃಷ್ಣಯ್ಯಾ","ತಲಚು ಕೋಗನೆ ತನಿವಿ ಗೂರ್ಚೆಡಿ\nಪಲುಕು ಜೆಲಿಯವು ಪಲುಕು ಪಡತಿವಿ\nವೆಲುಗು ನಿಚ್ಚೆಡಿ ವೆಲದಿವೀವವಿ ಕೇಲು ಮೋಡ್ಚಂಗಾ\nಅಲುಕ ಬೂನಿನ ಯಟುಲ ಆಟಲು !\nಪಲುಕು ಲೀನನಿ ಪಚ್ಚಿ ಕೋತಲು !\nನಿಲುವ ಗಲವಟೆ ತಲ್ಲಿ ಕೂತುರಲಿಗೀ ಕೂರ್ಚೊನಿನನ್ !","ತೇಟ ಮಾಟಲ ತೀಯತೀಯಗ\nಪಾಟ ತೋಡನು ಪ್ರಸ್ತುತಿಂಚಗ\nಮಾಟ ಲೀಯಕ ಯುನ್ನ ನಿಜಮುಗ ಬೋಟಿ ನಿಲಿಚೇನಾ !\nಏಟಿ ಕಮ್ಮರೊ ಯಿಟ್ಟಿ ಮಾಟಲು\nಚೀಟಿ ಮಾಟಿಕಿ ಚಿಲಿಪಿ ಆಟಲು\nಕೋಟಿವೀಣಲು ಮ್ರೋಗಿನಟ್ಟುಲ ಪಾಟ ರಾನೀಕನ್ !","ಗುಮ್ಮಡೇಡೇ ಗೋಪದೇವೀ\nಗುಮ್ಮಡೇಡೇ ಕನ್ನತಲ್ಲೀ\nಗುಮ್ಮಡಿನಿ ಪೊಡಚೂಪಗದವೇ - ಅಮ್ಮ ಗೋಪೆಮ್ಮಾ\nಗುಮ್ಮಡೇಡೇ ಗೋಪದೇವೀ\nಗುಮ್ಮಡೇಡೇ ಕನ್ನತಲ್ಲೀ\nಗುಮ್ಮಡಿನಿ ಪೊಡಚೂಪಗದವೇ - ಅಮ್ಮ ಗೋಪೆಮ್ಮಾ"],
bhOgashaTpada:["ತುಲಸಿ ಯಿಂಟನುಂಚುವಾರ್ನಿ\nತುಲಸಿ ಪೂಜಚೇಯುವಾರ್ನಿ\nತುಲಸಿಯಂದು ಭಕ್ತಿಯುಂಚಿ ಮೆಲಗುವಾರಿನೀ\nತುಲಸಿ ಜೂಚಿ ಮ್ರೊಕ್ಕುವಾರ್ನಿ\nತುಲಸಿ ಯನುಭವಿಂಚುವಾರ್ನಿ\nತೆಲಿಸಿ ನೀವು ವಾರಿ ದಿಕ್ಕು ತೊಂಗಿಚೂಡಕೂ"],
kusumashaTpada:["ಶ್ರೀಶಂಭುತನಯುನಕು\nಸಿದ್ಧಿಗಣನಾಥುನಕು\nವಾಸಿಗಲ ದೇವತಾವಂದಿತುನಕೂ\nಓಬೊಜ್ಜಕನಕಯ್ಯ\nನೀಬಂಟು ನೇನಯ್ಯ\nಉಂಡ್ರಾಳ್ಳ ಮೀದಿಕೀ ದಂಡುಬಂಪೂ"],
SarashaTpada:["ಶ್ರೀತರುಣಿರೊ ನೇ\nಶ್ರೀರಘುರಾಮುಡ\nಚೇರಿ ಕವಾಟಮು ತೀವೇ\nಖ್ಯಾತಿಗ ಶ್ರೀರಘು\nರಾಮುಡವೈತೇ\nಕೋತುಲ ಜೇರಗದೋಯೀ"],
mRgi:["ವಿನ್ಮು ರೇ\nಫನ್ಮೃಗೀ\nಮುನ್ಮುಗಾ?\nಜಿನ್ಮಯಾ"],
vreeDa:["ಸುರಾರಾತಿ\nಸ್ಫುರತ್ಸೈನ್ಯಂ\nಬುರೋ?ಸೃಗ್ಧಾ\nರ ರಾದೀಯನ್"],
kanya:["ಪೊತ್ತೈ ಗಾಗಾ\nಪತ್ತಿಂಗನ್ಯಾ\nವೃತ್ತಂಬಯ್ಯೆನ್\nಜಿತ್ತಂಬರನ್"],
sati:["ಸತೀತ್ವಧರ್ಮ\nಪ್ರತಿಷ್ಠನಾರ್ಯಾ\nಸತೀವಿಶಿಷ್ಠಾ\nತ್ಮತತ್ವಮೆಂತುನ್"],
preeti:["ಪ್ರೀತಿಮೈ ಚೇತ\nಸ್ಸಾತತೋನ್ಮೇಷನ್\nದ್ಯೋತಮೌ ಶಾಂತಿನ್\nಪೂತಭಾವಾಪ್ತಿನ್"],
naMda:["ವಂದಿಂತುನು ನೇ\nನಂದಾತ್ಮಜು ನಾ\nನಂದಂಬುನ ಸ್ವ\nಛ್ಛಂದಪ್ರಣತಿನ್"],
valamuri:["ನಲಗ ಪದಂ\nಬಲವಡ?ಗಾ\nವಲಮುರಿಯೌ\nಜಲದನಿಭಾ"],
vasumati:["ಧಾತ್ರಿನ್ ವಸುಮತಿನ್\nನೇತ್ರೋತ್ಸವಮುಗಾ\nಕ್ಷೇತ್ರಜ್ಞುನೆಱುಕನ್\nಜಿತ್ರಿಂಪ ಮನಸೌ"],
vasudha:["ವಸುಧಾಪತಿಯೌ\nವಸುದೇವಸುತುನ್\nಬಸುಕಾಪರಿಗಾ\nಸಸಿ?ಬಿಲ್ತುರಿಲನ್"],
chaMdravadana:["ಚಂದ್ರವದನನ್ ವ\nಜ್ರೇಂದ್ರ ಮಣಿಭೂಷಾ\nಸಾಂದ್ರಲಲಿತಾಂಗಿನ್\nಮಂದ್ರನುತಿ? ಗೊಲ್ತುನ್"],
saavitrI:["ಸಾವಿತ್ರೀ ಧ್ಯಾನಂಬೌ\nಭಾವಪ್ರಾಪ್ತೋದ್ಭಾಸನ್\nಜೀವಾತ್ಮೈಕ್ಯಂಬೆಂಚನ್\nಧೀವಿಸ್ರಬ್ಧಪ್ರಾಪ್ತಿನ್ "],
suruchira1:["ಭಾಸುರ ಭಸಗಲ್‌ರೇ\nಚಾ ಸುರುಚಿರಮಯ್ಯೆನ್\nಭಾಸುರ ಭಸಗಲ್‌ರೇ\nಚಾ ಸುರುಚಿರಮಯ್ಯೆನ್"],
haMsamaala:["ಸರಗಂಬುಲ್ರಚಿಂಪನ್\nಬರ?ಗುನ್ ಹಂಸಮಾಲಾ\nನರಸಿಂಹಾವತಾರಾ\nಸುರವಿದ್ವಿಡ್ವಿಹಾರಾ"],
lOla:["ಯಯಲ್ಗಂಬುಲೋಲಾಖ್ಯನ್\nಯಯಲ್ಗಂಬುಲೋಲಾಖ್ಯನ್\nಯಯಲ್ಗಂಬುಲೋಲಾಖ್ಯನ್\nಯಯಲ್ಗಂಬುಲೋಲಾಖ್ಯನ್"],
kumaaralalita2:["ಕುಮಾರಲಲಿತಾಖ್ಯಾ\nತಮೌ ಪಲನಿಸುಕ್ಷೇ\nತ್ರಮಾನ್ಯಮುರುಗೇಶುನ್\nಸಮೀಕರಣನೆಂತುನ್"],
prasavaSara:["ಎಸ?ಗಬದಮಂದುನ್\nನಸಗಮುಲುಚೆಂದನ್\nಬ್ರಸವಶರಮಯ್ಯೆನ್\nಬಿಸರುಹದಳಾಕ್ಷಾ"],
haMsaruta:["ಶ್ರೀಸಂಪಾದಿತಮುಲೈ ಯ\nಭ್ಯಾಸಂಬೊಪ್ಪ?ಗ ಸರೋಜಾ\nವಾಸಂಬೈ ಮಧುರವಂಬೈ\nಕೂಸೆನ್‌ ಮತ್ತಕಲಹಂಸಲ್"],
vimaana:["ಅಮೇಘಮಾಕಾಶಮಂದುನ್\nಗಮಿಂಚಿ ವಿದ್ಯುತ್ತು ಪೊಂದುನ್\nಸಮೇತಮುಲ್ಕಾಪ್ರಪಾತಂ\nಬಮೇಯಮೈ ಪೊಲ್ಚೆನೆಲ್ಲನ್"],
vitaana:["ಇತಂಡು ಋಕ್ಷೋದ್ಯತ್ಸೇನಾ\nಪ್ರತಾನ ಕೋಟೀಂದ್ರುಂ ಡೇಚುನ್\nಜಿತಾರಿಧೂಮ್ರುಂ ಡಾದಿತ್ಯ\nಸ್ತುತಪ್ರಭಾವುಂ ಡೆಂದೈನನ್"],
maaNavaka:["ಮಾಣವಕಾಖ್ಯಂಬಗು ನ\nಕ್ಷೀಣ ಭತಂಬುಲ್ ಲಗಮುಲ್\nಮಾಣವಕಾಖ್ಯಂಬಗು ನ\nಕ್ಷೀಣ ಭತಂಬುಲ್ ಲಗಮುಲ್"],
naaraacha:["ಈತಂಡು ರಾಘವಾಗ್ರಜುಂ\nಡೇತೆಂಚು ಶತ್ರುನಿಂ ಗರಾ\nಘಾತಂಬುಚೇ ವಧಿಂಚು ನಿ\nರ್ಘಾತಂಬು ನಾಮಹಾಜಿಲೋ"],
naagara:["ಈತನಿ ಪೇರು ವಹ್ನಿ ಸಂ\nಜಾತ ರುಷಾಚ್ಛಟಾಪ್ರಚಂ\nಡಾತಪನೇತ್ರವಹ್ನಿವಿ\nದ್ಯೋತಿತ ಶೌರ್ಯವಾರ್ಧಿಯೈ"],
bhujaMgaSiSirutamu:["ಭುಜಗಶಿಶುರುತನ್ನಾಮಲ್\nಭುಜಗಶಿಶುರುತನ್ನಾಮಲ್\nಭುಜಗಶಿಶುರುತನ್ನಾಮಲ್\nಭುಜಗಶಿಶುರುತನ್ನಾಮಲ್"],
chaMpakamaali:["ಚಂಪಕಮಾಲಿನ್ ಗೃಷ್ಣಮುರಾರಿನ್\nಸೊಂಪುಗ ಗಾಂಚನ್ ಹೃಚ್ಛಭ ವೀಧೀನ್\nಮಂಪಿಲು ವಾಂಚಾಳಿಸ್ಮಯಮಿಂದಿನ್\nಬೆಂಪದೆನಿರ್ವೃತ್ತಸ್ಫಿರದೃಷ್ಟಿನ್"],
bhadrika:["ಇತ?ಡು ನಲು?ಡ ಹೀನ ಮೂರ್ತಿಯಾ\nಯತನ ಮಖಿಲ ಮೈನ ಶೂರಕ\nರ್ಮತತಿಕಿ ಸರಿ ರಾದು ವೀನಿಕಿನ್\nಕ್ಷಿತಿ ಶತಶತಸೇನಯೈನನುನ್","ನಗಣಯುಗಮುನನ್‌ ರವಂಬುಲನ್‌\nಬ್ರಗುಣರಸವಿರಾಮಸಂಗತಿನ್‌\nತಗಿಲಿ ಹರಿಕಥಾಸಮೇತಮೈ\nನೆಗ?ಡು ಗೃತುಲ ನಿಂಡಿ ಚಂದ್ರಿಕನ್‌."],
bhadrika2:["ಅಗವರ ಧರ ನಾರವಾನ್ವಿತಂ\nಬುಗ? ಗೃತುಲನು ಜೆಪ್ಪ? ಬೊಂದಿಕೈ\nತಗ ವಿಧಿವಿರಮಂಬು ತಾಕಗಾ\nಜಗತಿನಿ ನೆಗಡೊಂದು? ಜಂದ್ರಿಕನ್"],
dOdakamu:["ಕಾಮಿತಭತ್ರಯ ಗಾಯುತ ಮೈ ವಿ\nಶ್ರಾಮಪು? ದೋದಕ ಸಂಜ್ಞತ? ಜೆಂದುನ್\nಪಾದಪವೃತ್ತಮು ಭಾ ಭಗಗಂಬುಲ್\nಮೋದಮುತೋ ನಿರು ಮೂ?ಡವಿರಾಮನ್","ತೋರಪುವೇಡುಕ?-ದೋದಕವೇತ್ತಾ\nಕಾರಮುಗಾ?ದ್ರಿಭಕಾರಗಗಂಬುಲ್\nನೀರಜನಾಭುನಿ-ನೆಮ್ಮಿನುತಿಂಪನ್\nಜಾರುವಿರಾಮಮುಷಣ್ಮಿತಿನೊಂದುನ್"],
kOmala:["ಭಾಮಗುರುಪ್ರತಿಭನ್ ಬೆಂಪೊಂದನ್\nಗೋಮಲವೃತ್ತಮಗುನ್ ರಂಗೇಂದ್ರಾ\nಭಾಮಗುರುಪ್ರತಿಭನ್ ಬೆಂಪೊಂದನ್\nಗೋಮಲವೃತ್ತಮಗುನ್ ರಂಗೇಂದ್ರಾ"],
kaumidi:["ತೊಡಿರುಮಣ್ವಂತು? ಡೀತಂಡು ನೆ\nಕ್ಕುಡು ರಿಪುಶ್ರೀಕುಜೋನ್ಮೀಲನೋ\nಗ್ರು?ಡು ಭುಜೋದ್ಯದ್ರುಷಾಸ್ಫೋಟನೋ\nಗ್ರು?ಡು ಸಮಿದ್ಧೀರು?ಡು ಶ್ರೀಪತೀ"],
naMdini:["ಧೇನುವುಗಾ ನಂದಿನಿನಾತ್ಮಕಾ\nಮ್ಯಾನುಗತಶ್ರೀಲಮರನ್ ಶುಭ\nಙ್ಞಾನಪಯೋವಾಂಚನು ಗೊಲ್ತು ನ\nವ್ಯಾನಿಶಪುಷ್ಟಿನ್‌ಹರಿ?ಜೇರ?ಗನ್"],
utsuka:["ಉತ್ಸುಕ ಮೊಪ್ಪರಚಿಂತು ಶ್ರೀ\nವತ್ಸಶುಭಾಂಕಿತುನಿತ್ಯನೂ\nತ್ನೋತ್ಸವಕಲ್ಪಿತದಿವ್ಯಸೇ\nವೋತ್ಸಮು ಹೃದ್ಯವಚಶ್ಶ್ರುತಿನ್"],
kiSOra:["ಸುನಭರಾಪ್ತಿಕಿಶೋರಮಿಂ\nಪೆನಯುರಂಗಮಹೀಪತೀ\nಸುನಭರಾಪ್ತಿಕಿಶೋರಮಿಂ\nಪೆನಯುರಂಗಮಹೀಪತೀ"],
rasaali:["ತೃಪ್ತಶೈಲದುಹಿತೃಪ್ರಿಯಾ ಧೀ\nಸುಪ್ತಸಂವಿದತಿ ಶುದ್ಧತತ್ತ್ವಾ\nದೀಪ್ತತೈಜಸ ನದೀಕ್ರಿಯಾ ನಿ\nರ್ಲಿಪ್ತಭಾವ ವಿಮಲೀಕೃತತ್ವಾ"],
manOrama:["ಮನಿಕಿ ರಮ್ಯಮೌ ಮನೋರಮಾ\nರ್ಚನಲು ನಿತ್ಯಧರ್ಮಮೈ ಮನೋ\nಜ್ಞನಲಿನೀವಿಶಿಷ್ಟಜೀವಮ\nಟ್ಲನಿಶಮುಕ್ತಿ ನಭ್ಯಸಿಂಚ?ಗನ್"],
paMkti2:["ದುರ್ಮುಖು?ಡೀತ?ಡು ತೂಗಿ ಸಮಿ\nತ್ಕರ್ಮ ಪ್ರಚಂಡು?ಡುಕಾಹಳರಾ\nನೋರ್ಮಿಚಲದ್ರವು? ಡತ್ಥಭುಜಾ\nಕರ್ಮಠು? ಡಾಹವಕಾಲು?ಡಯಾ"],
bhOgavilasita:["ಭೋಗಿವಿಲಸಿತಸ್ಫುಟಪ್ರಭಾ\nಭೋಗಲಸಿತು ಶಂಭು? ಗೊಲ್ತು ನೇ\nನಾಗಮನುತು? ಬುಣ್ಯಕೀರ್ತನನ್\nನಾಗಮಟುಲ ಮಂತ್ರಮುಗ್ಧನೈ"],
padamaali:["ನಜಜರ ಲೀಪದಮಾಲಿ ನಾದಗುನ್\nನಜಜರ ಲೀಪದಮಾಲಿ ನಾದಗುನ್\nನಜಜರ ಲೀಪದಮಾಲಿ ನಾದಗುನ್\nನಜಜರ ಲೀಪದಮಾಲಿ ನಾದಗುನ್"],
prabha:["ಸ್ವರಯತಿ ನನರಾಲ್ ಪ್ರಭಾಖ್ಯಂ ದಗುನ್\nಸ್ವರಯತಿ ನನರಾಲ್ ಪ್ರಭಾಖ್ಯಂ ದಗುನ್\nಸ್ವರಯತಿ ನನರಾಲ್ ಪ್ರಭಾಖ್ಯಂ ದಗುನ್\nಸ್ವರಯತಿ ನನರಾಲ್ ಪ್ರಭಾಖ್ಯಂ ದಗುನ್"],
prahEya:["ಅಮರಪತಿಸುತಪ್ರಾಲಂಬಬಾಹು\nಭ್ರಮಣಚಟುಲ ಧೂಃಪಾತಂಬುತೋಡನ್\nಕಮಲವಿಮಲಸೂಕಾಯಂಬು ಗ್ಲಾನಿನ್\nಚೆಮರಿಚಿ ಕಲ?ಗೆನ್ ಜೇತಂಬು ತೂಲನ್"],
maNimaala1:["ಭೃಂಗಾಮಲಚೂಡಾ ಬಾಣಾಸುರಹೇಡಾ\nಶೃಂಗಾರವಿರಾಮಾ ನೃತ್ಯಾಹಿತಕಾಮಾ\nಸಂಗೇತರವೃತ್ತೀ ಸಂವ್ಯಾನಿತಕೃತ್ತೀ\nಸಾಂಗಾಗಮಮೂರ್ತೀ ಸಾಯುಜ್ಯದಕೀರ್ತೀ"],
mEghavilasitamu:["ಪ್ರಾಂತೋನ್ಮೀಲಿತಪಲಿತಸರಸಿಜಾ\nಕ್ರಾಂತಾಕ್ಷಿಸ್ಫುಟಕರುಣರಸಧುನೀ\nಕಾಂತೋಷಸ್ಸಿತಕಮಲನ ಸದೃಶಾ\nಕಾಂತಾರ್ಥೀಕೃತಿ ಘಟಿತ ತನುಘೃಣೀ"],
lalita:["ತಾಲ್ಚು ನ್ನಭಾಶಿ ಲಲಿತನ್ ತಭಲ್ ಜರಲ್\nತಾಲ್ಚು ನ್ನಭಾಶಿ ಲಲಿತನ್ ತಭಲ್ ಜರಲ್\nತಾಲ್ಚು ನ್ನಭಾಶಿ ಲಲಿತನ್ ತಭಲ್ ಜರಲ್\nತಾಲ್ಚು ನ್ನಭಾಶಿ ಲಲಿತನ್ ತಭಲ್ ಜರಲ್"],
navamaalini:["ನಲಿ ನವಮಾಲಿನಿನ್ ನಜಭಯಲ್ ವಿನ್\nನಲಿ ನವಮಾಲಿನಿನ್ ನಜಭಯಲ್ ವಿನ್\nನಲಿ ನವಮಾಲಿನಿನ್ ನಜಭಯಲ್ ವಿನ್\nನಲಿ ನವಮಾಲಿನಿನ್ ನಜಭಯಲ್ ವಿನ್"],
kusuma_vichitra:["ಶಕಯವನಾಳುಲ್ ಸಕಲ ಧರಿತ್ರಿನ್\nವಿಕಟಗತಿಂ ದ್ರೆವ್ವಿನ ನರಪಾಲುಂ\nಡಕುಟಿಲಬುದ್ಧಿನ್ ಹತುಲನು ಜೇಸೆನ್\nಶಕಚಮುವುಲ್ ಭಾಸ್ವರಶರವಹ್ನಿನ್"],
chaMdravartma:["ಉರ್ವಿಯೆಲ್ಲ ನೊಕ ಯುಂಡವಲೆ ಮಹಾ\nಖರ್ವಮೂರ್ತಿಕನಗಾನು ವೆಲಸೆ? ದಾ\nಮುರ್ವಿ? ಬೆದ್ದ ನದು ಲೂಚಕೊನಿಯೆ ನಾ\nದೂರ್ವ ಕಾಡಲನ? ದೋಚೆ ನಚಟಿಕಿನ್"],
vRMta:["ಇತ?ಡು ಶರಭು?ಡು ನಹಿಪ್ರೌಢಿನ್\nಪೃತನ ಮೊಗದಲ? ಜರಿಂಚುನ್ ಸಂ\nಗತ ಪ್ರಳಯಸಮಯಕಾಲುಂಡೈ\nವಿತತಭುಜಪರಿಘವೀಲುಂಡೈ"],
maMdaaradaama:["ಶೃಂಗಾರರೇಖಾವಿಶೇಷಸ್ವರೂಪಾ\nರಂಗಜ್ಜನಾನೀಕರಕ್ಷಾದಿಲೀಪಾ\nಸಂಗೀತಸಾಹಿತ್ಯಸಾರಸ್ಯಲೋಲಾ\nಅಂಗೀಕೃತಾಂಗೀಕೃತಾಚಾರಶೀಲಾ"],
sumukhi:["ಕಡವ? ಗಡಂಗಿ ಕಡಂಗಿ ರಥುಲ್\nನಡಪ?ಗ ದೂಲಿನ ವಾಜಿತತುಲ್\nಕಡಚಿ ಚನುನ್ ಮುಖಕ?ಪ್ತಕಳಲ್"],
upasthita2:["ಉಪಸ್ಥಿತಮುಚೇಯುನ್ ಜಸ್ತಗಾಪ್ತಿನ್\nಉಪಸ್ಥಿತಮುಚೇಯುನ್ ಜಸ್ತಗಾಪ್ತಿನ್\nಉಪಸ್ಥಿತಮುಚೇಯುನ್ ಜಸ್ತಗಾಪ್ತಿನ್\nಉಪಸ್ಥಿತಮುಚೇಯುನ್ ಜಸ್ತಗಾಪ್ತಿನ್"],
upasthita1:["ಭಕ್ತುಲ್ ಹರಿಮೀ?ದ ನುಪಸ್ಥಿತಂ ಬಾ\nಸಕ್ತಿನ್ ವಿರತುಲ್ಕರಿಸಂಖ್ಯ ಸಾಗನ್\nಸೂಕ್ತುಲ್ ಗೊನಿಚೆಪ್ಪೆಡುಚೋ ದಜಾಗಾ\nಯುಕ್ತಂಬಗುಚುಂ ಜೆಲುವೊಂದುಚುಂಡುನ್"],
Ekaroopa:["ಸ್ತೋಕಂಬೈ ತೋಕಲುನು ಜೂಲುನಿಪ್ಪುಲ್\nದಾಕೊನ್ನನ್  ಹೇಷಲುಗ ದೌಡುಲೊಪ್ಪನ್\nಜೀಕಾಕೈ ಮಂಟಲಕೆಚೇರು ಗುಱ್ಱಾ\nಲೇಕೋನಲ್ ಲೇನನಲ ಮೇದುಚೋಟುಲ್"],
pRdhivi:["ವಿರಳವಿಲಸಿತಪೃಥ್ವಿ ಗನನ್\nಸ್ಥಿರಮತಿ ನಗನದೀವಿತತಿನ್\nನೆರವಗು ಪಲುಕು ನಿಂಡುರಸ\nಸ್ಫುರಸುಮಮಧುರವೃತ್ತಿ ಮದಿನ್"],
bhramara_vilasita:["ಮಾಕಂದೋದ್ಯತ್ಸುಮಮಧುಝರಿಣೀ\nಸೇಕಂಬೈ ತ್ರಾವಿ ಸಿವಮು ಲೆಸ?ಗನ್\nಸಾಕೂತಂಬೊಪ್ಪ ಸರಸ ಸರಘಾ\nನೀಕಂಬುಲ್ ಝುಮ್ಮನಿ ರೊದಲುರಲೆನ್"],
mauktikamaala:["ಮೌಕ್ತಿಕ ಮಾಲಾವಿ ಮಲ ಸುಕಾಂತನ್\nವ್ಯಕ್ತಮಗುನ್ ಸ್ವಾತಿ ಪಧವಿಮುಕ್ತ\nಪ್ರಾಕ್ತನ ಜೀವಾರ್ಣವಶುಭತತ್ತ್ವಂ\nಬುಕ್ತಿನಿ ಶ್ರೀಸೂಕ್ತ ಮೊದವುಶೋಭನ್"],
sumaMgali1:["ಶುಭದಾಯಕಂಭಗು ಸುಮಂಗಲಿ ನೆನ್ನನ್\nವಿಭವೋತ್ಕರಂಬಗು ಪೃಥೂತ್ಸವಕಲ್ಯಾ\nಣಭೃಶಾತ್ಮಯೌ ಲಲನಗಾ ವರಗೌರೀ\nನಿಭಪೂಜನೀಯಗ ನಿವಾಳುಲ?ಗೊಲ್ವನ್"],
prabhaatamu2:["ತೊಲುವೆಲು?ಗಯ್ಯೆನಿ ದೋಯಿ ಯೋಯಿಯೋಕೋ\nಸಲಸುತಸುಪ್ರಜ ಸಾಧು ರಾಮಚಂದ್ರಾ \nತೊಲೊವೆಲು?ಗಯ್ಯೆನಿ ದೋಯಿ ಕೌಸಲೇಯಾ\nಮೆಲಕುವ ವಚ್ಚೆನೆ ಮೀಕು ರಾಮಭದ್ರಾ ","ಸರಸಿಜನಾಭ ಭುಜಂಗ ರಾಜತಲ್ಪಾ\nಶರಣಮು ನೀವನಿ ಸನ್ಮತಿಂ ದಲಂಪನ್‌\nಬೆರಯು ನಜಾರಲು ಪೇರ್ಮಿ ನೊಪ್ಪಗುನ್‌ ಗನ್‌\nಜರಗು? ಬ್ರಭಾತಮು ಶೈಲ ವಿಶ್ರಮಂಬುನ್‌."],
chaMcharIkaavali2:["ಯಮಲ್ರಾಗಲ್ಪೊಲ್ಪೌ ಚಂಚರೀಕಾವಳಿಂಪೈ\nಯಮಲ್ರಾಗಲ್ಪೊಲ್ಪೌ ಚಂಚರೀಕಾವಳಿಂಪೈ\nಯಮಲ್ರಾಗಲ್ಪೊಲ್ಪೌ ಚಂಚರೀಕಾವಳಿಂಪೈ\nಯಮಲ್ರಾಗಲ್ಪೊಲ್ಪೌ ಚಂಚರೀಕಾವಳಿಂಪೈ"],
bhaMbaragaana:["ಪ್ರಜಿತ ವಿನುತ ಬಂಭರಗಾನಮಗುನ್\nಗಜಯತಿ ನನಭಾಗಲ ರಂಗನೃಪಾ!!\nಪ್ರಜಿತ ವಿನುತ ಬಂಭರಗಾನಮಗುನ್\nಗಜಯತಿ ನನಭಾಗಲ ರಂಗನೃಪಾ!!"],
bhoonuta2:["ಅಂದಮೈ ರನನಭತತಿ ನಂದಿ ಗಗಂಬುಲ್\nಪೊಂದ?ಗಾ? ಬದಗತಿ ಗನಿ ಭೂನುತಮಯ್ಯೆನ್\nಅಂದಮೈ ರನನಭತತಿ ನಂದಿ ಗಗಂಬುಲ್\nಪೊಂದ?ಗಾ? ಬದಗತಿ ಗನಿ ಭೂನುತಮಯ್ಯೆನ್"],
nalini:["ನಲಿನೀವಿಮಲಾಶಯಮಾನಸಮೊಪ್ಪುನವೋ\nತ್ಪಲಸುಂದರಭಾವಸಮುದ್ಗತಸುಸ್ಮಿತಮಂ\nಜುಲಸತ್ತ್ವಮುನಂಬ್ರಕೃತಿನ್ ಶುಭದರ್ಪಣಮ\nಟ್ಲಲರಾರುಪರಾತ್ಪರು ವ್ಯಾಯತಸೃಷ್ಟಿಗನನ್"],
chaMdrarEkha:["ಇಂದ್ರಾಣಿನ್ ಜಂದ್ರರೇಖಾವೃತ್ತಾಚ್ಛಧೀಕೌಮುದೀ ಶ್ರೀ\nಸಾಂದ್ರಸ್ಮೇರಾಭಿರಾಮನ್ ಶಶ್ವತ್ಸುಧಾವರ್ಷಿಣಿನ್ ನೀ\nಲೇಂದ್ರಪ್ರಾಮಾಣ್ಯನೀರಂದ್ರೇಭ್ಯನ್ ಶ್ರುತಿಜ್ಞೇಯನಾದ್ಯನ್\nಮಂದ್ರಸ್ತೋತ್ರಪ್ರಸಕ್ತಿನ್ ಮಾನ್ಯಪ್ರಪತ್ತಿನ್ ಭಜಿಂತುನ್"],
ila:["ವಸನಂಬುಲೂಡ?ಗ? ಬಡ?ತಿ ಗಮಿ ಪಱವನ್\nಪಸಮೀರು ತತ್ಕುಚಭರಮು ರುಚಿಕನುಚೇ\nಯ ಸುರುಲ್ ಮಹಾಗ್ನಿಕಿ ನಱ ತಗುಲ?ಬಡಿಯುನ್\nಗೊಸರೈನ ಚೂಪುಲ? ಗುಸುಲುಕೊನಿ ಗನ?ಗನ್"],
ila2:["ವಸನಂಬುಲೂಡ?ಗ? ಬಡ?ತಿ ಗಮಿ ಪಱವನ್\nಪಸಮೀರು ತತ್ಕುಚಭರಮು ರುಚಿಕನುಚೇ\nಯ ಸುರುಲ್ ಮಹಾಗ್ನಿಕಿ ನಱ ತಗುಲ?ಬಡಿಯುನ್\nಗೊಸರೈನ ಚೂಪುಲ? ಗುಸುಲುಕೊನಿ ಗನ?ಗನ್"],
alasagati:["ತಮಗೃಹಮುಲುನ್ ಮಱಿಯು ದಗ್ಧಮಗುಚುಂಡನ್\nಗುಮತುಲಯಿ ರಕ್ಕಸುಲು ಕೊಂದಱು ದುರಾಶಾ\nಭ್ರಮುಲು ತಗಲಂಬಡು ಪರಾವಸಧಚೌರ್ಯ\nಕ್ರಮಮು ನೆಱಪನ್ ದಹನಕಾಂಡಮು ದಹಿಂಪನ್"],
padmakamu2:["ಕೊಡುಕುಪಲ್ಕುವಿನಿಕೂಡದುನಾಕ ದುರಾತ್ಮುಡೈ\nಕಡ?ಗ ಮೀಕು ನಪಕಾರಮು ಸೇಸಿಧರಿತ್ರಿ ವೆ\nಲ್ವಡ?ಗ ಬಂಚೆ?ಗಡು? ಬಾಪಮತಿನ್ ದೃತರಾಷ್ಟ್ರು?ಡೆ\nಯ್ಯೆಡಲ ದುರ್ಜನುಲ ನೇಮಱಿ ನಮ್ಮ?ಗ?ಬೀಲುನೇ"],
lalitagati:["ನಲಿನಿ? ಬದುನೊಕಟಿ ಯತಿ ನಾನಜಸಲುನ್\nಲಲಿತಗತಿ ಕಲರು ನಿಲ ರಂಗನೃಪತೀ\nನಲಿನಿ? ಬದುನೊಕಟಿ ಯತಿ ನಾನಜಸಲುನ್\nಲಲಿತಗತಿ ಕಲರು ನಿಲ  ರಂಗನೃಪತೀ"],
gajaraaja:["ಸಜಭಾಸ ಲಷ್ಟವಿಶ್ರಮರೀತಿ? ದನರಿನನ್\nಗಜರಾಜಮೌನು ರಂಗನೃಪಾಲ ವಸುಮತಿನ್\nಸಜಭಾಸ ಲಷ್ಟವಿಶ್ರಮರೀತಿ? ದನರಿನನ್\nಗಜರಾಜಮೌನು ರಂಗನೃಪಾಲ ವಸುಮತಿನ್"],
gajavilasita:["ಚೀಕಟುವಿವ್ವಿಕಾವು ಜಿಲುಗು ತಳುಕು ಜಿಗಿ ದಂ\nತಾ ಕೃತಿ ಕಾನರಾದ ಯಸಲು ನಲುಪುಟಿಟಿಕುಲ್\nಗಾಕ ನಗಾಳಿ ಕಾವು ಕದಲವು ಮೊದಲವು ಮುಂ\nದೀ ಕರಿರಾಜಿಲೇದ ಯಿಟಗುನಗುನ ಕದುಪನ್"],
aSvagati:["ಐದು ಭಕಾರಮುಲುಂ ಗಮುನೈ ತಗು ನಶ್ವಗತಿನ್\nಐದು ಭಕಾರಮುಲುಂ ಗಮುನೈ ತಗು ನಶ್ವಗತಿನ್\nಐದು ಭಕಾರಮುಲುಂ ಗಮುನೈ ತಗು ನಶ್ವಗತಿನ್\nಐದು ಭಕಾರಮುಲುಂ ಗಮುನೈ ತಗು ನಶ್ವಗತಿನ್"],
madanadarpaNa:["ಶ್ರೀಭಸಜರಜಲ್ ಗಯುಕ್ತಿ? ಜೆಂದಿವಚ್ಚಿನಂ ಗುಮಾ\nರಾಭ ಮದನದರ್ಪಮಯ್ಯೆ ನಬ್ಜಭೂವಿರಾಮಮೈ\nಶ್ರೀಭಸಜರಜಲ್ ಗಯುಕ್ತಿ? ಜೆಂದಿವಚ್ಚಿನಂ ಗುಮಾ\nರಾಭ ಮದನದರ್ಪಮಯ್ಯೆ ನಬ್ಜಭೂವಿರಾಮಮೈ"],
chaMdrabhaanu:["ನರಜರಲ್ ಜಗಲ್ ಗದಿಂಚಿನಂ ದಿಶಾವಿರಾಮಮೈ\nಯರಯ? ಜಂದ್ರಭಾನುವೃತ್ತಮೌನು ರಂಗಭೂವರಾ!\nನರಜರಲ್ ಜಗಲ್ ಗದಿಂಚಿನಂ ದಿಶಾವಿರಾಮಮೈ\nಯರಯ? ಜಂದ್ರಭಾನುವೃತ್ತಮೌನು ರಂಗಭೂವರಾ!"],
vaMSapattrapatita:["ಬಾಗಗು ವಂಶಪತ್ರಪತಿತನ್ ಭರನಭನಲಗಲ್\nಬಾಗಗು ವಂಶಪತ್ರಪತಿತನ್ ಭರನಭನಲಗಲ್\nಬಾಗಗು ವಂಶಪತ್ರಪತಿತನ್ ಭರನಭನಲಗಲ್\nಬಾಗಗು ವಂಶಪತ್ರಪತಿತನ್ ಭರನಭನಲಗಲ್"],
dhRti:["ಪ್ರತಾಪಗುಣಭೂಷಣಾ ಪರಹಿತಾರ್ಥಸಂಭಾಷಣಾ\nವಿತೀರ್ಣಿರವಿನಂದನಾ ವಿಭವನೂತ್ನಸಂಕ್ರಂದನಾ\nಶ್ರುತಿಸ್ಮೃತಿವಿಚಕ್ಷಣಾ ಸುಕೃತಕೀರ್ತಿಸಂರಕ್ಷಣಾ\nಕ್ಷಿತೀಂದ್ರನುತವರ್ತನಾ ಶಿವಪದದ್ವಯೀಕೀರ್ತನಾ"],
chaMpakakEsari:["ಸಜಸಾಸ್ವಲೌ ಯತಿ ಗಜಂಬುಲ? ಜಂಪಕಕೇಸರಿನ್\nಸಜಸಾಸ್ವಲೌ ಯತಿ ಗಜಂಬುಲ? ಜಂಪಕಕೇಸರಿನ್\nಸಜಸಾಸ್ವಲೌ ಯತಿ ಗಜಂಬುಲ? ಜಂಪಕಕೇಸರಿನ್\nಸಜಸಾಸ್ವಲೌ ಯತಿ ಗಜಂಬುಲ? ಜಂಪಕಕೇಸರಿನ್"],
tvaritapadagati:["ಸರಸಿರುಹಭವಸದೃಶಚತುರ ನನನನಾಯಲ್\nತ್ವರಿತಪದಗತಿ ಕಮರು ದಶಮಯತಿಯು ಗಾಗನ್\nಸರಸಿರುಹಭವಸದೃಶಚತುರ ನನನನಾಯಲ್\nತ್ವರಿತಪದಗತಿ ಕಮರು ದಶಮಯತಿಯು ಗಾಗನ್"],
niSa:["ಅಡವಿಶುನುಲು ಭಕ್ಷಣಾಶನ್ ಶವಾನೀಕ ಸಾನ್ನಿಧ್ಯಮುನ್\nಬಡಸಿ ಪೆರಮೃಗಾಳಿಪೈ ರಾ? ಜಲದ್ದರ್ಶಯದ್ದಂತಮುಲ್\nಗುಡಗುಡಲುಗ ಗೊಂಚು ಘೂರ್ಣಾರವನ್ಮಂದ್ರರಾವಂಬುಗನ್\nಜಡಸಿಜಡಿಯನಟ್ಲು ಸಾಗುನ್ ಮರಿಂ ಬೇರ್ಚಿ ಕವ್ವಿಂಚುಚುನ್"],
haranartana:["ಬದ್ಧವಾಸನ?ಜೇಸಿಹಾವಳಿಶಾರ್ದೂಳಾವಳಿಪೊಂದುಚುನ್\nಯುದ್ಧಭೂಮಿನಿ?ಜೇರಿದೃಷ್ಟ್ಲೊಗಿನೇದಾತ್ತ್ಯಾಯತಿ?ಜಿಂದುಚುನ್\nವಿದ್ಧಸೈಂದವರಾಜಿಪೈವಿಚಲದ್ ಗೃಧ್ರಾವೃತಿ ಕ್ರೋಧಸಂ\nಬದ್ಧ ಗರ್ಜನ?ಬಾಪಿ ತಪ್ಪಕ ಯಟ್ಲೇಕಪ್ಪಕ ನಿಲ್ಚುನ್ "],
ativinaya:["ನನಲು ಗಲಯ?ಗ ನನಲ ನಸಯುತಮುಲಗುಚುನ್\nದನರು ನತಿವಿನಯಕಿವಿ ದಶಮಯತಿಕೃತುಲನ್\nನನಲು ಗಲಯ?ಗ ನನಲ ನಸಯುತಮುಲಗುಚುನ್\nನನಲು ಗಲಯ?ಗ ನನಲ ನಸಯುತಮುಲಗುಚುನ್"],
dEvaraaja:["ಕ್ಷಿತಿ ನರಲ್‌ನಜಲ್‌ಭಸಲುನು ಜೆನ್ನುಗಾ ನಭವಯತಿ\nಸ್ಥಿತಿಯು ದೇವರಾಜಮುನಕು? ಜೆಲ್ಲು ರಂಗನರಪತೀ\nಕ್ಷಿತಿ ನರಲ್‌ನಜಲ್‌ಭಸಲುನು ಜೆನ್ನುಗಾ ನಭವಯತಿ\nಸ್ಥಿತಿಯು ದೇವರಾಜಮುನಕು? ಜೆಲ್ಲು ರಂಗನರಪತೀ"],
kshmaahaara:["ಸಾನುಕ್ರೋಶು?ಡು ಮಧುರಸ್ವಾದ್ವಾಭಾಷಿ ಸಕಲವೇದಾರ್ಥಾ\nಹೀನಪ್ರೌಡು?ಡು ಧಿಷಣಾಹೇಲಾಲೋಕಹಿತ ಸದಾಜೀವುಂ\nಡೇನೋದೂರು?ಡು ತರಿಣುಂ ಡೀಹಾದೂರು? ಡಿತಿಹಶಬ್ದಾರ್ಥಾ\nಙ್ಞಾನಾಸ್ಥಾನಮು ನಿರತಸ್ವಾಹಾಭರ್ತೃಚರಣಶೀಲುಂಡುನ್"],
kavikaMThavibhooShaNa:["ಪೊರಪೊಚ್ಚೆಮುನ್ನೆ ಮನ ಮುವ್ವುರು ತಲ್ಲುಲು ಮುವ್ವುರುನ್ ರಮಾ\nದರಣೀಯಮೂರ್ತು ಲವದಾತಯಶೋನಿಧು ಲಂದು ನಾಪಯಿನ್\nದಿರಮೈನ  ಪ್ರೇಮ ನಿಯತಿಂ ಜನುವಾರಲು ವಾರಿಲೋನನುನ್\nಮಱಿಯುಂ ಗಡಿಂದಿಗನು ಮನ್ನನಚೇಯುನ ಕೈಕಕಾದಟೇ"],
SaMbhu:["ಶ್ರಿತಹೃತ್ಪಂದ್ಮಾಂತರಸಂಸ್ಸ್ಪಂದಾಯಿತರೇಖಾವಿಜ್ಞೇಯಾಕಾರಾ\nಕ್ಷಿತಿಭೃತ್ಕನ್ಯಾಧರಕಾಂತಿಶ್ರೀವಿವಶೀಭೂತಾಂತರ್ವಾಪಾರಾ\nಪ್ರತನುಪ್ರಾಣಾಂತರವರ್ತೀ ಭೂನತವಲ್ಲೀರೇಖೋದ್ಯತ್ಪುಷ್ಪಾ\nಮತಿ ಸಂವಿದ್ವೇದನಮರ್ಮಪ್ಲಾವಿತಭಕ್ತಾಲೀನಿರ್ಯದ್ಭಾಷ್ಪಾ"],
Subhika:["ಸೂರಿಸ್ತುತ್ಯಾ ಮಭವನವಿಲಸಿತ ಸೂರ್ಯಯತಿನ್ ಶುಭಿಕಾ\nಕಾರಂಬೈ ಯೆಲ್ಲಕೃತುಲ ವೆಲಯುನು ಕಲ್ಪಿತಭಾಗಲನ್\nಸೂರಿಸ್ತುತ್ಯಾ ಮಭವನವಿಲಸಿತ ಸೂರ್ಯಯತಿನ್ ಶುಭಿಕಾ\nಕಾರಂಬೈ ಯೆಲ್ಲಕೃತುಲ ವೆಲಯುನು ಕಲ್ಪಿತಭಾಗಲನ್"],
durmila:["ಧರಣೀತನಯಾಹೃದಯೇಶ್ವರಬಾಣನಿತಾಂತಮಹಾಗ್ನಿ ಶಿಖಾವಲಿಚೇ\nವರುಣಾಲಯಭಾಗ್ಬಹುಜಂತುತತಿಪ್ರಳಯಾಗತಯೈನಗತಿಂ ಬೊಲಿಚೆನ್\nಧರಣಿಂ ಗನ ನಾಶ್ರಯಮಂದಿನಚೋ ದಗ ನಾಪದಯೈನ ದದಾಶ್ರಿತುಲಂ\nಬೊರಯಂಗನು ಮಾನಕಯುಂಡುನೊ ದುರ್ಭರಮುಲ್ಸಿಲುಗುಲ್ಬಹುಲಾಕೃತುಲೈ"],
SRMgaara:["ಮೃಡವಿಶ್ರಾಮಂಬವಲನ್ ಬಂದೊಮ್ಮಿದಿಟನು ಯತಿ ತಗಿ ಮೆಱಿಸಿನಯಂತ\nನ್ಗಡು ಶೃಂಗಾರಾಖ್ಯ? ಜೆಲಂಗುನ್ ರಙ್ಗನೃಪತಿ ಸತಯಭನನನಯ ಯುಕ್ತಿನ್\nಮೃಡವಿಶ್ರಾಮಂಬವಲನ್ ಬಂದೊಮ್ಮಿದಿಟನು ಯತಿ ತಗಿ ಮೆಱಿಸಿನಯಂತ\nನ್ಗಡು ಶೃಂಗಾರಾಖ್ಯ? ಜೆಲಂಗುನ್ ರಜ್ಗನೃಪತಿ ಸತಯಭನನನಯ ಯುಕ್ತಿನ್"],
kirITa:["ವಾರಿಧಿ ಯೆಚ್ಚಟ ಲೋತುಲು ಲೋತುಲು ವಾರಕ ಚೊಚ್ಚೆಡಿ ಯಮ್ಮುಲಚೇತನು\nನೇರನಿ ಮಾದಿರಿ ಲೋಪಲ ಲೋಪಲ ನಿಪ್ಪುಲು ಪೋಸೆಡಿ ಯಮ್ಮುಲಚೇತನು\nದೂರಿನ ಚೋಟುಲ ಚಿಕ್ಕನಿ ನೆತ್ತುರು ತೂಮುಲು ಕಟ್ಟೆಡು ನಮ್ಮುಲಚೇತನು\nತೀರಿಕ ನೂರಕ ನೂಪಿರಿ ಲೇವ?ಗ ದೀಸುಕಪೋಯೆಡು ನಮ್ಮುಲಚೇತನು"],
baMdhura:["ಪರಿಮಳಭರಿತವಿಕಚ ಸುಮಮುಲ ಶ್ರೀಬಂಧುರ ಕಾಂಚನ ದಿವ್ಯಮಣಿ\nಸ್ಫಿರ ವಲಸಮುನ ವೆಲಯ?ಗ ಭ್ರಮರಸಂವೀತ ವಿನೀಲವಿಭಾಸಮುನನ್\nಸಿರಿಮೊಗಮುನ ರತನಪುನಿಲುಪಸಲಾಸೇಚನಕಂಬುಗ ಶೋಭಿಲ?ಗನ್\nಹರಿ ಮಧುವ ನನಿವಸನಮಿಲಗನೆ ನವ್ಯಕ್ತುಗತಿನ್ ಬ್ರಿಯಕಾಮಿನಿಕೈ "],
vijaya:["ಭಾನುಲ? ಬದಿಯುಂದೊಮ್ಮಿದಿಟಂ ಜೊಪ್ಪಡಿ ವಿರತುಲು ನೇರ್ಪಡ ವಿಜಯಮಗುನ್\nಸೈನಿಕಯುತ ರಂಗಾಧಿಪ ಸಲ್ಲಾಣಸು ಭಸಭತನಲ್ ಸನನಗಮುಲತೋನ್\nಭಾನುಲ? ಬದಿಯುಂದೊಮ್ಮಿದಿಟಂ ಜೊಪ್ಪಡಿ ವಿರತುಲು ನೇರ್ಪಡ ವಿಜಯಮಗುನ್\nಸೈನಿಕಯುತ ರಂಗಾಧಿಪ ಸಲ್ಲಾಣಸು ಭಸಭತನಲ್ ಸನನಗಮುಲತೋನ್"],
suruchi:["ವಸುಮನುವುಲ ನಿರ್ವದಿಯೊಕಟನ್ ಜೆಲ್ವೈ ವಿರಮಣಮುಲು ವರಲಂ ಬಾಗೌ\nನಸಮ ಸುರುಚಿ ಶ್ರೀಹರಿಸಮ ರಂಗೇಂದ್ರಾ ನನಭಸತನನಯಗಪ್ರಾಪ್ತಿನ್\nವಸುಮನುವುಲ ನಿರ್ವದಿಯೊಕಟನ್ ಜೆಲ್ವೈ ವಿರಮಣಮುಲು ವರಲಂ ಬಾಗೌ\nನಸಮ ಸುರುಚಿ ಶ್ರೀಹರಿಸಮ ರಂಗೇಂದ್ರಾ ನನಭಸತನನಯಗಪ್ರಾಪ್ತಿನ್"],
vanaruha:["ರುದ್ರಪ್ರೌಢಿನಿ? ಬಂದೊಮ್ಮಿದಿಟನ್ ರುಜುಲಗು ಯತುಲೊನರುಟ ವನರುಹಮೈ\nಭದ್ರಶ್ರೀಯುತ ರಂಗಾಧಿಪತೀ ಪರಗು ಲಿಪುಲ ಮಸಭಭನನನನಗಲ್\nರುದ್ರಪ್ರೌಢಿನಿ? ಬಂದೊಮ್ಮಿದಿಟನ್ ರುಜುಲಗು ಯತುಲೊನರುಟ ವನರುಹಮೈ\nಭದ್ರಶ್ರೀಯುತ ರಂಗಾಧಿಪತೀ ಪರಗು ಲಿಪುಲ ಮಸಭಭನನನನಗಲ್"],
jaladarava:["ಚೆದರಿನ ತಲಯು ಚಿನಿಗಿನ ವಲುವ ಚೆಲುವಮು ತರಿಗಿನ ಮೊಗಮೈ\nಕದಲಿನ ನಡುಮು ಕದಿಸಿನ ಯುರಮು ಕಲಗಿನ ತುನಿಗಿನ ಸರಮೈ\nಅದರಿನ ಪಿಱು?ದು ನಲಸಿನ ಪದಮು ನದವದಲಯಿ ಚನು ಕನುಲೈ\nಬೆದರಿ ಬೆದರಿಯು ವಿರಿಸಿ ವಿರಿಸಿಯು ವೆಡಲಕು  ವೆಡಲಕು ಮಗುವಾ"],
varaha:["ದಿಕ್ಸೀಮಾಂತಮಿತ ಧಿಮಿತ ಧಿಮಿತ ಧಿಮಿಕ ಧಿಮಿಕ ಪಟುತರಮೃದಂಗೋದ್ಯತ್\nಪ್ರಕ್ಸಂರಾವಮುಲ ನಟನ ಚತುರಶಫರಿ ಶಕುನಿ ನಿಚಯಕೃತಸಾಹಾಯ್ಯುನ್ \nಪ್ರಾಕ್ಸೃಷ್ಟಿನ್ ವೆಲುಚು ಜಲಜಭವಕೃತ ನುತಿಭರಿತ ಸವನಘಟನಾನೇಹಃ\nಸ್ರುಕ್ಸಂದೀಪಿತ ಮಹಿತಚರುನಿ ಹಿತನುತ ರುಚಿರಮಹಿ ಮಹಾಧಾಯ್ಯುನ್"],
prabhu:["ಪ್ರಮುದಿತಗಜಬುತುರಸವಿಶ್ರಮಮುಲ್‌ರಮಣಂ ಗವಿವರ್ಯನುತಂಬುನುನೈ\nಕ್ರಮಮುನ ನನನಲು ರಹಿ ನೈದು ಜಕಾರಮುಲುನ್ ಲಗಮುನ್ ಬ್ರಭುವೃತ್ತಮಗುನ್\nಪ್ರಮುದಿತಗಜಬುತುರಸವಿಶ್ರಮಮುಲ್‌ರಮಣಂ ಗವಿವರ್ಯನುತಂಬುನುನೈ\nಕ್ರಮಮುನ ನನನಲು ರಹಿ ನೈದು ಜಕಾರಮುಲುನ್ ಲಗಮುನ್ ಬ್ರಭುವೃತ್ತಮಗುನ್"],
apavaaha:["ದಿಕ್ಸೀಮಾಂತಮಿತ ಧಿಮಿತ ಧಿಮಿತ ಧಿಮಿಕ ಧಿಮಿಕ ಪಟುತರಮೃದಂಗೋದ್ಯತ್\nಪ್ರಕ್ಸಂರಾವಮುಲ ನಟನ ಚತುರಶಫರಿ ಶಕುನಿ ನಿಚಯಕೃತಸಾಹಾಯ್ಯುನ್ \nಪ್ರಾಕ್ಸೃಷ್ಟಿನ್ ವೆಲುಚು ಜಲಜಭವಕೃತ ನುತಿಭರಿತ ಸವನಘಟನಾನೇಹಃ\nಸ್ರುಕ್ಸಂದೀಪಿತ ಮಹಿತಚರುನಿ ಹಿತನುತ ರುಚಿರಮಹಿ ಮಹಾಧಾಯ್ಯುನ್","ಔ ಬ್ರಹ್ಮರ್ತುರನಮುಲನು ಯತಿ ಮಗಣ ಗುಹಕ ನ ಸಗಗ ಲಪವಾಹಾಖ್ಯನ್\nಔ ಬ್ರಹ್ಮರ್ತುರನಮುಲನು ಯತಿ ಮಗಣ ಗುಹಕ ನ ಸಗಗ ಲಪವಾಹಾಖ್ಯನ್\nಔ ಬ್ರಹ್ಮರ್ತುರನಮುಲನು ಯತಿ ಮಗಣ ಗುಹಕ ನ ಸಗಗ ಲಪವಾಹಾಖ್ಯನ್\nಔ ಬ್ರಹ್ಮರ್ತುರನಮುಲನು ಯತಿ ಮಗಣ ಗುಹಕ ನ ಸಗಗ ಲಪವಾಹಾಖ್ಯನ್"],
tanvi:["ಕಲ್ಪಲತಾವೇಲ್ಲಿತಕುಸುವಿ ಲಸತ್ಕಾಂತುಲು ದಿಕ್ಕುಲ ವೆಲುಗಿಡು ತನ್ವಿನ್\nಕಲ್ಪವಿಕಲ್ಪಂಬುಲ ನೊಕಗತಿ ಸಂಕಲ್ಪಮುನನ್‌ ದಮಿ ನೆಡಪೆಡು ಧನ್ಯನ್\nವೇಲ್ಪುಲು ಜೋಹಾರುಲಗೊನು ಸ್ಮಿತಸಂಪ್ರೀತ ನುಷಸ್ಸು ನೆದ ಗೊಲುತು ಭಕ್ತಿನ್\nಮೇಲ್ಪಸಮುತ್ತೆಂಪುತೆರ ವೆಡಲಿ ನೆಮ್ಮಿನ್‌ ಮದಿ ತೆಲ್ವಿನಿ ನೆರ?ಪಗ ರಾಗನ್"],
kusuma:["ನಭನಭಲ್ ತಗ ನಗಣಮುಲ್ ವಗಣಯುತಮಯಿ ಚೆಲುವಲರಿನನ್\nವಿಭು?ಡು ರಂಗನೃಪತಿ ತ್ರಯೋದಶವಿರತಿ ವಸುಮತಿ? ಗುಸುಮಮೌ\nನಭನಭಲ್ ತಗ ನಗಣಮುಲ್ ವಗಣಯುತಮಯಿ ಚೆಲುವಲರಿನನ್\nವಿಭು?ಡು ರಂಗನೃಪತಿ ತ್ರಯೋದಶವಿರತಿ ವಸುಮತಿ? ಗುಸುಮಮೌ"],
mattaakrIDa:["ಮತ್ತಾಕ್ರೀಡನ್ ಮಾತಲ್ ನಾನಾಲ್ ಮಱಿ ವಮು ವಸುಗಜಮತ ಯತುಲಮರನ್\nಮತ್ತಾಕ್ರೀಡನ್ ಮಾತಲ್ ನಾನಾಲ್ ಮಱಿ ವಮು ವಸುಗಜಮತ ಯತುಲಮರನ್\nಮತ್ತಾಕ್ರೀಡನ್ ಮಾತಲ್ ನಾನಾಲ್ ಮಱಿ ವಮು ವಸುಗಜಮತ ಯತುಲಮರನ್\nಮತ್ತಾಕ್ರೀಡನ್ ಮಾತಲ್ ನಾನಾಲ್ ಮಱಿ ವಮು ವಸುಗಜಮತ ಯತುಲಮರನ್"],
narEMdra:["ಜಾಲಮುಲೈ ತರಂಗಶಿಖರಮುಲನು ಸನ್ನನಿರೇಖಗ ಧೂಮ\nಜ್ವಾಲಲು ಲೇಚಿ ಯಲ್ಲುಕೊನಿ ನಭಮುನ ವಲ್ಲುಲು ವೃಕ್ಷಮುಲಯ್ಯೆನ್\nನೀಲತಮಾಲಕಾನನಮು ನಿಲುವುನ ನಿಂಗಿಕಿ ಲೇಚೆಡುನಟ್ಟುಲ್\nಹಾಲಹಲಮ್ಮು ಕ್ರೊತ್ತದಿಗ ಜಲನಿದಿಯಂ ದುದಯಿಂಚಿನಯಟ್ಟುಲ್"],
surabhoojaraaja:["ರವಿಯತಿನ್‌ ಸುರಭೂಜರಾಜಮು ಪ್ರಬಲು ನಭರನನಾರಲನ್\nತವಿಲಿ ರಂಗಮಹೀತಲಾಧಿಪ ದಳಿತವಿಮತನೃಪಾಲಕಾ\nರವಿಯತಿನ್‌ ಸುರಭೂಜರಾಜಮು ಪ್ರಬಲು ನಭರನನಾರಲನ್\nತವಿಲಿ ರಂಗಮಹೀತಲಾಧಿಪ ದಳಿತವಿಮತನೃಪಾಲಕಾ"],
kanakalata:["ಪಲುಕುನ? ಗನಕಲತ ವೆಲಯ? ಬಲಿಕೆದ ನವಮಣಿಸೂ\nನಲಸಿತಮುಗ ರವಿಶಶಿಕಿರಣಸುವಿಲಸನಮು ಮಹೀ\nಸ್ಥಲಿನಲಮ ರಹಿ ಶಿವಶಮರಸನಲ ದಮಿಲ ಗುರಿಯನ್\nಲಲಿತನು ಗೊಲುವ?ಗ ಬದಕಮಲಮುಲ ಕೆನಯಗು ಪಸನ್"],
haMsi:["ಶಾತಾರ್ಚಿರ್ಧೂರ್ಬಾಂಧುರ್ಯಂಬುಲ್ ಜಲನಿಧಿ ಜಲಮುಲು ಸಲಸಲ ಗ್ರಾಗನ್\nಪಾತಾಳಸ್ಥಪ್ರಾಣಿಶ್ರೇಣುಲ್ ಪಲಪಲ ಭರಮಯಿ ಯಸುವುಲ ವ್ರೇಗನ್\nಯಾತಾಯಾತಾಯಾಸಕ್ಲಿಷ್ಟಾಸುವುಲಯಿ ಯಲಮಟ ವಡಿಬಡಿ ಯಾದೋ\nವ್ರಾತಂಬೆಲ್ಲನ್ ವಾರ್ವಾಸಂಬುಲ್ ವದಲಿ ದಿವಮುನಕು? ಜನ ನೆಗುರಂಗನ್"],
vichikilata:["ಪೊದಿವಿ ಪೊದಿವಿ ನೃಪುಲ ತಲಲು ಪುಣಿಕಿ ಪುಣಿಕಿ ನಱಕಿ ಸ\nಮ್ಮದಮು ಮುದಮು ನೆಡ?ದ? ಗದುರ ಮಲ?ಗಿ ಮಲ?ಗಿ ಗುರುನಕುನ್\nಗುದುರು ಕಲುಗ ಜಲಮುವದಲಿ ಕೊಸ?ಕು ಗಿನುಕ? ದೊಲ?ಗಿತಿನ್\nವದಲಿ ಧನುವು ಜಗಮಖಿಲಮು ವದಲಿ ಯೆಚಟೊ ಯರಿಗಿತಿನ್"],
prabhaalalitamu:["ವೆಲಯ ನಜಾಭರಸಂಬುಲುನ್ ರವಿವಿಶ್ರಮಂಬುಲುನುಂ ಬ್ರಜಾ\nಕಲಿತಕುನೊಪ್ಪು ನಗಣ್ಯಪುಣ್ಯ ಲಗಂಬುಮೀದ ಧರಂ ಗೃತಿನ್\nವೆಲಯ ನಜಾಭರಸಂಬುಲುನ್ ರವಿವಿಶ್ರಮಂಬುಲುನುಂ ಬ್ರಜಾ\nಕಲಿತಕುನೊಪ್ಪು ನಗಣ್ಯಪುಣ್ಯ ಲಗಂಬುಮೀದ ಧರಂ ಗೃತಿನ್"],
kalita:["ನನಭಸನನವಂಬುಲ ನಲಿನಾಪ್ತವಿರಮಣಮು ರಸ\nಪ್ರಣುತ ಕಲಿತವೃತ್ತ ಮಮರು ರಂಗಮನುಜಪತಿಮಣೀ\nನನಭಸನನವಂಬುಲ ನಲಿನಾಪ್ತವಿರಮಣಮು ರಸ\nಪ್ರಣುತ ಕಲಿತವೃತ್ತ ಮಮರು ರಂಗಮನುಜಪತಿಮಣೀ"],
bhujara:["ಮುನು ನಭಲ್ ನಭರಸವಮುಲ್ ಪದುಮೂ?ಟ ವಿಶ್ರಮಮೊಪ್ಪಿನನ್\nಘನವಜಾರತ ವಿಜಯರಂಗಶಿಖಾಮಣೀ ಭುಜಗಂಬಗುನ್\nಮುನು ನಭಲ್ ನಭರಸವಮುಲ್ ಪದುಮೂ?ಟ ವಿಶ್ರಮಮೊಪ್ಪಿನನ್\nಘನವಜಾರತ ವಿಜಯರಂಗಶಿಖಾಮಣೀ ಭುಜಗಂಬಗುನ್"],
chaarumati:["ಚಾರುಮತಿ ಯೊಪ್ಪುನು ಭಜಲ್ ಸನಭಜಲ್ ಸನಗಸಂಗತಿ ಕವೀಂದ್ರವಿನುತಾ\nಸಾರೆಕು? ದ್ರಯೋದಶ ಸಪ್ತದಶ ಸದ್ಯತಿ ಲಸದ್ಗತಿನಿ ರಂಗನೃಪತೀ\nಚಾರುಮತಿ ಯೊಪ್ಪುನು ಭಜಲ್ ಸನಭಜಲ್ ಸನಗಸಂಗತಿ ಕವೀಂದ್ರವಿನುತಾ\nಸಾರೆಕು? ದ್ರಯೋದಶ ಸಪ್ತದಶ ಸದ್ಯತಿ ಲಸದ್ಗತಿನಿ ರಂಗನೃಪತೀ"],
ujjvala:["ನ್ನಭರ ಲಮರುನ್ ಮಹಿತೋಜ್ಜ್ವಲನ್\nನ್ನಭರ ಲಮರುನ್ ಮಹಿತೋಜ್ಜ್ವಲನ್\nನ್ನಭರ ಲಮರುನ್ ಮಹಿತೋಜ್ಜ್ವಲನ್\nನ್ನಭರ ಲಮರುನ್ ಮಹಿತೋಜ್ಜ್ವಲನ್"],
vRtta:["ಅನಿಲಜುನಿ ವೃತ್ತಾಂತಂ ಬಪೇಕ್ಷನ್\nವಿನಿ ಮದಿನಿ ನಿರ್ವೃತ್ತಾರ್ತು?ಡೌ ರಾ\nಮುನಿ ಮನಿಕಿ ಶ್ರೀಪುಂಭಾವನಷ್ಟಿನ್\nದನಿಮಮುನ ವೃತ್ತಸ್ಫೂರ್ತಿನುಂಡೆನ್"],
madraka:["ದಕ್ಷಿಣದಿಕ್ಕು ಪೋಯಿತಿನಿ ಚಂದನಾಗಭುಜಂಗವಿಷಾನಲಝರೀ\nಕುಕ್ಷಿ ಗಿರೀಂದ್ರಮೆಕ್ಕಿತಿನಿ ದಿಕ್ಕುಡು? ಗವಿತಾನನಿರೂಷಿತಮತಿನ್\nದೀಕ್ಷ ನಗಸ್ತ್ಯವಾಸಮು ಹಸಂತಿ ದಿವ್ಯತಪಶ್ಛಟ? ಗಾಂಚಿತಿ ವಿರೂ\nಪಾಕ್ಷುನಿ ವಾಲಿ ನಂದು ಗನಿ ದೀರ್ಯದಾಶಭಯಾನ? ಬಲಾಯಿತು?ಡನೈ"],
laakshaNi:["ಪಕ್ಷವಿರಮಣಮುಭನನನನಮುಲುನು ಭಾಸುರಭಭನಸಲೆನಸಿನಚೋ\nಲಾಕ್ಷಣಿಯನ?ದಗುನತುಲಿತಮದನವಿಲಾಸಲಲಿತಗುಣಗಣಜಲಧೀ.\nಪಕ್ಷವಿರಮಣಮುಭನನನನಮುಲುನು ಭಾಸುರಭಭನಸಲೆನಸಿನಚೋ\nಲಾಕ್ಷಣಿಯನ?ದಗುನತುಲಿತಮದನವಿಲಾಸಲಲಿತಗುಣಗಣಜಲಧೀ."],
dara:["ಎನಿಮಿದಿ ನಗಣಮುಲೆಲಮಿಗ ನಿಲುಪುಚು ನಿರವುಗ ಭಸಲಮು ಲಿಂಪುಗ ನೆರಪನ್\nಮುನು ಕೊನಿ ದರಮಗು ಪೊಲುವುಗ ವಸುವುಲು ಮುರಿಪೆಪು ಯತುಲುಗ ಮೂ?ಡು ನೆಲವುಲನ್ \nಎನಿಮಿದಿ ನಗಣಮುಲೆಲಮಿಗ ನಿಲುಪುಚು ನಿರವುಗ ಭಸಲಮು ಲಿಂಪುಗ ನೆರಪನ್\nಮುನು ಕೊನಿ ದರಮಗು ಪೊಲುವುಗ ವಸುವುಲು ಮುರಿಪೆಪು ಯತುಲುಗ ಮೂ?ಡು ನೆಲವುಲನ್ "],
Saaloora:["ಅಂತನ್ ರಘುಪರಿವೃಢಧನುರುದಿತಶರನಿಕರಸರದನಲಪಟುತರಶಿಖಾ\nಪ್ರಾಂತಂಬಗುಚುಜಲಧಿಬಹುಲಕುಹರನಿವಸದಸುರಮಕರತತಿತತತನೂ \nಸಂತಾನಮುಲು ತೆಕ ತೆಕ ಲಯಿ ತಹ ತಹ ಲಯಿ ತಿಕಮಕ ಪಡಿ ವಡಿಗುಡುಸುಲೈ\nಯಂತರ್ಜಲಮುಲನಸುಚಯಮುಲುರಲಿಸಗಮು ವೆಲಕಿಲ?ಬಡಿಚಲನಮುರಲೆನ್ "],
chaMDavRshTiprayaata:["ನಗಣಯುಗಮು ಮೀದಟಂದೇಡು ರೇಫಲ್ ದಗನ್ ಜಂಡವೃಷ್ಟಾಖ್ಯತೋ ದಂಡಕಂಬೌಹರೀ "],
arNa:["ನಯುಗಮುಪಯಿ ರಾಷ್ಟಕಂಬೈನಚೋ ನರ್ಣಮನ್ ದಂಡಕಂಬೊಪ್ಪುನೋಯಂಜನಾಕಂಜನೇತ್ರಾತ್ಮಜಾ"],
arNava:["ಮೊದಟ ನನಲಮೀ?ದಟಂ ದೊಮ್ಮಿದೇರೇಫಲುಂಪಂಗನೌದಂಡಕಂ ಬರ್ಣವಂ ಬಂಡ್ರು ಶ್ರೀರಾಮಭಕ್ತಾಗ್ರಣೀ "],
vyaaLa:["ಋತುಲಘುವುಲು ಪೈನಿ ರೇಫಲ್ ಪದಿನ್ನಿಲ್ಪಗಾ ವ್ಯಾಳನಾಮಂಬುತೋ? ದಂಡಕಂಬೌನಯಾ ಜಂಬುಮಾಲಿದ್ರುಧೂಮಧ್ಯಜಾ "],
jeemoota:["ಗುಹಮುಖಲಘುವುಲ್ರಮುನ್ರೇಫಲೀರೈದುಜೀಮೂತ ಮನ್ದಂಡಕಂಬಯ್ಯೆನೋನಕ್ರಚಕ್ರಂತನೀಶಾಪಜೀಮೂತಝುಂಝೂಂನಿಲಾ"],
leelaakara:["ರಸಲಘುವುಲಮೀ?ದ?ಬಂದ್ರೇಡುರೇಫಲ್ ದಲಿರ್ಪಂಗ ಲೀಲಾಕರಂ ಬನ್ನಯಾ ದಂಡಕಂಬುನ್ದಗುಂಧಾರುಣಿಂಗಂಪನಾಂಭೋಧಿಕುಂಭೀಸುತಾ"],
uddaama:["ನಯುಗಳಮುನು ರೇಫಯುನ್ರೇಫಲೀರಾಱು ಸುದ್ದಾಮ 'ಮಾ' ದಂಡಕಂಬೌನು ಬೌಲಸ್ತ್ಯಕಾಸೂಹತಾಜಿಸ್ಥಲೀಲಕ್ಷ್ಮಣಪ್ರಾಣಸಂರಕ್ಷನೋದ್ಯದ್ಯಶಾ"],
SaMkha:["ನಯುಗಳಿಪಯಿ ನೆನ್ನ?ಬಧ್ನಾಲ್ಗು ರೇಫಲ್ ಕ್ರಮಂಬೊಪ್ಪ?ಗಾ ನುಂಡಿನನ್ಶಂಖಮನ್ ದಂಡಕಂ ಬೆಂದು ನಂದಂಬಗುನ್ ಶಾಂಖಹಸ್ತಾಂಘ್ರಿನೀರೇಜಭೃಂಗಾಯಮಾನಾಘನಾ "],
nanahata:["ಅಮರಗನನಹಂಬುಲಂದಾದಿಗಾನೊಂಡೆ... ಚೂಡಾಮನೀತ್ಯಾಗವೈರೋಚನಾ"],
sanahata:["ಸಿರಿ ನೇಲು ರಸಿಕುಂಡು ಶ್ರೀವತ್ಸವಕ್ಷುಂಡು ನೀರೇರುಹಾಕ್ಷುಂಡು ನಿತ್ಯಾಸದೃಕ್ಷುಂಡು ತ್ರೈಲೋಕ್ಯಸಂರಕ್ಷಣೋಪಾಯ ದಕ್ಷುಂಡು ಮಾಪಾಲಿ ದೇವುಂಡು ಧೀರುಂ ಡುದಾರಂಡಿತಂ ಡಿಚ್ಚು ಮಾಯಿಚ್ಚಕುನ್ವಚ್ಚು ಸೌಖ್ಯಮ್ಮು ಲಂಚುನ್ಮದಿಂ ಗೋರಿ ಪೆದ್ದಲ್‌ ಸ ಕಾರಂಬುತೋ ಸಂಗತಂ ಬೈ ನಹಂಬಾದಿ ನೊಂಡೆನ್‌ ದಕಾರಾದಿಗಾ ನೈನ; ಲೋ ನೆಲ್ಲ ಚೋಟನ್‌ ದಕಾರಂಬುಲಂ ಬೆಲ್ಲು ಚೆಂದನ್‌ ಗಕಾರಾವಸಾನಂಬು ನೈ ದಂಡಕಾಕಾರ ಮೇಪಾರ? ಗೀರ್ತಿಂತು ರೆಲ್ಲಪ್ಪುಡುನ್‌.","ಕೃತಿನಾದಿಸನಹಂಬುಲೊಂಡೇಂಬ್ರಕಲ್ಪಿಂಚಿ ಯಾಮೀ?ದನೆಲ್ಲಂದಕಾರಪ್ರಧಾನಂಬು ಗುರ್ವಂತಮೈಕ್ರಾಲ....ವಿಶ್ವಂಭರಾಧೀಶ್ವರಾ!!"],
nanata:["ಜಯ ಗಿರಿಶ ಸುರೇಶಮುಕ್ಯಾಮರಸ್ತೋಮಮೌಳಿಸ್ಥಿತಸ್ನಿಗ್ಧಚಾಮಿಕರೋದಗ್ರರತ್ನಪ್ರಯುಕ್ತಾವತಂಸ ಪ್ರಭಾಸಂಚಯಾಂಚತ್ಪದಾಂಭೋರುಹಾ...ಪಾಪೌಘನಾಶಾ ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಃ"],
nanaya:["ಜಯಜಹರಿಗಜೇಂದ್ರಾದಿ ಸದ್ಭಕ್ತರಕ್ಷೈಕ ದಿಕ್ಷಾಭವಾಂಭೋಧಿನಿರ್ಮಗ್ನ ಜಿವಾಳಿಕಿನ್ನೀವಕಾಕೆವ್ವರುಧ್ದಾರಕುಲ್ಧೇವದೇವಾ ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಸ್ತೇ"],
nata:["ಜಲಧಿಕನ್ಯಾಕುಚಾಲಿಪ್ತ ಕಸ್ತೂರಿರೇಖಾಸಮಾಲಂಕೃತೋರಸ್ಕ ರಕ್ಷಿಂಪವೇದಿನು ನಿನ್ನನ್ನುದೇವೇಶಮತ್ಪ್ರಾಣಕೋಶಾ ನಮಸ್ತೇನಮಃ"],
sata:["ಗಿರಿಶಾ ಕೈಲಾಸವಾಸಾ ಧರಾಕನ್ಯಕಾಮುಗ್ಧನೇತ್ರಾಬ್ಜರಾಗಾಂಶುಮಾಲೀ ನನುಂಜೇದುಕೋವೇಭವತ್ಪಾದಸಾನ್ನಿಧ್ಯಮಿಯಗದೇ ದೇವದೇವಾ ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಃ "],
ragaNa:["ದೇವದೇವೇಶ ನಿಪಾದ ಭಕ್ತುಂಡ ಮನ್ನಿಂಪವೇ ದೀನು ದುಗ್ಧಾಬ್ಧಿ  ಶಾಯೀ ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಃ"],
tagaNa:["ಶ್ರೀವತ್ಸವಕ್ಷುಂಡು ನೀರೇರುಹಾಕ್ಷುಂಡು ನಿತ್ಯಾಸದೃಕ್ಷುಂಡು ತ್ರೈಲೋಕ್ಯಸಂರಕ್ಷಣೋಪಾಯ ದಕ್ಷುಂಡು ಮಾಪಾಲಿ ದೇವುಂಡು ಧೀರುಂ ಡುದಾರಂ ಡಿತಂ ಡಿಚ್ಚು ಮಾಯಿಚ್ಚಕುನ್ವಚ್ಚು ಸೌಖ್ಯಮ್ಮು ಲಂಚುನ್ಮದಿಂ ಗೋರಿ ಪೆದ್ದಲ್‌ ಸಕಾರಂಬುತೋ ಸಂಗತಂಬೈ ನಹಂಬಾದಿ ನೊಂಡೆನ್‌ ದಕಾರಾದಿಗಾ ನೈನ; ಲೋ ನೆಲ್ಲಚೋಟನ್‌ ದಕಾರಂಬುಲಂ ಬೆಲ್ಲು ಚೆಂದನ್‌ ಗಕಾರಾವಸಾನಂಬು ನೈ ದಂಡಕಾಕಾರ ಮೇಪಾರ? ಗೀರ್ತಿಂತು ರೆಲ್ಲಪ್ಪುಡುನ್‌","ವಿದ್ವಾಂಸು ಲೆಲ್ಲನ್ ಹ ಕಾರಂಬೆ ಕಾನೀ ನ ಕಾರಂಬೆಕಾನೀ ಸ ಕಾರಂಬೆ ಕಾನೀ ವಚಿಂಪಂ ದಗುನ್ಮುಂದುಗಾ ನಿಂದು ಗಾದೇನಿ ಯಾದಿಂ ದಕಾರಂಬು ಗಲ್ಪಿಂಚಿ ಯಾಮೀದಿ ವೆಲ್ಲನ್ ದಕಾರಂಬುಲೇ ಮೆಂಡುಗಾ ನಿಚ್ಚಕುನ್ವಚ್ಚು ನಂದಾಕ ನಿರ್ಮಿಂಚಿ ಗುರ್ವಂತಮುಂ ಜೇಸಿನನ್ ದಂಡಕಂಬಂಡ್ರು ಕಾದಂಬಿನೀ ನೀಲಗೋಪಾಲ ಬಾಲಾ ನಮಸ್ತೇ ಪುನಸ್ತೇನಮಃ","ಶ್ರೀಕಂಠ ಲೋಕೇಶ ಲೋಕೋದ್ಭವಸ್ತಾನ ಸಂಹಾರಕಾರೀ ಪುರಾರೀ ಮುರಾರೀ ಪ್ರಿಯಾ ಚಂದ್ರಧಾರೀ ...ನಮಸ್ತೇ ನಮಸ್ತೇ ನಮಃ  "],
nagaNa:["ಮಧುಮಧನ ನನು ದಯಗನವೆಜಲಧಿಶಯನ ಹರಿ ಹರೀ"],
hagaNa:["ದೇವದೇವನನ್ನು ಬ್ರೋವರಾವೆದುಗ್ಧ ವರ್ಧಿಕನ್ಯಕಾಮುಖಾಂಬುಜಾತ ಸೂರ್ಯನಿನ್ನೆಗೊಲ್ತು ನೆಲ್ಲವೇಳಲಂ ಬ್ರಭೂ ನಮಃ"],
nasahata:["ಅರಿದಿ ಬಿರುದಾ ನೀವು ರಾಯಂಚ ತೇಜೀವ ಜೀರುಂಡವೈ"],
taaLaragaDa:["ದವುದೌ,ವುಲಗಾಂ,ಚೆಂಗೈ,ಲಾಸಮುತರುಣೆಂದುಕಳಾಧರುನು ನುವಾಸಮು ದಳಹರಿ,ನಿಕಟಸ್ಥಾನಸ್ಥಪುಟಿತಧವಳಚ್ಛಾಯಾ,ಚ್ಚೇದವಿ,ಲಾಸಮು\nದವುದೌ,ವುಲಗಾಂ,ಚೆಂಗೈ,ಲಾಸಮುತರುಣೆಂದುಕಳಾಧರುನು ನುವಾಸಮು ದಳಹರಿ,ನಿಕಟಸ್ಥಾನಸ್ಥಪುಟಿತಧವಳಚ್ಛಾಯಾ,ಚ್ಚೇದವಿ,ಲಾಸಮು"],
Sreekara:["ಪ್ರತಿರೋಜುಜೇಯುಶೌಚಬಾಧ್ಯತಲ್ ಪ್ರಪಂ\nಚಿತಮೌಗಜೇಸೆನೊಕ್ಕಚೀಪುರೆತ್ತಿಭಾ\nರತದೇಶಗೌರವಂಬುರಂಜಿಲೆನ್ ಪ್ರಸ\nನ್ನತಗೂರೆನಂತ ಮೋದಿನಾದರಿಂಚಗಾ ~ ಶ್ರೀ ಪಿರಾಟ್ಲ ವೆಂಕಟ ಶಿವರಾಮಕೃಷ್ಣ ಪ್ರಸಾದ್ ಗಾರಿಚೇ ವಿರಚಿತಂ."],
mattaebha:["ಸಪ್ತಾಶ್ವರೂಢುಡಯಿಸಾವಿತ್ರುಡೀದಿನಮುಸಾಮೀಪ್ಯಮಯ್ಯೆಮಕರಂ\nತೃಪ್ತಾತ್ಮುಲಯ್ಯಿಗೊನಿತೀರೈನಗುಮ್ಮಿಡುಲದೀವಿಂಚುಭೂಸುರಗಣಂ\nಪ್ರಾಪ್ತಿಂಚಪುಣ್ಯಗತಿರಾಜರ್ಷಿಭೀಷ್ಮುಡಟುಭಾವಿಂಚುಮಾರಣದಿನಂ \nತಪ್ತಾಧಿಕಂಬುಲಕುತಪ್ತಾಂಡುಡುನ್ಧರಯುದಾಪೈನನಾಯನಪಧಂ\nಲುಪ್ತಂಬುಲೈಜನವೆಲೋಕಾಲಮಾಂದ್ಯಮುಲುಲೋಜೇರವಹ್ನಿಜಠರಮ್ \nದೀಪ್ತೋದ್ಧತಿನ್ಮೆರಯದಿವ್ಯಂಪುಪೌಷ್ಯಸಿರಿತೀರೈನಮುಗ್ಗುರಚನಂ \nಕ್ಲುಪ್ತಂಬುಲೈನಿಶಲುಕೊಂಡಂತಲೈಪಗಲುಕೊಮ್ಮಾಕುರಾಲುಶಿಶಿರಂ \nಗುಪ್ತಂಬುಲೈಜನಿನಗೋತ್ರೀಕುಲನ್ಋಣಮುಗೊಮ್ಮಂಚುತರ್ಪಣದಿನಂ \nವ್ಯಾಪ್ತಿಂಚಗಾಲಚಿಮಿವಡ್ಲನ್ನಪೊಂಗಲುಲವಡ್ಡಿಂಚುತೀಪಿಪಚನಂ \nಸುಪ್ತಾತ್ಮುಲನ್ಕುದುಪುಜೋರೈನಶೀತಪುವಿಶೋಕಂಪುಭೋಗಿದಹನಂ \nಜ್ಞಪ್ತಿನ್ತಲಂಚುಕೊನಿಸಾಲಂದುಮೇಲುಪಶುಜಾತಂದುಪೂಜಕನುಮಲ್ \nನಪ್ತಾರಪೌತ್ರಸುತನವ್ಯಂಪುಟೂಹಲಿಡಿನಾಣ್ಯಂಪುಬೊಮ್ಮಕೊಲುವುಲ್\nಸಪ್ತಸ್ವರಾವಳುಲಸಲ್ಲಾಪಮುಲ್ಸಲುಪುಸನ್ನಾಯಿಗಂಗಿಬಸವಲ್\nವ್ಯಾಪ್ತಿಂಪನಾಮಧುನಿವಾರಂಬುರಂಗಹರಿಯಂಚೇಗುದಾಸುಭಜನಲ್\nಹಪ್ತಾಲಪಾಟುಯಿಕಹರ್ಮ್ಯಾಲಪೈಕೆಗಿರಿಯಾಡೇಟಿಗಾಲಿಪಟಮುಲ್\nಕೋಪ್ತಾಲುಪಾಸ್ಟ್ರಿಲಿಕಕೊಂಡೆಕ್ಕಿಗಾರೆದಧಿಕೋವಾಲಕಮ್ಮದನಮುಲ್\nಆಪ್ತಾಳಿಬಂಧುತತಿಕಾನಂದಸಂಗಮಮುಆಸೂರ್ಯುಸಂಕ್ರಮಣಮುಲ್ \nಲಿಪ್ತಲ್ಯುಗಾಲುಗನುಲೆಕ್ಕೌನಿರೀಕ್ಷಣಮುಲೀಡೇರುರಕ್ತಿಫಲದಂ \nಜಪ್ತೈನಬುದ್ಧಿವಿಡಿಚಾಕಂಟಿಸೂಕ್ಷ್ಮತನುಸಾಧಿಂಚುಗೊಪ್ಪತರುಣಂ \nಕ್ಷಿಪ್ತಾನಕುಂದುಮದಿಸಿದ್ಧಂದಿನಾತ್ಮಗನಿಕೃತ್ಸ್ನಮ್ಮು ಕೃಷ್ಣುನಿಪರಂ ~ ಶ್ರೀ ಸೂರ್ಯನಾರಾಯಣ ಸರಿಪಲ್ಲಿ ಗಾರಿಚೇ ವಿರಚಿತಂ."],
}

Config.Samples=["అటజనికాంచెభూమిసురుడంబరచుంభశిరస్సరజ్ఝరీ\nపటలముహుర్ముహుర్ లుఠదభంగతరంగమృదంగనిశ్వన\nస్ఫుటనటనానుకూల పరిపుల్ల కలాపకలాపిజాలమున్\nఘటకచరత్కరేణుకరకంపితసారముశీతసైలమున్","తివిరి యిసుమున తైలంబు దీయవచ్చు\nదవిలి మృగతృష్ణ లో నీరు ద్రావవచ్చు\nతిరిగి కుందేటి కొమ్ము సాధింపవచ్చు\nచేరి మూర్ఖుల మనసు రంజింపరాదు","తరువు లతిరసఫలభార గురుత గాంచు\nనింగి వ్రేలుచు నమృత మొసంగు మేఘు\nడుద్ధతులు గారు బుధులు సమృద్ధి చేత\nజగతి నుపకర్తలకు నిది సహజగుణము...!","తెలుగదేలయన్న దేశంబు తెలుగేను\nతెలుగు వల్లభుండ తెలు గొకండ;\nఎల్ల నృపులు గొలువ నెరుగవే బాసాడి\nదేశభాష లందు తెలుగు లెస్స.","గగన భాగమ్ము ప్రావృష ద్విగుణ రోష\nఘటిత నటనోగ్ర ధాటీ విఘటిత ప్రకట\nకుటిల ధూర్జటి ఘన జటా పటల నిటల\nవికట భృకుటీ కుటీర ముద్విగ్న మాయె.","భరత ఖండంబు చక్కని పాడి యావు\nహిందువులు లేగదూడలై ఏడ్చుచుండ\nతెల్లవారను గడుసరి గొల్లవారు\nపితుకుచున్నారు మూతులు బిగియ గట్టి.","పలికెడిది భాగవతమట\nపలికించు విభుండు రామ భద్రుండట ;నే\nపలికిన భవహర మగునట\nపలికెద; వేరొండు గాథ పలుకగ నేలా!","అంబుజోదర దివ్య పాదారవింద \nచింతనామృత పాన విశేష మత్త\nచిత్తమే రీతి నితరంబు చేరనేర్చు\nవినుత గుణశీల మాటలు వేయునేల","ఘన ఘనాఘన గజ గ్రైవేయ ఘంటికా టంకారములకు ఘంటాపథంబు\nశక్రచా పోదగ్ర శార్దూల పాలనా విభవోన్నతికి భూరి విపిన సీమ\nచటుల ఝంఝా మరు ఛ్ఛతకోటి భేతాళ లుంఠన క్రియలకు రుద్రభూమి\nపటు తటిద్విలసన బ్రహ్మరాక్షస కఠోరాట్టహాసమున కహార్య బిలము","మందార మకరంద మాధుర్యమున దేలు మధుపంబు వోవునే మదనములకు\nనిర్మల మందాకినీ వీచికల దూగు రాయంచ జనునె తరంగిణులకు\nలలిత రసాల పల్లవ ఖాదియై చొక్కు కోయిల జేరునే కుటజములకు\nపూర్ణేందు చంద్రికా స్ఫురిత చకోరకం బరుగునే సాంద్ర నీహారములకు"];

